                "0511" => "Կենդանական ծագման մթերք՝ այլ տեղում չնշված կամ չներառված, 01 կամ 03 խմբում նշված սատկած կենդանիներ` ոչ պիտանի սննդի մեջ օգտագործելու համար",
                "0601" => "Կոճղեզներ, պալարներ, արմատապալարներ, պալարակոճղեզներ, հիմնարմատներ՝ ներառյալ ճյուղավորվածները, որոնք գտնվում են վեգետատիվ դադարի, բուսաճության (վեգետացիայի) կամ ծաղկման շրջանում. եղերդի բույսեր եւ արմատներ՝ բացի 1212 ապրանքային դիրքում ընդգրկված արմատներից",
                "0602" => "Կենդանի այլ բույսեր (ներառյալ դրանց արմատները), տնկաշիվեր եւ ճյուղեր. Սնկամարմիններ",
                "0603" => "Կտրված ծաղիկներ եւ կոկոններ՝ ծաղկեփնջեր կազմելու համար պիտանի կամ դեկորատիվ նպատակների համար` թարմ, չորացրած, ներկած, սպիտակեցրած, տոգորված կամ այլ միջոցներով պատրաստված",
                "0604" => "Տերեւներ, ճյուղեր եւ բույսերի այլ մասեր` առանց ծաղիկների կամ կոկոնների, խոտեր, մամուռներ եւ քարաքոսներ՝ ծաղկեփնջեր կազմելու համար պիտանի կամ դեկորատիվ նպատակների համար` թարմ, չորացրած, ներկած, սպիտակեցրած, տոգորված կամ այլ միջոցներով պատրաստված",
                "0701" => "Կարտոֆիլ՝ թարմ կամ պաղեցրած",
                "0702" => "Լոլիկներ՝ թարմ կամ պաղեցրած",
                "0703" => "Գլուխ սոխ, սոխ–շալոտ, սխտոր, սոխ-պրաս եւ այլ կոճղեզավոր բանջարեղեն` թարմ կամ պաղեցրած",
                "0704" => "Գլուխ կաղամբ, ծաղկակաղամբ, շաղգամակաղամբ, տերեւակաղամբ եւ Brassica ցեղի այլ նույնանման ուտելի բանջարեղեն` թարմ կամ պաղեցրած",
                "0705" => "Սալաթ–կաթնուկ (Lactica sativa) եւ եղերդ (Cichorium spp.), թարմ կամ պաղեցրած",
                "0706" => "Գազար, շաղգամ, սեղանի ճակնդեղ, քոշմորուք, արմատային նեխուր, ամսական բողկ եւ այլ նույնանման ուտելի արմատապտուղներ` թարմ կամ պաղեցրած",
                "0707" => "Վարունգներ եւ մանրավարունգներ` թարմ կամ պաղեցրած",
                "0708" => "Լոբազգի բանջարեղեն, կեղեւահանած կամ կեղեւով` թարմ կամ պաղեցրած",
                "0709" => "Այլ բանջարեղեն` թարմ կամ պաղեցրած",
                "0710" => "Բանջարեղեն` (հում կամ ջրում եփած կամ շոգեխաշած), սառեցրած",
                "0711" => "Պահածոյացված բանջարեղեն՝ կարճաժամկետ պահպանման համար (օրինակ՝ ծծմբի երկօքսիդով, աղաջրի, ծծմբաջրի կամ մեկ այլ ժամանակավոր պահածոյացնող լուծույթի մեջ), բայց այդ ձեւով անմիջականորեն սննդի մեջ օգտագործելու համար ոչ պիտանի",
                "0712" => "Բանջարեղեն՝ չորացրած, ամբողջական, կտրատած կտորներով, բլիթներով, մանրացրած կամ փոշու ձեւով, բայց հետագա մշակման չենթարկած",
                "0713" => "Լոբազգի բանջարեղեն` չորացրած, կեղեւահանած, սերմնակճեպը հանած կամ չհանած, կոտոր կամ ոչ կոտոր",
                "0714" => "Մանիոկ, մարանտա, սալեպ, գետնատանձ կամ տոպինամբուր, քաղցր կարտոֆիլ կամ բատատ եւ նույնանման արմատապտուղներ ու պալարապտուղներ՝ օսլայի կամ ինուլինի բարձր բաղադրությամբ` թարմ, պաղեցրած, սառեցրած կամ չորացրած, ամբողջական կամ բլիթներով կտրատած կամ գրանուլների տեսքով. սագոյան արմավենու միջուկ",
                "0801" => "Հնդկընկույզներ, բրազիլական ընկույզներ եւ կեշյու ընկույզներ՝ թարմ կամ չորացրած, կճեպից մաքրած կամ չմաքրած, կեղեւով կամ առանց կեղեւի",
                "0802" => "Այլ ընկույզներ՝ թարմ կամ չորացրած, կճեպից մաքրած կամ չմաքրած, կեղեւով կամ առանց կեղեւի",
                "0803" => "Բանաններ՝ ներառյալ պլանտայնները` թարմ կամ չորացրած",
                "0804" => "Արմավ, թուզ, արքայախնձոր, ավոկադո, գուայավա, մանգո եւ մանգոստան կամ գարցինիա՝ թարմ կամ չորացրած",
                "0805" => "Ցիտրուսային պտուղներ` թարմ կամ չորացրած",
                "0806" => "Խաղող` թարմ կամ չորացրած",
                "0807" => "Սեխեր (ներառյալ ձմերուկները) եւ պապայան՝ թարմ",
                "0808" => "Խնձորներ, տանձեր եւ սերկեւիլ` թարմ",
                "0809" => "Ծիրաններ, բալ եւ կեռաս, դեղձ (ներառյալ նեկտարինները), սալոր եւ մամուխ՝ թարմ",
                "0810" => "Այլ պտուղներ՝ թարմ",
                "0811" => "Պտուղներ եւ ընկույզներ՝ եռացող ջրի մեջ կամ շոգիով ջերմամշակման ենթարկված կամ չենթարկված, սառեցրած, շաքար կամ քաղցրացնող այլ նյութեր ավելացրած կամ չավելացրած",
                "0812" => "Մրգեր եւ ընկույզներ, պահածոյացված՝ կարճ ժամկետով պահելու համար (օրինակ` ծծմբի երկօքսիդով, աղաջրի, ծծմբաջրի կամ մեկ այլ ժամանակավոր պահածոյացնող լուծույթի մեջ), բայց այդ ձեւով անմիջականորեն սննդի մեջ օգտագործելու համար ոչ պիտանի",
                "0813" => "Չորացրած պտուղներ՝ բացի 0801–0806 ապրանքային դիրքերում ընդգրկված պտուղներից. տվյալ խմբում ընդգրկված ընկույզների կամ չորացրած պտուղների խառնուրդներ",
                "0814" => "Ցիտրուսային պտուղների կեղեւ կամ սեխի կճեպներ (ներառյալ ձմերուկի կճեպը)՝ թարմ, սառեցրած, չորացրած կամ կարճ ժամկետով պահելու համար աղաջրի, ծծմբաջրի կամ մեկ այլ ժամանակավոր պահածոյացնող լուծույթի մեջ պահածոյացրած",
                "0901" => "Սուրճ՝ բոված կամ չբոված, կոֆեինով կամ առանց կոֆեինի. սուրճի կեղեւ եւ սուրճի հատիկների թաղանթ. սուրճի փոխարինիչներ՝ ցանկացած համամասնությամբ սուրճի պարունակությամբ",
                "0902" => "Թեյ՝ համաբուրավետիչ հավելումներով կամ առանց դրանց",
                "0903" => "Մատե կամ պարագվայական թեյ",
                "0904" => "Piper ցեղի պղպեղ, Capsicum ցեղի կամ Pimenta ցեղի պտուղներ` չորացրած, մանրատած կամ աղացած",
                "0905" => "Վանիլ",
                "0906" => "Դարչին եւ դարչնածառի ծաղիկներ",
                "0907" => "Մեխակ (ամբողջական պտուղները, ծաղիկները եւ ծաղկաբները)՝",
                "0908" => "Մշկընկույզ, մացիս եւ հիլ",
                "0909" => "Անիսոնի, բադիանի, ֆենխելի, գինձի, հռոմեական քիմոնի կամ վոլոշյան քիմոնի, կամ քիմոնի սերմեր. գիհու պտուղներ",
                "0910" => "Կոճապղպեղ, զաֆրան, տուրմերիկ (քրքում), ուրց կամ խոռ, դափնետերեւ, կարրի եւ այլ համեմունքներ",
                "1001" => "Ցորեն եւ մեսլին (ցորենի եւ աշորայի խառնուրդ)",
                "1002" => "Աշորա",
                "1003" => "Գարի",
                "1004" => "Վարսակ",
                "1005" => "Եգիպտացորեն",
                "1006" => "Բրինձ",
                "1007" => "Սորգո հացահատիկային",
                "1008" => "Հնդկացորեն, կորեկ եւ սերինոսահատիկի սերմեր՝ այլ հացազգիներ",
                "1101" => "Ալյուր՝ ցորենի կամ ցորենա-աշորային",
                "1102" => "Ալյուր՝ այլ հացահատիկների սերմերից՝ բացի ցորենից կամ ցորենա-աշորային ալյուրից",
                "1103" => "Ձավար, խոշոր աղացվածքի ալյուր եւ հացահատիկների սերմերի գրանուլներ",
                "1104" => "Հացահատիկների սերմեր` այլ միջոցներով մշակված (օրինակ` թեփահանած, տափակեցրած, վերամշակման միջոցով փաթիլների վերածած, ծեծած, մանրաձավարի տեսքով կամ մանրատած), բացի 1006 ապրանքային դիրքում նշված բրնձից. հացահատիկների սերմերի սաղմեր՝ ամբողջական, տափակեցրած, փաթիլների տեսքով կամ աղացած",
                "1105" => "Ալյուր՝ մանր եւ խոշոր աղացվածքի, փոշի, փաթիլներ, գրանուլներ կարտոֆիլից",
                "1106" => "Ալյուր՝ մանր եւ խոշոր աղացվածքի եւ փոշի 0713 ապրանքային դիրքի լոբազգի չորացրած բանջարեղենից, 0714 ապրանքային դիրքի սագարմավենու միջուկից, արմատապտուղներից կամ պալարապտուղներից կամ 08 խմբում դասակարգված մթերքներից",
                "1107" => "Ածիկ՝ բոված կամ չբոված",
                "1108" => "Օսլա, ինուլին",
                "1109" => "Ցորենի սոսնձանյութ՝ չոր կամ հում",
                "1201" => "Սոյայի պտուղներ՝ մանրատած կամ չմանրատած",
                "1202" => "Գետնընկույզ՝ չբոված կամ որեւէ այլ եղանակով չպատրաստած, կեղեւահանած կամ կեղեւով, մանրատած կամ չմանրատած",
                "1203" => "Կոպրա",
                "1204" => "Վուշի սերմեր՝ մանրատած կամ չմանրատած",
                "1205 " => "Հլածուկի կամ կոլզայի սերմեր՝ մանրատած կամ չմանրատած",
                "1206" => "Արեւածաղկի սերմեր՝ մանրատած կամ չմանրատած",
                "1207" => "Այլ յուղատու մշակաբույսերի սերմեր ու պտուղներ` մանրատած կամ չմանրատած",
                "1208" => "Մանր եւ խոշոր աղացվածքի ալյուր՝ ստացված յուղատու մշակաբույսերի սերմերից կամ պտուղներից՝ բացի մանանեխի սերմերից",
                "1209" => "Սերմեր, պտուղներ եւ սպորներ ցանքի համար",
                "1210" => "Գայլուկի պալարներ՝ թարմ կամ չորացրած, մանրատած կամ չմանրատած, փոշենման կամ հատիկավոր. Լուպուլին",
                "1211" => "Բույսեր եւ դրանց մասերը (ներառյալ սերմերն ու պտուղները), օգտագործվում են որպես օծանելիքային, դեղագործական կամ միջատասպան, սնկասպան միջոցներ կամ նույնանման նպատակներով, թարմ կամ չորացրած, ամբողջական կամ մանրացրած, մանրատած կամ աղացած",
                "1212" => "Եղջերածառի պտուղներ, ծովային եւ այլ ջրիմուռներ, շաքարի ճակնդեղ եւ շաքարեղեգն, թարմ, պաղեցրած, սառեցրած կամ չորացրած, մանրատած կամ չմանրատած. պտուղների կորիզներ եւ միջուկներ, բուսական ծագման այլ մթերքներ (ներառյալ Cichorium intybus sativum տեսակի եղերդի չբոված արմատները), որոնք օգտագործվում են գլխավորապես սննդի մեջ՝ այլ տեղում չնշված կամ չներառված",
                "1213" => "Հացահատիկային բույսերի ծղոտ եւ մղեղ՝ չվերամշակված, մանրացրած կամ չմանրացրած, աղացած կամ չաղացած, մամլած կամ գրանուլների տեսքով",
                "1214" => "Շաղգամ, տերեւավոր ճակնդեղ (մանգոլդ), կերային արմատապտուղներ, խոտ, առվույտ, երեքնուկ, կորնգան, տերեւակաղամբ, լուպին, վիկ եւ նույնանման կերային մթերքներ, հատիկավոր (գրանուլացված) կամ ոչ հատիկավոր",
                "1301" => "Դոճխեժ` բնական չմաքրված. բնական բուսախեժեր, խեժեր, սոսնձախեժեր եւ բեւեկն (օրինակ` բալասանները)",
                "1302" => "Բուսական հյութեր ու լուծամզվածքներ. պեկտինային նյութեր, պեկտինատներ եւ պեկտատներ. ագար-ագար եւ բուսական ծագման այլ սոսինձներ ու խտարարներ՝ ձեւափոխված կամ չձեւափոխված",
                "1401" => "Բուսական ծագում ունեցող նյութեր, որոնք գլխավորապես օգտագործվում են հյուսելու համար (օրինակ` հնդկեղեգ, եղեգնարմավենի, եղեգ, ճիլ, ուռի, ռաֆիա, հացահատիկային բույսերի մաքրած, սպիտակեցրած կամ ներկած ծղոտ եւ լորենու կեղեւ)",
                "1404" => "Բուսական ծագում ունեցող նյութեր` այլ տեղում չնշված կամ չներառված",
                "1501" => "Խոզաճարպ (ներառյալ հալած խոզաճարպը) եւ ընտանի թռչունների ճարպ՝ բացի 0209 կամ 1503 ապրանքային դիրքերում նշված ճարպից",
                "1502" => "Խոշոր եղջերավոր անասունների, ոչխարների կամ այծերի ճարպ՝ բացի 1503 ապրանքային դիրքում նշված ճարպից",
                "1503" => "Հալած խոզաճարպ-բնաճարպ, հալած խոզաճարպ-օյլ, օլեոստեարին, օլեո-օյլ եւ կենդանական յուղ, էմուլսիայի չվերածած կամ չխառնուրդած, կամ որեւէ այլ ձեւով չպատրաստված",
                "1504" => "Ձկան կամ ծովային կաթնասունների ճարպեր, յուղեր եւ դրանց զտամասեր` չռաֆինացված կամ ռաֆինացված, սակայն առանց փոփոխելու քիմիական կազմը",
                "1505" => "Ճարպաքրտինք եւ դրանից ստացվող ճարպանյութեր (ներառյալ լանոլինը)",
                "1506" => "Կենդանական այլ ճարպեր, յուղեր եւ դրանց զտամասերը՝ չռաֆինացված կամ ռաֆինացված, սակայն առանց փոփոխելու քիմիական կազմը",
                "1507" => "Սոյայի յուղ եւ դրա զտամասերը` չռաֆինացված կամ ռաֆինացված, սակայն առանց փոփոխելու քիմիական կազմը",
                "1508" => "Գետնընկույզի յուղ եւ դրա զտամասերը` չռաֆինացված կամ ռաֆինացված, առանց փոփոխելու քիմիական կազմը",
                "1509" => "Ձիթապտղի յուղ եւ դրա զտամասերը` չռաֆինացված կամ ռաֆինացված, սակայն առանց փոփոխելու քիմիական կազմը",
                "1510" => "Այլ յուղեր եւ դրանց զտամասերը, որոնք ստացվում են միայն կանաչ կամ սեւ ձիթապտուղներից՝ չռաֆինացված կամ ռաֆինացված, սակայն առանց փոփոխելու քիմիական կազմը՝ ներառյալ այդ յուղերի կամ զտամասերի խառնուրդները ապրանքային 1509 դիրքում ընդգրկված յուղերի կամ դրանց զտամասերի հետ",
                "1511" => "Արմավենու յուղ եւ դրա զտամասերը` չռաֆինացված կամ ռաֆինացված, սակայն առանց փոփոխելու քիմիական կազմը",
                "1512" => "Արեւածաղկի, քրքումի կամ բամբակի յուղ եւ դրանց զտամասերը` չռաֆինացված կամ ռաֆինացված, սակայն առանց փոփոխելու քիմիական կազմը",
                "1513" => "Հնդկընկույզի (միջուկի), արմավամիջուկի կամ բաբասսուի յուղ եւ դրանց զտամասերը՝ չռաֆինացված կամ ռաֆինացված, սակայն առանց փոփոխելու քիմիական կազմը",
                "1514" => "Կանճրակի (կանճրակից կամ կոլզայից) կամ մանանեխի յուղ եւ դրա զտամասերը` չռաֆինացված կամ ռաֆինացված, սակայն առանց փոփոխելու քիմիական կազմը",
                "1515" => "Այլ չցնդող բուսական ճարպեր, յուղեր (ներառյալ ժոժոբայի յուղը) եւ դրանց զտամասերը՝ չռաֆինացված կամ ռաֆինացված, սակայն առանց փոփոխելու քիմիական կազմը",
                "1516" => "Կենդանական կամ բուսական ծագման ճարպեր եւ յուղեր ու դրանց զտամասերը` լրիվ կամ մասնակի հիդրոգենացված, ընդեթերացված, վերաեթերացված կամ էլաիդինացված, չռաֆինացված կամ ռաֆինացված, սակայն հետագա մշակման չենթարկած",
                "1517" => "Մարգարին. սննդի մեջ օգտագործելու համար պիտանի խառնուրդներ կամ պատրաստի մթերքներ` կենդանական կամ բուսական ճարպերից կամ յուղերից կամ տվյալ խմբի տարբեր ճարպերի կամ յուղերի զտամասերից՝ բացի 1516 ապրանքային դիրքում նշված սննդի ճարպերից կամ յուղերից կամ դրանց զտամասերից",
                "1518" => "Կենդանական կամ բուսական ծագման ճարպեր եւ յուղեր ու դրանց զտամասերը, եփված, թթվեցրած, ջրազրկված, սուլֆացված, օդային փչումով թթվեցրած, պոլիմերացված տաքացումով վակուումում կամ իներտ գազի մեջ, կամ քիմիապես վերափոխված այլ եղանակով՝ բացի 1516 ապրանքային դիրքում ընդգրկված մթերքներից. սննդի մեջ օգտագործելու համար ոչ պիտանի խառնուրդներ կամ պատրաստի մթերքներ՝ կենդանական կամ բուսական ճարպերից կամ յուղերից կամ տվյալ խմբի տարբեր ճարպերի կամ յուղերի զտամասերից, այլ տեղում չնշված կամ չընդգրկված",
                "1520" => "Գլիցերին հում. գլիցերինային ջուր եւ գլիցերինային մոխրաջուր",
                "1521" => "Բուսական մոմեր (բացի եռգլիցերիդներից), մեղվամոմ, այլ միջատների մոմ ու կետաճարպ՝ ներկած կամ չներկած, ռաֆինացված կամ չռաֆինացված",
                "1522" => "Դեգրա մնացորդներ` բուսական կամ կենդանական ճարպանյութերի կամ մոմերի մշակումից հետո",
                "1601" => "Երշիկներ եւ մսից, մսային ենթամթերքներից կամ արյունից պատրաստված համանման մթերքներ. դրանց հիմքով պատրաստված պատրաստի սննդամթերք",
                "1602" => "Մսից, մսային ենթամթերքներից կամ արյունից պատրաստի կամ պահածոյացված այլ մթերքներ",
                "1603" => "Լուծամզվածքներ եւ հյութեր մսից, ձկից կամ խեցգետնանմաններից, կակղամարմիններից կամ ջրային այլ անողնաշարավորներից",
                "1604" => "Պատրաստի կամ պահածոյացված ձուկ. թառափազգիների ձկնկիթ եւ դրա փոխարինիչները՝ պատրաստած ձկան ձկնկիթի հատիկներից",
                "1605" => "Պատրաստի կամ պահածոյացված խեցգետնանմաններ, կակղամարմիններ եւ ջրային այլ անողնաշարավորներ",
                "1701" => "Եղեգնաշաքար կամ ճակնդեղի շաքար եւ քիմիապես մաքուր բուսաշաքար՝ պինդ վիճակում",
                "1702" => "Շաքարի այլ տեսակներ՝ ներառյալ քիմիապես մաքուր կաթնաշաքարը, ածիկաշաքարը, խաղողաշաքարը եւ պտղաշաքարը, պինդ վիճակում. շաքարի օշարակներ՝ առանց համաբուրավետիչ կամ ներկող հավելումների. արհեստական մեղր` բնական մեղրի հետ խառնած կամ չխառնած. կարամելային զովացուցիչ (քուլեր)",
                "1703" => "Կերամաթ` ստացված շաքարի հեռացումից կամ ռաֆինացումից",
                "1704" => "Շաքարից պատրաստված հրուշակեղեն (ներառյալ սպիտակ շոկոլադը), առանց կակաոյի պարունակության",
                "1801" => "Կակաոյի ունդեր՝ ամբողջական կամ մանրատած, հում կամ բոված",
                "1802" => "Կակաոյի կեղեւ, պատյան, նրբամաշկ եւ այլ մնացորդներ",
                "1803" => "Կակաո-մածուկ՝ յուղազերծված կամ չյուղազերծված",
                "1804" => "Կակաո-յուղ, կակաո-ճարպ",
                "1805" => "Կակաոյ-փոշի՝ առանց շաքարի կամ քաղցրացնող այլ նյութերի հավելմամբ",
                "1806" => "Շոկոլադ եւ կակաո պարունակող այլ պատրաստի սննդամթերք",
                "1901" => "Ածիկային լուծամզուք, պատրաստի սննդամթերք՝ պատրաստված մանր կամ խոշոր աղացվածքի ալյուրից, ձավարից, օսլայից կամ ածիկային լուծամզուքից` առանց կակաոյի պարունակության կամ 40% զանգվածային բաժնից պակաս կակաոյի պարունակությամբ ամբողջովին յուղազրկված հիմքի հաշվարկով, այլ տեղում չնշված կամ չներառված, 0401-0404 ապրանքային դիրքերում ընդգրկված հումքից ստացված պատրաստի սննդամթերք առանց կակաոյի պարունակության կամ 5% զանգվածային բաժնից պակաս կակաոյի պարունակությամբ ամբողջովին յուղազրկված հիմքի հաշվարկով, այլ տեղում չնշված կամ չներառված",
                "1902" => "Մակարոնային արտադրատեսակներ՝ ջերմային մշակման ենթարկված կամ չենթարկված, միջուկով (մսից կամ այլ մթերքներից) կամ առանց միջուկի կամ այլ եղանակով պատրաստված, ինչպես, օրինակ՝ սպագետտի, մակարոն, լապշա, եղջրիկներ, խմորագնդիկներ, ռավիոլա, կաննելոն, կուսկուս՝ պատրաստի կամ ոչ պատրաստի սննդի մեջ օգտագործելու համար",
                "1903" => "Տապիոկ եւ դրա փոխարինիչները` պատրաստված օսլայից փաթիլների, հատիկների (գրանուլների), ձավարահատիկների, մանրահատիկների կամ նույնանման այլ տեսքով",
                "1904" => "Պատրաստի սննդամթերք` ստացված հացաբույսերի հատիկները կամ հացահատիկային մթերքները (օրինակ՝ եգիպտացորենի փաթիլներ) փքելու կամ բովելու միջոցով, հացաբույսեր (բացի եգիպտացորենի հատիկներից)՝ հատիկի կամ փաթիլների տեսքով կամ այլ եղանակով մշակված հատիկի տեսքով՝ (բացի մանր եւ խոշոր աղացվածքի ալյուրից, ձավարից)՝ նախապես եփած կամ այլ եղանակով պատրաստված, այլ տեղում չնշված կամ չներառված",
                "1905" => "Հաց, ալյուրով պատրաստված հրուշակեղեն, թխվածքներ, թխվածքաբլիթներ եւ հացաբուլկեղենային ու ալյուրից պատրաստված հրուշակեղեն՝ կակաոյի պարունակությամբ կամ առանց կակաոյի, վաֆլու սկավառակներ, դեղագործական նպատակներով օգտագործելու համար պիտանի դատարկ դեղապատիճներ, վաֆելային բոլորաթերթեր՝ ծրարելու համար, բրնձաթուղթ եւ նույնանման մթերքներ",
                "2001" => "Բանջարեղեն, մրգեր, ընկույզներ եւ բույսերի այլ ուտելի մասեր՝ պատրաստված կամ պահածոյացված քացախի կամ քացախաթթվի հավելմամբ",
                "2002" => "Լոլիկներ՝ պատրաստված կամ պահածոյացված առանց քացախի կամ քացախաթթվի հավելման",
                "2003" => "Սնկեր եւ գետնասնկեր՝ պատրաստված կամ պահածոյացված առանց քացախի կամ քացախաթթվի հավելման",
                "2004" => "Այլ բանջարեղեն՝ պատրաստված կամ պահածոյացված առանց քացախ կամ քացախաթթու ավելացնելու, սառեցված՝ բացի 2006 ապրանքային դիրքում ընդգրկված մթերքներից",
                "2005" => "Այլ բանջարեղեն՝ պատրաստված կամ պահածոյացված առանց քացախ կամ քացախաթթու ավելացնելու, չսառեցված՝ բացի 2006 ապրանքային դիրքում ընդգրկված մթերքներից",
                "2006" => "Բանջարեղեն, մրգեր, ընկույզներ, պտուղների կեղեւ եւ բույսերի այլ մասեր՝ շաքարի օգնությամբ պահածոյացված (շաքարի թանձրահյութով ներծծված, շաքարահյութով պատված կամ շաքարած)",
                "2007" => "Ջեմեր, մրգային դոնդողներ, մարմելադներ, մրգային կամ ընկուզային խյուսեր, մրգային կամ ընկուզային մածուկ՝ ստացված ջերմային մշակման եղանակով, այդ թվում՝ շաքարի կամ այլ քաղցրացնող նյութերի հավելմամբ",
                "2008" => "Մրգեր, ընկույզներ եւ բույսերի այլ ուտելի մասեր՝ այլ եղանակով պատրաստված կամ պահածոյացված, շաքարի հավելումներ կամ այլ քաղցրացնող նյութեր կամ սպիրտ պարունակող կամ չպարունակող, այլ տեղում չնշված կամ չընդգրկված",
                "2009" => "Մրգային հյութեր (ներառյալ խաղողի քաղցուն) եւ բանջարեղենի հյութերը՝ չխմորված ու սպիրտի հավելումներ չպարունակող, շաքար կամ այլ քաղցրացնող նյութեր ավելացրած կամ չավելացրած",
                "2101" => "Սուրճի, թեյի կամ մատեի (պարագվայական թեյի) լուծամզուքներ, բնահյութեր եւ խտածոներ (կոնցենտրատներ) եւ պատրաստի մթերքներ՝ դրանց կամ սուրճի հիմքով, թեյի կամ մատեի (պարագվայական թեյի) հիմքով. բոված եղերդ եւ սուրճի այլ բոված փոխարինիչներ եւ դրանց լուծամզուքները, բնահյութերը եւ խտածոները",
                "2102" => "Խմորիչներ (ակտիվ կամ ոչ ակտիվ). այլ մեռած միաբջիջ միկրոօրգանիզմներ (բացի 3002 ապրանքային դիրքում նշված պատվաստանյութերից). հացաթխման պատրաստի փոշիներ",
                "2103" => "Մթերքներ՝ սոուսներ պատրաստելու համար եւ պատրաստի սոուսներ. համային հավելումներ եւ խառը համեմունքներ. մանանեխի փոշի եւ պատրաստի մանանեխ",
                "2104" => "Պատրաստի ապուրներ ու արգանակներ եւ նախապատրաստուկներ դրանք պատրաստելու համար. հոմոգենացված բաղադրամասային պատրաստի սննդամթերք",
                "2105" => "Պաղպաղակ եւ սննդային սառույցի այլ տեսակներ՝ կակաո չպարունակող կամ պարունակող",
                "2106" => "Սննդամթերք՝ այլ տեղ չնշված կամ չներառված",
                "2201" => "Ջրեր՝ ներառյալ բնական կամ արհեստական հանքային ջրերը, գազավորված, առանց շաքարի կամ այլ քաղցրացնող կամ համաբուրավետիչ նյութերի ավելացման. սառույց եւ ձյուն",
                "2202" => "Ջրեր՝ ներառյալ հանքային եւ գազավորված ջրերը, շաքարի կամ այլ քաղցրացնող կամ համաբուրավետիչ նյութերի պարունակությամբ, եւ այլ ոչ ալկոհոլային խմիչքներ՝ բացառությամբ 2009 ապրանքային դիրքում ընդգրկված մրգային եւ բանջարեղենային հյութերից",
                "2203" => "Գարեջուր ածիկային",
                "2204" => "Բնական խաղողի գինիներ՝ ներառյալ թունդացված գինիները. խաղողի քաղցրահյութ՝ բացի 2009 ապրանքային դիրքում նշվածից",
                "2205" => "Վերմուտներ եւ խաղողի այլ բնական գինիներ` բուսական կամ բուրավետ նյութերի ավելացմամբ",
                "2206" => "Խմորման ենթարկված այլ խմիչքներ (օրինակ՝ սիդր, պերրի կամ տանձի սիդր, մեղրաըմպելիք). խառնուրդներ խմորման ենթարկված խմիչքներից եւ խմորման ենթարկված խմիչքների եւ ոչ ալկոհոլային խմիչքների խառնուրդներ` այլ տեղ չնշված կամ չընդգրկված",
                "2207" => "80% ծավալային բաժին կամ ավելի սպիրտի խտությամբ չբնափոխված էթիլային սպիրտ. բնափոխված, ցանկացած խտության էթիլային սպիրտ եւ այլ սպիրտային թրմօղի",
                "2208" => "80% ծավալային բաժնից ոչ պակաս սպիրտի խտությամբ չբնափոխված էթիլային սպիրտ. սպիրտային թրմօղի, լիկյորներ եւ սպիրտային այլ խմիչքներ",
                "2209" => "Քացախ եւ դրա փոխարինիչներ, որոնք ստացվել են քացախաթթվից",
                "2301" => "Խոշոր եւ մանր աղացվածքի ալյուր եւ հատիկներ (գրանուլներ)՝ մսից կամ մսային ենթամթերքից, ձկից կամ խեցգետնանմաններից, կակղամարմիններից կամ ջրային այլ անողնաշարավորներից, որոնք պիտանի չեն սննդի մեջ օգտագործելու համար. Ճարպատակուցք",
                "2302" => "Հացաբույսերի կամ լոբազգիների հատիկների մաղումից, աղալուց կամ այլ կերպով վերամշակումից ստացված թեփ, մաղուցք, դարման եւ այլ մնացորդներ՝ չհատիկավորված (չգրանուլացված ) կամ հատիկավորված",
                "2303" => "Օսլայի արտադրության մնացորդներ եւ նույնանման մնացորդներ. բազուկի քուսպ, բագասսա, կամ շաքարեղեգի քուսպ, եւ շաքարի արտադրության այլ մնացորդներ, տակուցք եւ գարեջրագործության կամ օղեգործության այլ թափոններ՝ չհատիկավորված կամ հատիկավորված",
                "2304" => "Կոպտոն եւ այլ կոշտ մնացորդներ, որոնք ստացվում են սոյայի յուղի զատման ընթացքում՝ չաղացած կամ աղացած, չհատիկավորված կամ հատիկավորված",
                "2305" => "Կոպտոն եւ այլ կոշտ մնացորդներ, որոնք ստացվում են գետնընկույզի յուղի զատման ընթացքում՝ չաղացած կամ աղացած, չհատիկավորված կամ հատիկավորված",
                "2306" => "Կոպտոն եւ այլ կոշտ թափոններ, որոնք ստացվում են բուսաճարպերի կամ յուղերի զատման ընթացքում բացի 2304 կամ 2305 ապրանքային դիրքերում ընդգրկված չաղացած կամ աղացած, չհատիկավորված կամ հատիկավորված թափոններից",
                "2307" => "Գինու նստվածք. Գինեքար",
                "2308" => "Բուսական ծագում ունեցող մթերքներ եւ բուսական թափոններ, բուսական մնացորդներ եւ կողմնակի մթերքներ, չհատիկավորված կամ հատիկավորված, որոնք օգտագործում են կենդանիներին կերակրելու համար, այլ տեղ չնշված կամ չընդգրկված",
                "2309" => "Կենդանիներին կերակրելու համար օգտագործվող մթերքներ",
                "2401" => "Ծխախոտահումք, ծխախոտի թափոններ",
                "2402" => "Սիգարներ, կտրած ծայրերով սիգարներ, սիգարիլլաներ եւ սիգարետներ ծխախոտով կամ դրա փոխարինիչներով",
                "2403" => "Արդյունաբերական պատրաստման այլ ծխախոտ եւ ծխախոտի արդյունաբերական փոխարինիչներ, «հոմոգենացված» կամ «վերականգնված» ծխախոտ. ծխախոտի լուծամզվածքներ եւ բնահյութեր",
                "2404" => "Ծխախոտային արտադրանք և դրա փոխարինիչներ",
                "2501" => "Աղ (ներառյալ սեղանի եւ բնափոխված աղը) եւ նատրիումի քլորիդ մաքուր, ջրի մեջ լուծված կամ չլուծած, ինչպես նաեւ այնպիսի ազդանյութերի հավելումների պարունակությամբ, որոնք խոչընդոտում են մասնիկների իրար կպչելը կամ ապահովում են սորունությունը. ծովի ջուր",
                "2502" => "Պիրիտ՝ չթրծված",
                "2503" => "Ծծումբ` բոլոր տեսակների, բացի սուբլիմացված, նստեցված կամ կոլոիդային ծծումբից",
                "2504" => "Գրաֆիտ՝ բնական",
                "2505" => "Ավազ՝ բնական, բոլոր տեսակների, ներկած կամ չներկած, բացի 26–րդ խմբի մետաղաբեր ավազներից",
                "2506" => "Կվարց (բացի բնական ավազներից), կվարցիտ՝ կոպիտ մանրատած կամ չմանրատած, սղոցած կամ չսղոցած, կամ այլ կերպ բլոկների կամ ուղղանկյուն սալերի (ներառյալ քառակուսի) բաժանած",
                "2507" => "Ճենակավ եւ այլ ճենակավային կավեր՝ կալցինացված կամ չկալցինացված",
                "2508" => "Կավեր՝ այլ (բացառությամբ 6806 ապրանքային դիրքում ընդգրկված փքված կավերի), անդալուզիտ, կիանիտ եւ սիլիմանիտ՝ կալցինացված կամ չկալցինացված: մուլիտ, հրակավային կամ դինասային հողեր",
                "2509" => "Կավիճ",
                "2510" => "Կալցիումի ֆոսֆատներ` բնական, ալյումինա-կալցիումային ֆոսֆատներ` բնական եւ ֆոսֆատային կավիճ",
                "2511" => "Բարիումի սուլֆատ` բնական (բարիտ). բարիումի կարբոնատ` բնական (վիտերիտ), կալցինացված կամ չկալցինացված, բացի 2816 ապրանքային դիրքում ընդգրկված բարիումի օքսիդից",
                "2512" => "Հողեր՝ ինֆուզորային, սիլիցիումային (օրինակ` կիզելգուր, տրեպել եւ դիատոմիտ) եւ նույնանման սիլիկային հողեր՝ կալցինացված կամ չկալցինացված, 1 կամ պակաս տեսակարար կշռով",
                "2513" => "Չեչաքար, զմռնիտ, կորունդ՝ բնական, նռնաքար՝ բնական, եւ այլ բնական հղկանյութեր` ջերմամշակած կամ չմշակած",
                "2514" => "Թերթաքար, կոպիտ մանրատած կամ չմանրատած, սղոցած կամ չսղոցած, կամ այլ կերպ բլոկների կամ ուղղանկյուն (ներառյալ քառակուսի) սալերի բաժանած",
                "2515" => "Մարմար, տրավերտին կամ կրաքարային տուֆ, էկաուսին եւ այլ կրաքարեր հուշարձանների կամ շինարարության համար՝ 2,5 կամ ավելի տեսակարար կշռով, եւ ալեբաստր, կոպիտ մանրատած կամ չմանրատած, սղոցած կամ չսղոցած կամ այլ մեթոդով բլոկների կամ ուղղանկյուն (ներառյալ քառակուսի) սալերի բաժանած",
                "2516" => "Գրանիտ, ծիրանաքար, բազալտ, ավազաքար եւ այլ քարեր հուշարձանների կամ շինարարության համար, կոպիտ մանրատած կամ չմանրատած, սղոցած կամ չսղոցած, կամ այլ կերպ բլոկների կամ ուղղանկյուն (ներառյալ քառակուսի) սալերի բաժանած",
                "2517" => "Ճավաքար, կոպիճ, խիճ կամ մանրատած քար, սովորաբար օգտագործվում է որպես բետոնի, բալաստի լցանյութ խճուղիների կամ երկաթուղային ճանապարհների համար կամ այլ բալաստի, ճավաքարի, ինչպես նաեւ մեծագլաքար եւ կայծքարային կոպիճ, ջերմամշակված կամ չմշակված, մակադամ խարամից, դրոսից կամ նույնանման արդյունաբերական թափոններից, ընդգրկելով կամ չընդգրկելով ապրանքային դիրքի առաջին մասում նշված նյութերը, հանքաձյութած (գուդրոնապատված) մակադամ, 2515 կամ 2516 ապրանքային դիրքերում նշված քարի հատիկներ, փշրանք եւ փոշի, ջերմամշակած կամ չմշակած",
                "2518" => "Դոլոմիտ` կալցինացված կամ չկալցինացված, եռակալված կամ չեռակալված, ներառյալ դոլոմիտ՝ կոպիտ մանրատած կամ սղոցած կամ այլ կերպ բլոկների կամ ուղղանկյուն (ներառյալ քառակուսի) սալերի բաժանած, դոլոմիտային լցոնախառնուրդ",
                "2519" => "Մագնիումի կարբոնատ` բնական (մագնեզիտ), մագնեզիա՝ հալեցված, մագնեզիա՝ մինչեւ եռակալումը շեղջաքարացված (ագլոմերացված)՝ շեղջաքարացումից առաջ ավելացվող այլ օքսիդների ոչ մեծ քանակներ պարունակող կամ չպարունակող, մագնիումի այլ օքսիդներ` խառնուկներով կամ առանց խառնուկների",
                "2520" => "Գիպս, անհիդրիդ. գիպսային կապակցանյութեր (իրենցից ներկայացնում են կալցինացված գիպս կամ կալցիումի սուլֆատ), ներկած կամ չներկած, ոչ մեծ քանակությամբ արագացուցիչներ կամ դանդաղացուցիչներ պարունակող կամ չպարունակող",
                "2521" => "Հալանյութ՝ կրաքարային, կրաքար եւ այլ կրային քարեր՝ կրի եւ ցեմենտի պատրաստման համար օգտագործվող",
                "2522" => "Կիր` չհանգած, հանգած եւ հիդրավլիկ, բացի 2825 ապրանքային դիրքում նշված կալցիումի օքսիդն ու հիդրօքսիդը",
                "2523" => "Պորտլանդցեմենտ, կավահողային ցեմենտ, խարամային ցեմենտ, սուպերսուլֆատային ցեմենտ եւ նույնանման հիդրավլիկ ցեմենտներ, չներկած կամ ներկած, պատրաստի կամ թրծած բովախառնուրդների (կլինկերների) ձեւով",
                "2524" => "Ասբեստ",
                "2525" => "Փայլար, այդ թվում` շերտատված, փայլարի թափոններ",
                "2526" => "Ստեատիտ՝ բնական, կոպիտ մանրատած կամ չմանրատած, սղոցած կամ չսղոցած, կամ այլ կերպ բլոկների կամ ուղղանկյուն (ներառյալ քառակուսի) սալերի բաժանած, տալկ",
                "2528" => "Բորատներ բնական եւ դրանց խտանյութերը (կալցինացված կամ չկալցինացված), բացի բնական աղալուծույթներից անջատված բորատներից, բնական բորաթթու` 85%զանգվածային բաժնից ոչ ավելի H3BO3- ի պարունակությամբ՝ չոր նյութի վերահաշվարկով",
                "2529" => "Սպաթ՝ դաշտային, լեյցիտ, նեֆելին եւ նեֆելինային սիենիտ, ֆտորասպաթ",
                "2530" => "Նյութեր՝ հանքային, այլ տեղում չնշված կամ չներառված",
                "2601" => "Երկաթի հանքաքարեր եւ խտահանքեր՝ ներառյալ թրծած երկաթաքարը՝ Երկաթի հանքաքարեր եւ խտահանքեր՝ բացի թրծած երկաթաքարից՝",
                "2602" => "Մանգանի հանքաքարեր եւ խտահանքեր՝ ներառյալ երկաթախառն մանգանի հանքաքարերը եւ խտահանքերը` չոր արտադրանքի վերահաշվարկով՝ մանգանի 20% զանգվածային բաժին կամ ավելի պարունակությամբ",
                "2603" => "Պղնձի հանքաքարեր եւ խտահանքեր",
                "2604" => "Նիկելի հանքաքարեր եւ խտահանքեր",
                "2605" => "Կոբալտի հանքաքարեր եւ խտահանքեր",
                "2606" => "Ալյումինի հանքաքարեր եւ խտահանքեր",
                "2607" => "Կապարի հանքաքարեր եւ խտահանքեր",
                "2608" => "Ցինկի հանքաքարեր եւ խտահանքեր",
                "2609" => "Անագի հանքաքարեր եւ խտահանքեր",
                "2610" => "Քրոմի հանքաքարեր եւ խտահանքեր",
                "2611" => "Վոլֆրամի հանքաքարեր եւ խտահանքեր",
                "2612" => "Ուրանի կամ թորիումի հանքաքարեր եւ խտահանքեր",
                "2613" => "Մոլիբդենի հանքաքարեր եւ խտահանքեր",
                "2614" => "Տիտանի հանքաքարեր եւ խտահանքեր",
                "2615" => "Նիոբիումի, տանտալի, վանադիումի կամ ցիրկոնիումի հանքաքարեր եւ խտահանքեր",
                "2616" => "Թանկարժեք մետաղների հանքաքարեր եւ խտահանքեր",
                "2617" => "Այլ հանքաքարեր եւ խտահանքեր",
                "2618" => "Խարամ՝ գրանուլացված (խարամավազ), որը ստացվում է սեւ մետաղների արտադրության ընթացքում",
                "2619" => "Խարամ, դրոս (բացի գրանուլացված խարամից), հրաթեփ եւ սեւ մետաղների արտադրության այլ թափոններ",
                "2620" => "Խարամ, մոխիր եւ այլ մնացորդներ (բացի սեւ մետաղների արտադրության թափոններից), որոնք պարունակում են մետաղներ, արսեն կամ դրանց միացությունները",
                "2621" => "Այլ խարամ եւ մոխիր՝ ներառյալ ծովային ջրիմուռներից մոխիրը (կելպ). քաղաքային տնտեսության թափոնների այրումից ստացված մոխիր եւ մնացորդներ",
                "2701" => "Քարածուխ. բրիկետներ, բովագնդեր եւ կարծր վառելիքի նույնանման տեսակներ՝ ստացված քարածխից",
                "2702" => "Լիգնիտ կամ գորշ ածուխ՝ ագլոմերացված կամ ոչ ագլոմերացված՝ բացի սեւասաթից",
                "2703" => "Տորֆ (ներառյալ տորֆային փշրանքները)՝ ալգոմերացված կամ ոչ ալգոմերացված",
                "2704" => "Կոքս եւ կիսակոքս՝ քարածխից, լիգնիտից կամ տորֆից՝ ալգոմերացված կամ ոչ ալգոմերացված. ածուխ թորանոթային",
                "2705" => "Գազ` քարածխային, ջրային, գեներատորային եւ նույնանման գազեր՝ բացի նավթային գազերից եւ գազակերպ այլ ածխաջրածիններից",
                "2706" => "Ձյութեր՝ քարածխային, գորշ ածխային, տորֆային եւ այլ հանքային ձյութեր՝ ջրազրկված կամ չջրազրկված, մասամբ կրկնազտված կամ ոչ կրկնազտված՝ ներառյալ «վերականգնված» ձյութերը",
                "2707" => "Յուղեր եւ քարածխային ձյութի բարձր ջերմային թորման այլ նյութեր. նույնանման նյութեր, որոնց մեջ բուրավետ բաղադրիչների զանգվածը գերազանցում է ոչ բուրավետների զանգվածը",
                "2708" => "Կուպր եւ կուպրի կոքս, որոնք ստացվում են քարածխային ձյութից կամ այլ հանքային ձյութերից",
                "2709" => "Հում նավթ եւ հում նավթամթերքներ՝ ստացված բիտումային ապարներից",
                "2710" => "Նավթ եւ նավթամթերքներ` ստացված բիտումային ապարներից` բացառությամբ հում նավթի ու նավթամթերքների. այլ տեղում չնշված կամ չներառված արտադրանք, որոնք պարունակում են 70% զանգվածային բաժին կամ ավելի նավթ կամ նավթամթերքներ` ստացված բիտումային ապարներից, ընդ որում` այդ նավթամթերքները արտադրանքի հիմնական բաղադրիչներն են. բանեցված նավթամթերքներ",
                "2711" => "Նավթային գազեր եւ գազանման այլ ածխաջրածիններ",
                "2712" => "Նավթային վազելին. պարաֆին, նավթային մանրաբյուրեղավոր մոմ, պարաֆինային նստվածք, օզոկերիտ, գորշ ածխային մոմ, տորֆային մոմ, այլ հանքամոմեր եւ սինթեզման կամ այլ գործընթացների արդյունքում ստացված նույնանման նյութեր, ներկած կամ չներկած",
                "2713" => "Նավթային կոքս, նավթային բիտում եւ բիտումային ապարներից ստացված նավթի կամ նավթամթերքների վերամշակման արդյունքում ստացված այլ մնացորդներ",
                "2714" => "Բիտում եւ ասֆալտ՝ բնական. բիտումային կամ նավթաբեր թերթաքարեր եւ բիտումային ավազաքարեր. ասֆալտիտներ եւ ասֆալտային ապարներ",
                "2715" => "Բիտումի խառնուրդներ` բնական ասֆալտի, բնական բիտումի, նավթային բիտումի, հանքային ձյութերի կամ հանքային ձյութերի կուպրի հիման վրա (օրինակ` բիտումային մաստիկա, ասֆալտային խառնուրդներ ճանապարհային պատվածքների համար)",
                "2716" => "Էլեկտրաէներգիա",
                "2801" => "Ֆտոր, քլոր, բրոմ եւ յոդ",
                "2802" => "Ծծումբ` սուբլիմացված կամ նստվածքային. ծծումբ կոլոիդային",
                "2803" => "Ածխածին (մուր եւ ածխածնի այլ ձեւեր՝ այլ տեղում չնշված կամ չներառված)",
                "2804" => "Ջրածին, իներտ գազեր եւ այլ ոչ մետաղներ",
                "2805" => "Ալկալիական կամ հողալկալիական մետաղներ. հազվագյուտ հողերի մետաղներ, սկանդիում եւ իտրիում` մաքուր վիճակում, խառնուրդներում կամ համաձուլվածքներում. Սնդիկ",
                "2806" => "Քլորաջրածին (աղաթթու), քլորսուլֆոնային թթու",
                "2807" => "Ծծմբաթթու, օլեում",
                "2808" => "Ազոտական թթու, սուլֆաազոտական թթուներ",
                "2809" => "Երկֆոսֆորի հնգօքսիդ. ֆոսֆորաթթու. որոշակի կամ անորոշ քիմիական կազմով բազմաֆոսֆորային թթուներ",
                "2810" => "Բորի օքսիդներ. Բորաթթուներ",
                "2811" => "Այլ անօրգանական թթուներ եւ ոչ մետաղների թթվածնային պարունակությամբ անօրգանական այլ միացություններ",
                "2812" => "Ոչ մետաղների հալոգենիդներ եւ հալոգենիդ օքսիդներ",
                "2813" => "Ոչ մետաղների սուլֆիդներ. ֆոսֆորի տրիսուլֆիդ՝ տեխնիկական",
                "2814" => "Ամոնիակ, անջուր կամ ջրային լուծույթում",
                "2815" => "Նատրիումի հիդրօքսիդ (կաուստիկ սոդա). կալիումի հիդրօքսիդ (կծու կալիում). նատրիումի կամ կալիումի պերօքսիդներ",
                "2816" => "Մագնեզիումի հիդրօքսիդ եւ պերօքսիդ. ստրոնցիումի կամ բարիումի օքսիդներ, հիդրօքսիդներ եւ պերօքսիդներ",
                "2817" => "Ցինկի օքսիդ. ցինկի պերօքսիդ",
                "2818" => "Արհեստական կորունդ որոշակի կամ անորոշ քիմիական կազմով. ալյումինի օքսիդ. ալյումինի հիդրօքսիդ",
                "2819" => "Քրոմի օքսիդներ եւ հիդրօքսիդներ",
                "2820" => "Մանգանի օքսիդներ",
                "2821" => "Երկաթի օքսիդներ եւ հիդրօքսիդներ. հանքային ներկանյութեր, որոնք պարունակում են 70% զանգվածային բաժին կամ ավելի քիմիապես կապված երկաթ՝ Fе2O3-ի վերահաշվարկով",
                "2822" => "Կոբալտի օքսիդներ եւ հիդրօքսիդներ. կոբալտի օքսիդներ՝ տեխնիկական",
                "2823" => "Տիտանի օքսիդներ",
                "2824" => "Կապարի օքսիդներ. կապարի սուսր (կարմիր եւ նարնջագույն)",
                "2825" => "Հիդրազին եւ հիդրօքսիլամին եւ դրանց անօրգանական աղերը. անօրգանական այլ հիմքեր. մետաղների այլ օքսիդներ, հիդրօքսիդներ եւ պերօքսիդներ",
                "2826" => "Ֆտորիդներ. ֆտորասիլիկատներ, ֆտորաալյումինատներ եւ ֆտորի այլ կոմպլեքսային աղեր",
                "2827" => "Քլորիդներ, քլորիդի օքսիդներ եւ քլորիդի հիդրօքսիդներ. բրոմիդներ եւ բրոմիդի օքսիդներ, յոդիդներ եւ յոդիդի օքսիդներ",
                "2828" => "Հիպոքլորիդներ. կալցիումի հիպոքլորիդ տեխնիկական. քլորիդներ. Հիպոբրոմիդներ",
                "2829" => "Քլորատներ եւ պերքլորատներ. բրոմատներ եւ պերբրոմատներ. յոդատներ եւ պերյոդատներ",
                "2830" => "Սուլֆիդներ. պոլիսուլֆիդներ՝ որոշակի կամ անորոշ քիմիական կազմով",
                "2831" => "Երկթիոնիտներ եւ սուլֆօքսիլատներ",
                "2832" => "Սուլֆիտներ. Թիոսուլֆատներ",
                "2833" => "Սուլֆատներ. շիբ. պերօքսասուլֆատներ (պերսուլֆատներ)",
                "2834" => "Նիտրիտներ. Նիտրատներ",
                "2835" => "Ֆոսֆինատներ (հիպոֆոսֆիտներ), ֆոսֆոնատներ (ֆոսֆիտներ) եւ ֆոսֆատներ. պոլիֆոսֆատներ՝ որոշակի կամ անորոշ քիմիական կազմով",
                "2836" => "Կարբոնատներ. պերօքսոկարբոնատներ (պերկարբոնատներ). ամոնիումի կարբոնատ՝ տեխնիկական, ամոնիումի կարբամատի պարունակությամբ",
                "2837" => "Ցիանիդներ, ցիանիդ օքսիդներ, կոմպլեքսային ցիանիդներ",
                "2839" => "Սիլիկատներ. ալկալիական մետաղների սիլիկատներ՝ տեխնիկական",
                "2840" => "Բորատներ. պերօքսոբորատներ (պերբորատներ)",
                "2841" => "Օքսամետաղական կամ պերօքսամետաղական թթուների աղեր",
                "2842" => "Անօրգանական թթուների կամ պերօքսաթթուների աղեր (ներառյալ որոշակի կամ անորոշ քիմիական կազմով ալյումասիլիկատները)՝ բացի ազիդներից, այլ",
                "2843" => "Թանկարժեք մետաղներ կոլոիդային վիճակում. թանկարժեք մետաղների անօրգանական կամ օրգանական միացություններ` որոշակի կամ անորոշ քիմիական կազմով. թանկարժեք մետաղների ամալգամներ",
                "2844" => "Ռադիոակտիվ քիմիական տարրեր եւ ռադիոակտիվ իզոտոպներ (ներառյալ տրոհվող եւ վերարտադրվող քիմիական տարրերն ու իզոտոպները) եւ դրանց միացությունները. այդ նյութերը պարունակող խառնուրդներ եւ մնացորդներ",
                "2845" => "Իզոտոպներ՝ բացի 2844 ապրանքային դիրքի իզոտոպներից. այդ իզոտոպների անօրգանական կամ օրգանական միացություններ՝ որոշակի կամ անորոշ քիմիական կազմով",
                "2846" => "Միացություններ՝ անօրգանական կամ օրգանական, հազվագյուտ հողերի մետաղների, իտրիումի կամ սկանդիումի կամ այդ մետաղների խառնուրդների",
                "2847" => "Ջրածնի պերօքսիդ՝ միզանյութով կարծրացած կամ չկարծրացած",
                "2848" => "Ֆոսֆիդներ` որոշակի կամ անորոշ քիմիական կազմով, բացառությամբ ֆերոֆոսֆորի",
                "2849" => "Կարբիդներ՝ որոշակի կամ անորոշ քիմիական կազմով",
                "2850" => "Հիդրիդներ, նիտրիդներ, ազիդներ, սիլիցիդներ եւ բորիդներ` որոշակի կամ անորոշ քիմիական կազմով՝ բացի 2849 ապրանքային դիրքում նշված կարբիդ հանդիսացող միացություններից",
                "2852" => "Սնդիկի միացություններ՝ անօրգանական կամ օրգանական, որոշակի կամ անորոշ քիմիական կազմով՝ բացի ամալգամից",
                "2853" => "Անօրգանական այլ միացություններ (ներառյալ թորած կամ էլեկտրահաղորդաչափական ջուրը եւ նույնանման մաքրության ջուրը). հեղուկ օդ (իներտ գազերը հեռացված կամ չհեռացված). խտացրած օդ. ամալգամներ՝ բացի թանկարժեք մետաղների ամալգամներից",
                "2901" => "Ացիկլիկ ածխաջրածիններ",
                "2902" => "Ցիկլիկ ածխաջրածիններ",
                "2903" => "Ածխաջրածինների հալոգենացված ածանցյալներ",
                "2904" => "Ածխաջրածիների սուլֆացված, նիտրացված կամ նիտրոզացված ածանցյալներ՝ հալոգենացված կամ չհալոգենացված",
                "2905" => "Սպիրտերը եւ դրանց հալոգենացված, սուլֆացված, նիտրացված կամ նիտրոզացված ածանցյալները",
                "2906" => "Ցիկլային սպիրտներ եւ դրանց հալոգենացված, սուլֆացված, նիտրացված կամ նիտրոզացված ածանցյալները",
                "2907" => "Ֆենոլներ, ֆենոլոսպիրտներ",
                "2908" => "Հալոգենացված, սուլֆացված, նիտրացված կամ նիտրոզացված ֆենոլների կամ ֆենոլոսպիրտների ածանցյալները",
                "2909" => "Պարզ եթերներ, եթերասպիրտներ, եթերաֆենոլներ, եթերասպիրտոֆենոլներ. սպիրտների, պարզ եթերների եւ կետոնների (որոշակի կամ անորոշ քիմիական կազմով) պերօքսիդները եւ դրանց հալոգենացված, սուլֆացված, նիտրացված կամ նիտրոզացված ածանցյալները",
                "2910" => "Կառուցվածքում եռանդամ օղակ պարունակող էպօքսիդներ, էպօքսիսպիրտներ, էպօքսիֆենոլներ եւ էպօքսիեթերներ ու դրանց հալոգենացված, սուլֆացված, նիտրացված կամ նիտրոզացված ածանցյալները",
                "2911" => "Ացետալներ եւ կիսաացետալներ, որոնք պարունակում են կամ չեն պարունակում այլ թթվածնակիր ֆունկցիոնալ խմբեր եւ դրանց հալոգենացված, սուլֆացված, նիտրացված կամ նիտրոզացված ածանցյալները",
                "2912" => "Ալդեհիդներ, որոնք պարունակում են կամ չեն պարունակում այլ թթվածնակիր ֆունկցիոնալ խմբեր, ալդեհիդների ցիկլային պոլիմերներ, պարաֆորմալդեհիդ",
                "2913" => "2912 ապրանքային դիրքի միացությունների ածանցյալները` հալոգենացված, սուլֆացված, նիտրացված կամ նիտրոզացված",
                "2914" => "Կետոններ եւ քինոններ, որոնք պարունակում են կամ չեն պարունակում այլ թթվածնակիր ֆունկցիոնալ խումբ, եւ դրանց հալոգենացված, սուլֆացված, նիտրացված կամ նիտրոզացված ածանցյալները",
                "2915" => "Թթուներ ացիկլային մոնոկարբոնային հագեցած եւ դրանց անհիդրիդները, հալոգենանհիդրիդները, պերօքսիդներն ու պերօքսիթթուները, դրանց հալոգենացված, սուլֆացված, նիտրացված եւ նիտրոզացված ածանցյալները",
                "2916" => "Թթուներ ացիկլային միակարբոնային չհագեցած, թթուներ ցիկլային միակարբոնային, դրանց անհիդրիդները, հալոգենահիդրիդները, պերօքսիդները եւ պերօքսիթթուները, դրանց հալոգենացված, սուլֆացված, նիտրացված կամ նիտրոզացված ածանցյալները",
                "2917" => "Պոլիկարբոնաթթուներ, դրանց անհիդրիդները, հալոգենանհիդրիդները, պերօքսիդները եւ պերօքսիթթուները. դրանց հալոգենացված, սուլֆացված, նիտրացված կամ նիտրոզացված ածանցյալները",
                "2918" => "Կարբոնաթթուներ լրացուցիչ թթվածնակիր ֆունկցիոնալ խմբեր պարունակող, եւ դրանց անհիդրիդները, հալոգենանհիդրիդները, պերօքսիդները եւ պերօքսիթթուները, դրանց հալոգենացված, սուլֆացված, նիտրացված կամ նիտրոզացված ածանցյալները",
                "2919" => "Ֆոսֆորաթթվի բարդ եթերներ եւ դրանց աղերը՝ ներառյալ լակտոֆոսֆատները, դրանց հալոգենացված, սուլֆացված, նիտրացված կամ նիտրոզացված ածանցյալները",
                "2920" => "Ոչ մետաղների այլ անօրգանական թթուների բարդ եթերներ (բացի հալոգենաջրածինների բարդ եթերներից) եւ դրանց աղերը, դրանց հալոգենացված, սուլֆացված, նիտրացված կամ նիտրոզացված ածանցյալները",
                "2921" => "Ամինային ֆունկցիոնալ խմբի հետ միացություններ",
                "2922" => "Ամինոմիացություններ, որոնք պարունակում են թթվածնակիր ֆունկցիոնալ խումբ",
                "2923" => "Չորրորդային ամոնիումային հիմքի աղեր եւ հիդրօքսիդներ, այլ լեցիտիններ եւ ֆոսֆոամինոլիպիդներ՝ որոշակի կամ անորոշ քիմիական կազմով",
                "2924" => "Միացություններ կարբօքսամիդային ֆունկցիոնալ խումբ պարունակող, ածխաթթվի միացություններ ամիդային ֆունկցիոնալ խումբ պարունակող",
                "2925" => "Կարբօքսիմիդային ֆունկցիոնալ խումբ պարունակող միացություններ (ներառյալ սախարինն ու դրա աղերը) եւ իմինային ֆունկցիոնալ խումբ պարունակող միացություններ",
                "2926" => "Միացություններ նիտրիլային ֆունկցիոնալ խումբ պարունակող",
                "2927" => "Դիազո–, ազո– կամ ազոքսի միացություններ",
                "2928 " => "Հիդրազինի կամ հիդրօքսիլամինի օրգանական ածանցյալներ",
                "2929" => "Այլ ազոտակիր ֆունկցիոնալ խմբեր պարունակող միացություններ",
                "2930" => "Ծծմբաօրգանական միացություններ",
                "2931" => "Այլ օրգանա-անօրգանական միացություններ",
                "2932" => "Հետերացիկլային միացություններ՝ միայն թթվածնի հետերաատոմ(ներ) պարունակող",
                "2933" => "Հետերացիկլային միացություններ՝ միայն ազոտի հետերաատոմ(ներ) պարունակող",
                "2934" => "Նուկլեինաթթուներ եւ դրանց աղերը՝ որոշակի կամ անորոշ քիմիական կազմով, այլ հետերացիկլային միացություններ",
                "2935 " => "Սուլֆոնամիդներ",
                "2936" => "Նախավիտամիններ եւ վիտամիններ, բնական կամ սինթեզված (ներառյալ բնական խտանյութերը), հիմնականում որպես վիտամիններ օգտագործվող դրանց ածանցյալները եւ այդ միացությունների խառնուրդները, այդ թվում՝ ցանկացած լուծիչի մեջ",
                "2937" => "Բնական կամ սինթեզված հորմոններ, պրոստագլանդիններ, տրոմբօքսաններ եւ լեյկոտրիեններ, դրանց ածանցյալները եւ կառուցվածքային անալոգները, որոնք ներառում են հիմնականում որպես հորմոններ օգտագործվող շղթայական մոդիֆիկացված պոլիպեպտիդներ",
                "2938" => "Գլիկոզիդներ՝ բնական կամ սինթեզված, դրանց աղերը, պարզ ու բարդ եթերները եւ այլ ածանցյալները",
                "2939" => "Բուսական ծագում ունեցող, բնական կամ սինթեզված ալկալոիդներ, դրանց աղերը, պարզ ու բարդ եթերները եւ այլ ածանցյալները",
                "2940 " => "Շաքարներ քիմիապես մաքուր, բացի բուսաշաքարից, կաթնաշաքարից, ածիկաշաքարից, խաղողաշաքարից եւ պտղաշաքարից, շաքարների պարզ եթերներ, շաքարների ացետալներ եւ բարդ եթերներ, դրանց աղերը՝ բացառությամբ 2937, 2938 կամ 2939 ապրանքային դիրքերում նշված արտադրանքից",
                "2941" => "Հակաբիոտիկներ",
                "2942 " => "Օրգանական այլ միացություններ",
                "3001" => "Գեղձեր եւ այլ օրգաններ՝ նախատեսված օրգանաբուժության համար, չորացրած, փոշիացրած կամ չփոշիացրած, գեղձերի եւ այլ օրգանների կամ դրանց արտազատուկների լուծամզվածքներ՝ նախատեսված օրգանաբուժության համար, հեպարին եւ դրա աղերը, մարդկային եւ կենդանական ծագում ունեցող այլ նյութեր` պատրաստված թերապեւտիկ կամ կանխարգելիչ նպատակներով օգտագործման համար, այլ տեղում չնշված կամ չներառված",
                "3002" => "Մարդկային արյուն, թերապեւտիկ, կանխարգելիչ կամ ախտորոշման նպատակներով օգտագործելու համար պատրաստված կենդանական արյուն, իմունային շիճուկներ, արյան այլ թորամասեր ու ձեւափոխված կամ չձեւափոխված իմունաբանական նյութեր, այդ թվում՝ բիոտեխնոլոգիական ճանապարհով ստացված, պատվաստանյութեր, թույներ, աճեցրած մանրէներ (բացի խմորասնկերից) եւ նույնանման նյութեր",
                "3003" => "Դեղամիջոցներ (բացի 3002, 3005 կամ 3006 ապրանքային դիրքերում նշվածներից)՝ կազմված երկու կամ ավելի բաղադրատարրերի խառնուրդից, թերապեւտիկ կամ կանխարգելիչ նպատակներով օգտագործելու համար, սակայն մանրածախ վաճառքի համար դեղաչափված դեղաձեւերով կամ տարաներում կամ փաթեթվածքներում չբաժնեծրարված",
                "3004" => "Դեղամիջոցներ (բացի 3002, 3005 կամ 3006 ապրանքային դիրքերում նշվածներից)՝ կազմված երկու կամ ավելի բաղադրատարրերի խառնուրդից, նախատեսված թերապեւտիկ եւ կանխարգելիչ նպատակներով օգտագործման համար, բաժնեծրարված դեղաչափված դեղաձեւերով (ներառյալ դեղամիջոցները վերմաշկային համակարգերի ձեւով) կամ տարաներում կամ փաթեթվածքներում մանրածախ վաճառքի համար",
                "3005" => "Բամբակ, թանզիֆ, փաթույթային վիրակապեր եւ նույնանման արտադրատեսակներ (օրինակ՝ վիրակապական նյութեր, կպչուն սպեղանիներ, թրջոցալաթեր)՝ ներծծված կամ ծածկված դեղագործական նյութերով կամ մանրածախ վաճառքի համար բաժնեծրարված տարաներում կամ փաթեթվածքներում, որոնք նախատեսված են բժշկության, վիրաբուժության, ատամնաբուժության կամ անասնաբուժության մեջ օգտագործելու համար",
                "3006" => "Դեղագործական արտադրանք, որը նշված է տվյալ խմբի 4-րդ ծանոթագրության մեջ",
                "3101 " => "Կենդանական կամ բուսական ծագման պարարտանյութեր` խառնած կամ չխառնած, քիմիական եղանակով մշակված կամ չմշակված, պարարտանյութեր՝ ստացված բուսական կամ կենդանական ծագման մթերքը խառնելու կամ քիմիական մշակման ենթարկելու միջոցով",
                "3102" => "Պարարտանյութեր՝ հանքային կամ քիմիական, ազոտական",
                "3103" => "Պարարտանյութեր՝ հանքային կամ քիմիական, ֆոսֆորական",
                "3104" => "Պարարտանյութեր՝ հանքային կամ քիմիական, կալիումական",
                "3105" => "Հանքային կամ քիմիական պարարտանյութեր` երկու կամ երեք սննդարար տարր՝ ազոտ, ֆոսֆոր եւ կալիում պարունակող. այլ պարարտանյութեր, տվյալ խմբի ապրանքներ` հաբերով կամ նույնանման ձեւերով կամ փաթեթավորումներով, որոնց բրուտտո–զանգվածը չի գերազանցում 10 կգ-ը",
                "3201" => "Բուսական ծագմամբ դաբաղային լուծամզուքներ, տանիններ եւ դրանց աղերը, եթերները՝ պարզ եւ բարդ եւ այլ ածանցյալներ",
                "3202" => "Դաբաղային օրգանական նյութեր` սինթետիկ, դաբաղային անօրգանական նյութեր, դաբաղման պատրաստուկներ, դաբաղման բնական նյութեր պարունակող կամ չպարունակող, ֆերմենտային պատրաստուկներ",
                "3203 " => "Բուսական կամ կենդանական ծագում ունեցող ներկող նյութեր (ներառյալ ներկող լուծամզուքները՝ բացի կենդանական ածուխից)՝ որոշակի կամ անորոշ քիմիական բաղադրության, տվյալ խմբի 3-րդ ծանոթագրության մեջ նշված բուսական կամ կենդանական ծագում ունեցող ներկող նյութերի հիմքով պատրաստված պատրաստուկներ",
                "3204" => "Օրգանական սինթետիկ ներկող նյութեր՝ որոշակի կամ անորոշ քիմիական բաղադրության, պատրաստուկներ՝ պատրաստված տվյալ խմբի 3-րդ ծանոթագրության մեջ նշված օրգանական սինթետիկ ներկող նյութերի հիմքով, օրգանական սինթետիկ արտադրանք, որն օգտագործվում է որպես օպտիկական սպիտակեցնող նյութ կամ լյումինաֆոր՝ որոշակի կամ անորոշ քիմիական բաղադրության",
                "3205 " => "Գունավոր լաքեր, տվյալ խմբի 3-րդ ծանոթագրության մեջ նշված գունավոր լաքերի հիմքով պատրաստուկներ",
                "3206" => "Ներկող այլ նյութեր, տվյալ խմբի 3-րդ ծանոթագրության մեջ նշված եւ 3203, 3204 կամ 3205 ապրանքային դիրքերում ընդգրկված պատրաստուկներից տարբեր պատրաստուկներ, որպես լյումինաֆոր օգտագործվող անօրգանական արտադրանք՝ որոշակի կամ անորոշ քիմիական բաղադրության",
                "3207" => "Պատրաստի գունանյութեր, ապակու պատրաստի պղտորիչներ եւ պատրաստի ներկեր, ապակենման արծններ եւ ջնարակներ, անգոբներ (լուծախմորներ), հեղուկ փայլանյութերի եւ համանման պատրաստուկներ՝ կերամիկայի, արծնների կամ ապակու արտադրության ժամանակ օգտագործվող, ապակենման բովախառնուրդ եւ այլ տեսակի ապակի` փոշու, գրանուլների կամ փաթիլների տեսքով",
                "3208" => "Ներկեր եւ լաքեր (ներառյալ արծնները եւ ողորկալաքերը)՝ սինթետիկ պոլիմերների կամ քիմիապես վերափոխված բնական պոլիմերների հիմքով՝ ոչ ջրային միջավայրում դիսպերսված կամ լուծված, տվյալ խմբի 4-րդ ծանոթագրության մեջ նշված լուծույթներ",
                "3209" => "Ներկեր եւ լաքեր (ներառյալ արծնները եւ ողորկալաքերը)՝ սինթետիկ պոլիմերների կամ քիմիապես վերափոխված բնական պոլիմերների հիմքով՝ ջրային միջավայրում դիսպերսված կամ լուծված",
                "3210 " => "Այլ ներկեր եւ լաքեր (ներառյալ՝ արծնները, ողորկալաքերը եւ սոսնձային ներկերը), պատրաստի ջրային գունանյութեր՝ կաշվի մշակման համար օգտագործվող",
                "3211 " => "Պատրաստի չորարարներ",
                "3212" => "Գունանյութեր (ներառյալ մետաղական փոշիներ եւ փաթիլներ)՝ ոչ ջրային միջավայրում դիսպերսված, հեղուկ կամ մածուկանման, որոնք օգտագործվում են ներկերի արտադրության մեջ (ներառյալ արծնները), փայլաթիթեղ դրոշմատպման համար, ներկանյութեր եւ ներկող այլ նյութեր՝ բաժնեծրարված կամ փաթեթավորմամբ՝ մանրածախ վաճառքի համար",
                "3213" => "Գեղարվեստական ներկեր՝ նկարիչների, ուսանողների կողմից կամ ցուցանակների ձեւավորման համար օգտագործվող, գունաթափանցման համար օգտագործվող ներկեր, ներկեր ժամանցի համար եւ համանման արտադրանք՝ հաբերի, պատիճների տեսքով, սրվակներով, տուփերով կամ նույնանման տեսքով կամ փաթեթավորումով",
                "3214" => "Ապակու եւ այգեգործական ծեփամածիկներ, ձյութացեմենտներ, բաղադրություններ խտման համար եւ այլ մաստիկաներ, մածիկներ ներկարարական աշխատանքների համար, ոչ հրակայուն բաղադրություններ շենքերի ճակատները, ներքին պատերը, հատակները, առաստաղները կամ մյուս մասերը նախապատրաստելու համար",
                "3215" => "Տպագրական ներկ, գրելու կամ նկարելու թանաք կամ տուշ եւ թանաքի այլ տեսակներ՝ խտացրած կամ չխտացրած, պինդ կամ ոչ պինդ",
                "3301" => "Եթերայուղեր (տերպեններ պարունակող կամ չպարունակող)՝ ներառյալ լուծամզված եւ բացարձակ եթերայուղերը, ռետինանյութերը, լուծամզված եթերայուղերը, եթերայուղերի խտանյութերը` ճարպերի, չցնդող յուղերի, մոմերի կամ նույնանման նյութերի մեջ, որոնք ստացվում են անֆլերաժի կամ թթվամշակման մեթոդով, եթերայուղերի տերպենազերծումից ստացված տերպենային կողմնակի արգասիքներ, եթերայուղերի ջրային թորվածքներ եւ եթերայուղերի ջրային լուծույթներ",
                "3302" => "Բուրավետ նյութերի խառնուրդներ եւ խառնուրդներ (ներառյալ սպիրտային լուծույթները)՝ ստացված մեկ կամ ավելի այդպիսի նյութերի հիման վրա, որոնք օգտագործվում են որպես արդյունաբերական հումք, այլ պատրաստուկներ բուրավետ նյութերի հիմքով, որոնք օգտագործվում են ըմպելիքների արտադրության համար",
                "3303 " => "Օծանելիք, հարդաջուր",
                "3304" => "Կոսմետիկական կամ դիմահարդարման եւ մաշկի խնամքի միջոցներ (բացի դեղամիջոցներից)՝ ներառյալ միջոցները՝ արեւաթխության դեմ կամ արեւաթխության համար, մանիկյուրի եւ պեդիկյուրի միջոցներ",
                "3305" => "մազերի խնամքի միջոցներ",
                "3306" => "Բերանի խոռոչի եւ ատամների հիգիենայի միջոցներ՝ ներառյալ ատամնապրոթեզների ֆիքսման փոշիներն ու մածուկները. միջատամային տարածքները մաքրելու թելեր (ատամները մաքրելու մետաքսաթել), անհատական փաթեթավորմամբ՝ մանրածախ վաճառքի համար",
                "3307" => "Միջոցներ՝ սափրվելուց առաջ, սափրվելու ընթացքում կամ դրանից հետո օգտագործելու համար, անհատական օգտագործման հոտազերծիչներ, բաղադրություններ՝ լոգանք ընդունելու համար, մազահեռացման միջոցներ եւ օծանելիքային, կոսմետիկական ու հարդարման այլ միջոցներ` այլ տեղում չնշված կամ չներառված. հոտազերծիչներ՝ նախատեսված շենքերում օգտագործելու համար՝ բուրավետացված կամ ոչ բուրավետացված, ախտահանիչ հատկություններով օժտված կամ առանց դրանց",
                "3401" => "Օճառ, օճառ պարունակող կամ չպարունակող, քառակողիկների, կտորների ձեւով կամ կաղապարված արտադրատեսակների տեսքով մակերեւութաակտիվ օրգանական նյութեր եւ միջոցներ, որոնք որպես օճառ են օգտագործվում. օճառ պարունակող կամ չպարունակող մակերեւութաակտիվ օրգանական նյութեր եւ միջոցներ՝ մաշկը լվանալու համար հեղուկի կամ կրեմի տեսքով, բաժնեծրարված մանրածախ վաճառքի համար. թուղթ, բամբակ, թաղիք կամ նրբաթաղիք եւ չգործված կտորեղեն՝ օճառով կամ լվացող միջոցով ներծծված կամ ծածկված",
                "3402" => "Մակերեւութաակտիվ օրգանական նյութեր (բացի օճառից), մակերեւութաակտիվ նյութեր, լվացող միջոցներ (ներառյալ օժանդակ լվացող միջոցները) եւ մաքրող միջոցներ` օճառ պարունակող կամ չպարունակող (բացի 3401 ապրանքային դիրքում նշված միջոցներից)",
                "3403" => "Քսանյութեր (ներառյալ յուղող եւ սառեցնող էմուլսիաները կտրող գործիքների համար, միջոցներ հեղույսների եւ մանեկների քանդումը հեշտացնելու համար, ժանգը հեռացնելու միջոցները կամ քսանյութերի հիմքով հակաքայքայիչ նյութերը եւ պատրաստուկները` կաղապարներից արտադրատեսակների հանումը հեշտացնելու համար) եւ մանածագործական նյութերի, կաշիների, մորթիների ու այլ նյութերի յուղային եւ ճարպային մշակման համար օգտագործվող միջոցներ՝ բացի այն միջոցներից, որոնց հիմնական բաղադրիչները բիտումային ապարներից ստացված՝ 70% զանգվածային բաժին կամ ավելի նավթն ու նավթամթերքներն են",
                "3404" => "Արհեստական մոմեր եւ պատրաստի մոմեր",
                "3405" => "Կոշիկի վաքսեր եւ կրեմներ, կահույքի, հատակի, ավտոմոբիլների թափքերի, ապակու եւ մետաղի փայլեցնող միջոցներ եւ մաստիկաներ, մաքրող մածուկներ եւ փոշիներ ու նույնանման միջոցներ (այդ թվում՝ թուղթ, բամբակ, թաղիք կամ նրբաթաղիք, չգործված կտորեղեն, ծակոտկեն պլաստմասսաներ կամ ծակոտկեն ռետին` նշված միջոցներով ներծծված կամ պատված)՝ բացի 3404 ապրանքային դիրքում նշված մոմերից",
                "3406 " => "Մոմեր, բարակ մոմեր եւ նույնանման արտադրատեսակներ",
                "3407 " => "Ծեփման համար մածուկներ՝ ներառյալ երեխաների կողմից ծեփման համար նախատեսված պլաստիլին, «ատամնաբուժական մոմ» կամ ատամների ծեփապատճենն ստանալու բաղադրություններ՝ բաժնեծրարված հավաքածուներում, փաթեթվածքներում՝ մանրածախ վաճառքի համար կամ սալիկների տեսքով, պայտերի ձեւով, քառակողիկներով կամ նույնանման ձեւերով, գիպսի (կալցինացված գիպսի կամ կալցիումի սուլֆատի) հիմքով ատամնաբուժական նպատակների համար այլ բաղադրություններ",
                "3501" => "Կազեին, կազեինատներ եւ կազեինի այլ ածանցյալներ, կազեինային սոսինձներ",
                "3502" => "Ալբումիններ (ներառյալ երկու կամ ավելի շիճուկային սպիտակուցների խտանյութերը, որոնք պարունակում են չոր նյութի վերահաշվարկով 80% զանգվածային բաժնից ավելի շիճուկային սպիտակուցներ), ալբումինատներ եւ ալբումինի այլ ածանցյալներ",
                "3503 " => "Դոնդողանյութ (այդ թվում՝ ուղղանկյուն (ներառյալ քառակուսի) թերթերով, մակերեսային մշակմամբ կամ առանց մշակման, ներկած կամ չներկած) եւ դոնդողանյութի ածանցյալներ, ձկնասոսինձ, կենդանական ծագման այլ սոսինձներ, բացի 3501 ապրանքային դիրքում ընդգրկված կազեինի սոսնձից",
                "3504 " => "Պեպտոններ եւ դրանց ածանցյալները, սպիտակուցային այլ նյութեր եւ դրանց ածանցյալները` այլ տեղում չնշված կամ չներառված, քրոմապատված կամ չքրոմապատված կաշվի կամ հում կաշվի փոշի",
                "3505" => "Դեքստրիններ եւ վերափոխված այլ օսլաներ (օրինակ` նախապես դոնդողացված կամ բարդ եթերի վերածված օսլաներ), օսլաների, դեքստրինների կամ վերափոխված այլ օսլաների հիմքով սոսինձներ",
                "3506" => "Պատրաստի սոսինձներ եւ այլ պատրաստի հարակցանյութեր՝ այլ տեղում չնշված կամ չներառված, որպես սոսինձներ կամ հարակցանյութեր օգտագործվելու համար պիտանի, մանրածախ վաճառքի համար որպես սոսինձներ կամ հարակցանյութեր բաժնեծրարված, 1 կգ-ից ոչ ավելի զուտ զանգված ունեցող արտադրանք",
                "3507" => "ֆերմենտներ, ֆերմենտային պատրաստուկներ՝ այլ տեղում չնշված կամ չներառված",
                "3601 " => "Վառոդ",
                "3602 " => "Պատրաստի պայթուցիկ նյութեր՝ բացի վառոդից",
                "3603 " => "Կրակահաղորդ քուղեր, ճայթեցնող քուղեր, հարվածող կամ ճայթեցնող հրապատիճներ, բռնկիչներ, էլեկտրաճայթիչներ",
                "3604" => "Հրավառելիք, ազդանշանային, անձրեւային հրթիռներ, հակամառախուղային ազդանշաններ եւ հրատեխնիկական այլ արտադրատեսակներ",
                "3605 " => "Լուցկիներ՝ բացի 3604 ապրանքային դիրքում ընդգրկված հրատեխնիկական արտադրատեսակներից",
                "3606" => "Ֆեռոցերիում եւ հրակիր այլ համահալվածքներ՝ ցանկացած ձեւով, տվյալ խմբի 2-րդ ծանոթագրության մեջ նշված՝ դյուրավառ նյութերից պատրաստված արտադրատեսակներ",
                "3701" => "Լուսանկարչական թիթեղներ եւ լուսանկարչական հարթ ժապավեններ՝ զգայունացրած, չլուսակայած, ցանկացած նյութից՝ բացի թղթից, ստվարաթղթից կամ մանածագործական նյութերից, վայրկենական լուսանկարման համար հարթ ժապավեններ` զգայունացրած, չլուսակայած, փաթեթավորված կամ առանց փաթեթավորման",
                "3702" => "Լուսանկարչական ժապավեն` գլանափաթեթով, զգայունացրած, չլուսակայած, ցանկացած նյութերից, բացի թղթից, ստվարաթղթից կամ մանածագործական նյութերից, վայրկենական լուսանկարման համար ժապավեն՝ գլանափաթեթներով, զգայունացրած, չլուսակայած",
                "3703" => "Լուսանկարչական թուղթ, ստվարաթուղթ եւ մանածագործական նյութեր՝ զգայունացրած, չլուսակայած",
                "3704 " => "Լուսանկարչական թիթեղներ, ժապավեն, թուղթ, ստվարաթուղթ եւ մանածագործական նյութեր՝ լուսակայած, բայց չերեւակած",
                "3705" => "Լուսանկարչական թիթեղներ եւ ժապավեն՝ լուսակայած եւ երեւակած՝ բացի կինոժապավենից",
                "3706" => "Կինոժապավեն՝ լուսակայած եւ երեւակած, ձայնուղիով կամ առանց ձայնուղու կամ միայն ձայնուղի պարունակող",
                "3707" => "Լուսաքիմիկատներ (բացի լաքերից, սոսինձներից, հարակցանյութերից եւ նույնանման պատրաստուկներից), չխառնուրդված արտադրանք՝ լուսանկարչական նպատակների համար օգտագործվող, որոշված բաժնեչափերով ներկայացված կամ մանրածախ վաճառքի համար փաթեթավորված, օգտագործման համար պատրաստի վիճակում",
                "3801" => "Արհեստական գրաֆիտ, կոլոիդային կամ կիսակոլոիդային գրաֆիտ, նյութեր՝ ստացված գրաֆիտի կամ ածխածնի այլ ձեւերի հիմքով՝ մածուկների, բլոկերի, թիթեղների կամ այլ կիսապատրաստվածքների տեսքով",
                "3802" => "Ակտիվացված ածուխ, ակտիվացված բնական հանքային ծագման մթերքներ, կենդանական ածուխ՝ ներառյալ օգտագործված կենդանական ածուխը",
                "3803 " => "Թալիումի յուղ՝ ռաֆինացված կամ չռաֆինացված",
                "3804 " => "Փայտազանգվածի պատրաստման ժամանակ մնացող մոխրաջուր, խտացրած կամ չխտացրած, շաքարազերծած կամ չշաքարազերծած, քիմիական եղանակով մշակած կամ չմշակած՝ ներառյալ լիգնինի սուլֆոնատները՝ բացի 3803 ապրանքային դիրքում նշված թալիումի յուղից",
                "3805" => "Բեւեկնի, փայտանյութի կամ սուլֆատային բեւեկնայուղ եւ տերպենային այլ յուղեր` ստացված փշատերեւազգիների փայտանյութի թորման կամ այլ ձեւով մշակման ճանապարհով, չզտած դիպենտեն, սուլֆիտային բեւեկնայուղ եւ այլ չզտած պարացիմոլ, սոճու յուղ՝ որպես գլխավոր բաղադրիչ ալֆա-տերպինեոլ պարունակող",
                "3806" => "Բեւեկնախեժ ու խեժաթթուներ եւ դրանց ածանցյալները, բեւեկնախեժի սպիրտ ու բեւեկնախեժային յուղեր, կրկնահալեցրած խեժեր",
                "3807 " => "Փայտաձյութ, փայտաձյութից ստացված յուղեր, փայտի կրեոզոտ, փայտի նավթա (լիգրոին), բուսական կուպր, գարեջրագործական կուպր եւ բեւեկնախեժի, խեժաթթուների կամ բուսական կուպրի հիմքով ստացված նույնանման ապրանքներ",
                "3808" => "Ինսեկտիցիդներ, ռոդենտիցիդներ, ֆունգիցիդներ, հերբիցիդներ, հակածիլային միջոցներ եւ բույսերի աճի կարգավորիչներ, ախտահանող ու նույնանման միջոցներ, որոնք բաժնեծրարված են կաղապարներում կամ փաթեթներով՝ մանրածախ վաճառքի համար կամ ներկայացված են պատրաստի պրեպարատների ու արտադրատեսակների տեսքով (օրինակ` ծծմբով մշակված ժապավեններ, պատրույգներ ու մոմեր եւ կպչուն թուղթ՝ ճանճերի դեմ).",
                "3809" => "Հարդարման միջոցներ, ներկումն արագացնելու կամ ներկանյութերը ֆիքսելու միջոցներ եւ այլ ապրանքներ ու պատրաստի պրեպարատներ (օրինակ` մշակման ու խածատման նյութեր), որոնք կիրառվում են մանածագործական, թղթի, կաշվի արդյունաբերության մեջ կամ նույնանման ճյուղերում՝ այլ տեղում չնշված կամ չներառված",
                "3810" => "Պատրաստուկներ՝ մետաղական մակերեւույթները խածատելու համար, օքսիդալուծիչներ եւ այլ օժանդակ պատրաստուկներ՝ ցածրաջերմաստիճանային զոդման, բարձրաջերմաստիճանային զոդման կամ եռակցման համար, փոշիներ եւ մածուկներ՝ ցածրաջերմաստիճանային զոդման, բարձրաջերմաստիճանային զոդման կամ եռակցման համար՝ մետաղներից եւ այլ նյութերից բաղկացած, նյութեր, որոնք օգտագործվում են որպես միջաձողեր կամ եռակցման էլեկտրոդների կամ ձողիկների պատվածքներ",
                "3811" => "Հակաճայթիչներ, հակաօքսիդիչներ, խեժագոյացման արգելակիչներ, թանձրացուցիչներ, հակաքայքայիչ նյութեր եւ պատրաստի այլ հավելանյութեր՝ նախատեսված նավթամթերքների (ներառյալ բենզինը) կամ այլ հեղուկների համար, որոնք օգտագործվում են նույն նպատակներով, ինչ նավթամթերքները",
                "3812" => "Կաուչուկի ռետինացման պատրաստի արագարարներ, կաուչուկի կամ պլաստմասսաների պլաստիկարարներ` այլ տեղում չնշված կամ չներառված, այլ բաղադրյալ հակաօքսիդիչներ եւ կայունարարներ՝ նախատեսված կաուչուկի կամ պլաստմասսաների համար",
                "3813 " => "Բաղադրություններ եւ լիցքեր կրակմարիչների համար, հրդեհաշիջման համար նախատեսված նռնակներ՝ լիցքավորված",
                "3814 " => "Բարդ օրգանական լուծիչներ եւ ջրիկացուցիչներ՝ այլ տեղում չնշված կամ չներառված, ներկերի կամ լաքերի մաքրման պատրաստի բաղադրություններ",
                "3815" => "Ռեակցիաների հարուցիչներ (ինիցիատորներ), ռեակցիաների արագարարներ եւ կատալիզատորներ` այլ տեղում չնշված կամ չներառված",
                "3816 " => "Հրադիմացկուն ցեմենտներ, շինարարական շաղախներ, բետոններ եւ նույնանման բաղադրություններ՝ բացի 3801 ապրանքային դիրքում նշված ապրանքներից",
                "3817 " => "Ալկիլբենզոլներ խառնած եւ ալկիլնավթալիններ խառնած՝ բացի 2707 կամ 2902 ապրանքային դիրքում նշված նյութերից",
                "3818 " => "Լեգիրված քիմիական տարրեր՝ նախատեսված էլեկտրոնիկայում օգտագործման համար՝ սկավառակների, թիթեղների ձեւով եւ նույնանման ձեւերով. լեգիրված քիմիական միացություններ՝ նախատեսված էլեկտրոնիկայում օգտագործման համար",
                "3819 " => "Արգելակման հիդրավլիկ հեղուկներ եւ այլ պատրաստի հեղուկներ՝ նախատեսված հիդրավլիկական փոխանցիչների համար՝ մինչեւ 70% զանգվածային բաժին բիտումային ապարներից ստացված նավթ կամ նավթամթերքներ չպարունակող կամ պարունակող",
                "3820 " => "Պատրաստի հակասառիչներ եւ հակասառցապատիչ հեղուկներ",
                "3821 " => "Պատրաստի կուլտուրալ միջավայրեր՝ նախատեսված միկրոօրգանիզմներ (ներառյալ վարակահարուցիչ եւ նման մանրէները) կամ բույսերի, մարդու կամ կենդանիների բջիջներ աճեցնելու կամ դրանց կենսագործունեությունն ապահովելու համար",
                "3822 " => "Ախտորոշիչ կամ լաբորատոր ազդանյութեր տակդիրով, պատրաստի ախտորոշիչ կամ լաբորատոր ազդանյութեր տակդիրով կամ առանց տակդիրի՝ բացի 3002 կամ 3006 ապրանքային դիրքում նշված ապրանքներից, հավաստագրված չափանմուշային նյութեր",
                "3823" => "Արդյունաբերական մոնոկարբոնային ճարպաթթուներ, թթվայուղեր զտումից հետո. արդյունաբերական ճարպային սպիրտներ",
                "3824" => "Պատրաստի կապակցանյութեր՝ նախատեսված ձուլակաղապարների եւ ձուլաձողերի արտադրության համար, քիմիական, արդյունաբերության քիմիական կամ հարակից ճյուղերի նյութեր եւ պատրաստուկներ (ներառյալ բնական նյութերի խառնուրդներից բաղկացած պատրաստուկները)՝ այլ տեղում չնշված կամ չներառված",
                "3825" => "Քիմիական կամ հարակից ճյուղերի արդյունաբերության մնացորդային ապրանքներ՝ այլ տեղում չնշված կամ չներառված, քաղաքային տնտեսության թափոններ, կեղտաջրերի շլամ, այլ թափոններ՝ տվյալ խմբին վերաբերող 6-րդ ծանոթագրության մեջ նշված",
                "3826 " => "Բիոդիզել եւ դրա խառնուրդները, որոնք չեն պարունակում կամ պարունակում են 70% զանգվածային բաժնից պակաս նավթ կամ նավթամթերքներ՝ բիտումային ապարներից ստացված",
                "3901" => "Էթիլենի պոլիմերներ՝ սկզբնական ձեւերով",
                "3902" => "Պրոպիլենի կամ այլ օլեֆինների պոլիմերներ՝ սկզբնական ձեւերով",
                "3903" => "Ստիրոլի պոլիմերներ՝ սկզբնական ձեւերով",
                "3904" => "Վինիլքլորիդի կամ այլ հալոգենացված օլեֆինների պոլիմերներ՝ սկզբնական ձեւերով",
                "3905" => "Վինիլացետատի կամ այլ բարդ վինիլային եթերների պոլիմերներ՝ սկզբնական ձեւերով. վինիլային այլ պոլիմերներ՝ սկզբնական ձեւերով",
                "3906" => "Ակրիլային պոլիմերներ՝ սկզբնական ձեւերով",
                "3907" => "Պոլիացետալներ, այլ պարզ պոլիեթերներ եւ էպօքսիդային խեժեր՝ սկզբնական ձեւերով. պոլիկարբոնատներ, ալկիդային խեժեր, պոլիալիլային բարդ եթերներ եւ այլ բարդ պոլիեթերներ՝ սկզբնական ձեւերով",
                "3908" => "Պոլիամիդներ՝ սկզբնական ձեւերով",
                "3909" => "Ամինաալդեհիդային խեժեր, ֆենոլաալդեհիդային խեժեր եւ պոլիուրեթաններ՝ սկզբնական ձեւերով",
                "3910 " => "Սիլիկոններ՝ սկզբնական ձեւերով",
                "3911" => "Նավթային խեժեր, կումարոնաինդենային խեժեր, պոլիտերպեններ, պոլիսուլֆիդներ, պոլիսուլֆոններ եւ այլ նյութեր՝ նշված տվյալ խմբի 3–րդ ծանոթագրությունում՝ սկզբնական ձեւերով, այլ տեղում չնշված կամ չներառված",
                "3912" => "Թաղանթանյութ եւ դրա քիմիական ածանցյալները՝ սկզբնական ձեւերով, այլ տեղում չնշված կամ չներառված",
                "3913" => "Բնական պոլիմերներ (օրինակ՝ ալգինաթթու) եւ բնական մոդիֆիկացված պոլիմերներ (օրինակ՝ պնդացած պրոտեիններ, բնական կաուչուկի քիմիական ածանցյալներ)՝ սկզբնական ձեւերով, այլ տեղում չնշված կամ չներառված",
                "3914 " => "Իոնափոխանակիչ խեժեր՝ ստացված 3901–3913 ապրանքային դիրքերում նշված պոլիմերների հիմքով, սկզբնական ձեւերով",
                "3915" => "Թափոններ, կտորտանք եւ ջարդոն պլաստմասսաներից",
                "3916" => "Միաթել՝ 1 մմ–ից ավելի լայնական հատույթով, ձողիկներ, կաղապարաձողեր եւ ձեւավոր պրոֆիլներ՝ մշակած կամ չմշակած մակերեւույթով, բայց այլ մշակման չենթարկված, պլաստմասսայից",
                "3917" => "Խողովակներ, փողակներ, ճկափողեր եւ դրանց կցամասերը (օրինակ՝ միացումներ, ծունկեր, կցաշուրթեր) պլաստմասսայից",
                "3918" => "Պատվածքներ հատակի համար՝ պլաստմասսայից ինքնակպչուն կամ ոչ ինքնակպչուն, գլանափաթեթներով կամ սալիկներով. պատվածքների պատերի կամ առաստաղների համար՝ պլաստմասսայից, նշված տվյալ խմբի 9–րդ ծանոթագրության մեջ",
                "3919" => "Պլաստմասսայից սալիկներ, թերթեր, թաղանթ, ժապավեն, շերտ եւ այլ հարթ ձեւեր՝ ինքնակպչուն, գլանափաթեթներով կամ ոչ գլանափաթեթներով",
                "3920" => "Պլաստմասսայից սալիկներ, թերթեր, թաղանթ ու շերտեր կամ ժապավեններ, այլ՝ ոչ ծակոտկեն եւ չամրանավորված, ոչ շերտավոր, ոչ հիմնաշերտով եւ նույնանման ձեւով չմիացված այլ նյութերի հետ",
                "3921" => "Պլաստմասսայից այլ սալիկներ, թերթեր, թաղանթ եւ շերտեր կամ ժապավեններ",
                "3922" => "Պլաստմասսայից լոգնոցներ, ցնցուղներ, կոնքեր ջրի հոսքի համար, կոնքեր լվացվելու համար, բիդեներ, զուգարանակոնքեր, դրանց համար նստոցներ ու կափարիչներ, ջրթափ բաքեր եւ նույնանման սանիտարատեխնիկական արտադրատեսակներ",
                "3923" => "Պլաստմասսայից արտադրատեսակներ ապրանքների տրանսպորտային փոխադրման կամ փաթեթավորման համար՝ խցաններ, կափարիչներ, թասակներ եւ այլ միջոցներ խցանելու համար",
                "3924" => "Ճաշի եւ խոհանոցային սպասք, ճաշի պարագաներ ու խոհանոցային պիտույքներ, տնային գործածության եւ հիգիենայի կամ արդուզարդի այլ իրեր պլաստմասսայից",
                "3925" => "Շինարարական դետալներ պլաստմասսայից՝ այլ տեղում չնշված կամ չներառված",
                "3926" => "Այլ արտադրատեսակներ՝ պլաստմասսայից եւ արտադրատեսակներ այլ նյութերից՝ նշված 3901–3914 ապրանքային դիրքերում",
                "4001" => "Բնական կաուչուկ, բալատա, գուտապերչ, գվայուլա, չիկլ եւ նույնանման բնական խեժեր՝ սկզբնական ձեւերով կամ թիթեղների, թերթերի կամ շերտերի կամ ժապավենների տեսքով",
                "4002" => "Սինթետիկ կաուչուկ եւ յուղերից ստացված ֆակտիս` սկզբնական ձեւերով կամ թիթեղների, թերթերի կամ շերտերի կամ ժապավենների տեսքով, 4001 ապրանքային դիրքում ընդգրկված նյութերի խառնուրդներ տվյալ ապրանքային դիրքում ընդգրկված ցանկացած նյութի հետ` սկզբնական ձեւերով կամ թիթեղների, թերթերի կամ շերտերի կամ ժապավենների տեսքով",
                "4003 " => "Վերականգնված կաուչուկ` սկզբնական ձեւերով կամ թիթեղների, թերթերի կամ շերտերի կամ ժապավենների տեսքով",
                "4004 " => "Ռետինի թափոններ, կտորտանքներ եւ ջարդոն (բացի կոշտ ռետինից), դրանցից ստացված փոշիներ եւ հատիկներ (գրանուլներ)",
                "4005" => "Չվուլկանացված ռետինային խառնուրդ` սկզբնական ձեւերով կամ թիթեղների, թերթերի կամ շերտերի կամ ժապավենների տեսքով",
                "4006" => "Այլ ձեւեր (օրինակ` ձողեր, խողովակներ ու ձեւավոր պրոֆիլներ) եւ արտադրատեսակներ (օրինակ` սկավառակներ ու օղակներ) չվուլկանացված ռետինից",
                "4007 " => "Վուլկանացված ռետինե թելեր եւ կորդ",
                "4008" => "Վուլկանացված ռետինից թիթեղներ, թերթեր, շերտեր կամ ժապավեններ, ձողեր եւ ձեւավոր պրոֆիլներ՝ բացի կոշտ ռետինից",
                "4009" => "Խողովակներ, փողակներ եւ ճկափողեր` վուլկանացված ռետինից՝ բացի կոշտ ռետինից, առանց կցամասերի եւ կցամասերով (օրինակ` միացումներով, կարճախողովակներով, կցաշուրթերով)",
                "4010" => "Փոխակրիչային ժապավեններ կամ շարժափոկեր կամ բելթինգ՝ վուլկանացված ռետինից",
                "4011" => "Անվադողեր եւ ծածկադողեր՝ օդաճնշական ռետինե նոր",
                "4012" => "Օդաճնշական ռետինե անվադողեր եւ ծածկադողեր՝ վերականգնված կամ օգտագործված, մեծ կամ կիսաօդաճնշական անվադողեր եւ ծածկադողեր, անվադողերի պահպանաշերտեր եւ անվահեցի ժապավեններ` ռետինից",
                "4013" => "Ռետինե օդախցիկներ",
                "4014" => "Հիգիենիկ կամ դեղագործական արտադրատեսակներ (ներառյալ ծծակները) վուլկանացրած ռետինից՝ բացի կոշտ ռետինից՝ կցամասերով կամ առանց դրանց",
                "4015" => "Հագուստ եւ հագուստի պարագաներ (ներառյալ ձեռնոցները, թաթմանները եւ կիսաձեռնոցները)՝ վուլկանացված ռետինից՝ բացի կոշտ ռետինից, այլ նպատակների համար",
                "4016" => "Արտադրատեսակներ վուլկանացված ռետինից՝ բացի կոշտ ռետինից, այլ",
                "4017 " => "Ռետին կոշտ (օրինակ` էբոնիտ)` բոլոր ձեւերով` ներառյալ թափոններն ու ջարդոնը, կոշտ ռետինից պատրաստված արտադրատեսակներ",
                "4101" => "Խոշոր եղջերավոր անասունների (ներառյալ գոմեշների) կամ ձիազգի կենդանիների (թարմ կամ աղադրված, չորացրած, մոխրած, աղջրած կամ այլ կերպ պահածոյացված, բայց չդաբաղած, չմագաղաթացրած կամ հետագա մշակման չենթարկված) չմշակված մորթեր՝ մազածածկույթով կամ առանց մազածածկույթի, կրկնորդված կամ չկրկնորդված",
                "4102" => "Ոչխարների չմշակված մորթեր կամ գառների մորթիկներ (թարմ կամ աղադրված, չորացրած, մոխրած, աղջրած կամ այլ կերպ պահածոյացված, բայց չդաբաղած, չմագաղաթացրած կամ հետագա մշակման չենթարկած)՝ բրդյա ծածկույթով կամ առանց բրդյա ծածկույթի, կրկնորդված կամ չկրկնորդված՝ բացի տվյալ խմբի 1գ ծանոթագրությամբ բացառվածներից",
                "4103" => "Այլ չմշակված մորթեր (թարմ կամ աղադրված, չորացրած, մոխրած, աղջրած կամ այլ կերպ պահածոյացված, բայց չդաբաղած, չմագաղաթացրած կամ հետագա մշակման չենթարկած)՝ մազածածկույթով կամ առանց մազածածկույթի, կրկնորդված կամ չկրկնորդված՝ բացի տվյալ խմբի 1բ կամ 1գ ծանոթագրությամբ բացառվածներից",
                "4104" => "Դաբաղած կաշի կամ կաշվե կրաստ՝ խոշոր եղջերավոր անասունների (ներառյալ գոմեշների) կամ ձիազգի կենդանիների մորթերից՝ առանց մազածածկույթի, կրկնորդված կամ չկրկնորդված, բայց առանց հետագա մշակման",
                "4105" => "Դաբաղած կաշի կամ կաշվե կրաստ՝ ոչխարների մորթերից կամ գառների մորթիկներից՝ առանց բրդյա ծածկույթի, կրկնորդված կամ չկրկնորդված, բայց առանց հետագա մշակման",
                "4106" => "Դաբաղած կաշի կամ կաշվե կրաստ՝ այլ կենդանիների մորթերից՝ առանց բրդյա ծածկույթի կամ մազածածկույթի, կրկնորդված կամ չկրկնորդված, բայց առանց հետագա մշակման",
                "4107" => "Կաշի՝ դաբաղումից հետո լրացուցիչ մշակում անցած կամ կաշվե կրաստի տեսքով, ներառյալ մագաղաթացվածը՝ խոշոր եղջերավոր անասունների (ներառյալ գոմեշների) կամ ձիազգի կենդանիների մորթերից՝ առանց մազածածկույթի, կրկնորդված կամ չկրկնորդված՝ բացի 4114 ապրանքային դիրքում ընդգրկված կաշվից",
                "4112 " => "Կաշի՝ դաբաղումից հետո լրացուցիչ մշակված կամ կաշվե կրաստի տեսքով, ներառյալ մագաղաթացվածը՝ ոչխարների մորթերից կամ գառների մորթիկներից՝ կրկնորդված կամ չկրկնորդված, բացի 4114 ապրանքային դիրքում ընդգրկված կաշվից",
                "4113" => "Կաշի՝ դաբաղումից հետո լրացուցիչ մշակված կամ կաշվե կրաստի տեսքով, ներառյալ մագաղաթացվածը՝ այլ կենդանիների մորթերից՝ առանց բրդյա կամ մազային ծածկույթի, կրկնորդված կամ չկրկնորդված, բացի 4114 ապրանքային դիրքում ընդգրկված կաշվից",
                "4114" => "Թավշակաշի (ներառյալ` համակցված թավշակաշին), լաքապատ կաշի եւ մակաշերտված լաքապատ կաշի, մետաղացված կաշի",
                "4115" => "Կոմպոզիցիոն կաշի՝ բնական կաշվի կամ կաշվային մանրաթելերի հիմքով, թիթեղներով, թերթերով կամ շերտերով կամ ժապավեններով, գլանափաթեթներով կամ ոչ գլանափաթեթներով, բնական կամ կոմպոզիցիոն կաշվի կտորտանք եւ այլ թափոններ՝ կաշվե արտադրատեսակների արտադրության համար ոչ պիտանի, կաշվի մանրափոշի, փոշի եւ ալյուր",
                "4201 " => "Արտադրատեսակներ՝ թամբագործական եւ լծասարքեր՝ ցանկացած կենդանու համար (ներառյալ լծափոկերը, սանձափոկերը, ծնկակալները, դնչկալները, ձիերի համար նախատեսված ծածկոցները, խուրջինները, շների համար նախատեսված ծածկոցները եւ նույնանման արտադրատեսակները)՝ պատրաստված ցանկացած նյութից",
                "4202" => "Ուղեպայուսակներ, ճամպրուկներ, կանացի պայուսակներ-ճամպրուկներ, գործնական փաստաթղթերի համար քեյսեր, պորտֆելներ, դպրոցական պայուսակներ, ակնոցների, հեռադիտակների, լուսանկարչական ապարատների, երաժշտական գործիքների, հրացանների տուփեր, պատյան եւ նույնանման արտադրատեսակներ. պայուսակներ՝ ճամփորդական, թերմոս-պայուսակներ սննդամթերքի կամ ըմպելիքի համար, պայուսակներ՝ կոսմետիկայի համար, թիկնապայուսակներ, կանացի պայուսակներ, տնտեսական պայուսակներ, դրամապանակներ, քսակներ, աշխարհագրական քարտեզների պատյաններ, ծխախոտատուփեր, ծխախոտաքսակներ, աշխատանքային գործիքների պայուսակներ, պայուսակներ՝ մարզական, շշերի պատյաններ, զարդատուփեր ոսկերչական իրերի համար, դիմափոշամաններ, կտրող գործիքների տուփեր եւ նույնանման արտադրատեսակներ՝ բնական կամ կոմպոզիցիոն կաշվից, պլաստմասսայի թերթերից, մանածագործական նյութերից, վուլկանացված մանրաթելերից կամ ստվարաթղթից, կամ ամբողջությամբ կամ հիմնականում պատված այդպիսի նյութերով կամ թղթով",
                "4203" => "Հագուստի առարկաներ եւ հագուստի պարագաներ՝ բնական կաշվից կամ կոմպոզիցիոն կաշվից",
                "4205 " => "Այլ արտադրատեսակներ՝ բնական կաշվից կամ կոմպոզիցիոն կաշվից",
                "4206 " => "Արտադրատեսակներ՝ աղիքներից (բացի շերամի ֆիբրոինից ստացված մանրաթելից), սինյուգայից, պարկերից կամ ջլերից",
                "4301" => "Մուշտակամորթ հումք (ներառյալ գլուխները, պոչերը, թաթերը եւ այլ մասեր կամ կտորտանքը` պիտանի մորթուց պատրաստվող արտադրատեսակների արտադրության համար)՝ բացի 4101, 4102 կամ 4103 ապրանքային դիրքերում նշված չմշակված մորթերից)",
                "4302" => "Դաբաղած կամ մշակած մորթիով մորթիկներ (ներառյալ գլուխները, պոչերը, թաթերը եւ այլ մասեր կամ կտորտանքը)՝ չհավաքած կամ հավաքած (առանց այլ նյութեր ավելացնելու)՝ բացի 4303 ապրանքային դիրքում նշվածներից",
                "4303" => "Հագուստի առարկաներ, հագուստի պարագաներ եւ այլ արտադրատեսակներ բնական մորթուց",
                "4304 " => "Արհեստական մորթի եւ դրանից պատրաստված արտադրատեսակներ",
                "4401" => "Վառելափայտ՝ գերանների, ծղանների, ճյուղերի, ցախի տրցակների տեսքով կամ նույնանման ձեւերով, փայտանյութ՝ ծեղերի կամ տաշեղի տեսքով, փայտաթեփ եւ փայտի թափոններ եւ կտորտանք՝ չշեղջաքարացված (չագլոմերացված) կամ շեղջաքարացված (ագլոմերացված), գերանների, բրիկետների, հատիկների (գրանուլների) տեսքով կամ նույնանման ձեւերով",
                "4402" => "Փայտածուխ (ներառյալ ածուխը՝ կճեպից կամ ընկույզներից ստացված)՝ շեղջաքարացված (ագլոմերացված) կամ չշեղջաքարացված (չագլոմերացված)",
                "4403" => "Անտառանյութեր՝ չմշակված, կեղեւը կամ մատաղ շերտը հեռացրած կամ չհեռացրած կամ կոպիտ եզրատաշած կամ չեզրատաշած",
                "4404" => "Փայտանյութ՝ տակառագործական. ճեղքած գերաններ, փայտե ցցագերաններ, ցցեր եւ սյուներ` սրածայր, բայց երկայնքով չսղոցած. անտառանյութեր՝ կոպիտ տաշած, բայց չշրջատաշած, չկորացրած եւ այլ եղանակով չմշակած, գործիքների եւ նույնանման արտադրատեսակների համար նախատեսված ձեռնափայտերի, հովանոցների, բռնակների արտադրության համար օգտագործվող. ծեղ եւ նույնանման փայտանյութ",
                "4406" => "Փայտակոճեր երկաթուղային կամ տրամվայի գծերի համար",
                "4407" => "Անտառանյութեր՝ երկայնակի սղոցմամբ կամ ճեղքմամբ, ռանդմամբ կամ կեղեւահանմամբ ստացված, ռանդմամբ, հղկմամբ մշակված կամ չմշակված, ճակատային միացումներով կամ առանց դրանց, 6 մմ-ից ավելի հաստությամբ",
                "4408" => "Երեսապատման թերթեր (ներառյալ` շերտավոր փայտանյութի մասնատումից ստացված թերթերը)` սոսնձած նրբատախտակի կամ նույնանման շերտավոր փայտանյութի համար, եւ այլ անտառանյութեր՝ երկայնակի սղոցմամբ կամ ճեղքմամբ, ռանդմամբ կամ կեղեւահանմամբ ստացված, ռանդմամբ, հղկմամբ մշակված կամ չմշակված, ճակատային միացումներով կամ առանց դրանց, 6 մմ-ից ոչ ավելի հաստությամբ",
                "4409" => "Սղոցանյութեր (ներառյալ զոլակները եւ ծոփորները՝ հատակի մանրահատակային ծածկապատման համար, չհավաքված)՝ պրոֆիլավորված չորսուի տեսքով (կատարներով, փորակներով, ագուցավոր, տաշած եզրերով, կիսակլոր մատնեքի տեսքով միացումով, ձեւավոր, կլորացված կամ նույնանման ձեւով) որեւէ եզրով, կողաճակատով կամ հարթությամբ, ռանդմամբ մշակված, ճակատային միացումներով, ռանդմամբ կամ հղկմամբ մշակված կամ չմշակված",
                "4410" => "Փայտատաշեղային սալեր, խառատային տաշեղով սալեր (OSB) եւ նույնանման սալեր (օրինակ՝ վաֆլենման սալիկները)՝ փայտանյութից կամ այլ փայտացած նյութերից՝ խեժերով կամ օրգանական այլ կապակցող նյութերով ներծծված կամ չներծծված",
                "4411" => "Փայտամանրաթելային սալեր փայտանյութից կամ այլ փայտացած նյութերից՝ խեժերի կամ օրգանական այլ նյութերի հավելումով կամ առանց հավելման",
                "4412" => "Սոսնձած նրբատախտակ, նրբատախտակով երեսապատված պանելներ եւ նույնանման նյութեր՝ շերտավոր փայտանյութից",
                "4413 " => "Մամլած փայտանյութ՝ բլոկերի, սալերի, չորսուների կամ պրոֆիլացված ֆորմաների տեսքով",
                "4414 " => "Փայտե շրջանակներ՝ նկարների, լուսանկարների, հայելիների կամ նույնանման առարկաների համար",
                "4415" => "Արկղեր, տուփեր, փաթեթավորման վանդակներ կամ զամբյուղներ, թմբուկներ եւ նույնանման տարաներ՝ փայտանյութից, փայտե մալուխային թմբուկներ, փայտե ընդկալներ, տակդիրներ եւ բեռնման այլ փայտե վահաններ, փայտե կողապատեր",
                "4416 " => "Տակառներ, տակառիկներ, գուռեր, տաքարներ եւ տակառագործական այլ արտադրատեսակներ եւ դրանց մասերը՝ փայտանյութից՝ ներառյալ տակառատախտակը",
                "4417 " => "Գործիքներ, գործիքների պատյաններ եւ բռնակներ՝ փայտանյութից, ավելների կամ խոզանակների փայտե մասեր եւ բռնակներ, կոշիկի փայտե կաղապարներ եւ առձգիչներ",
                "4418" => "Ատաղձագործական եւ հյուսնի պատրաստած փայտե արտադրատեսակներ՝ շինարարական՝ ներառյալ հատակի փայտե ծակոտկեն պանելները՝ հավաքված, տանիքի կավարը եւ հերձանը",
                "4419 " => "Սեղանի եւ խոհանոցային պարագաներ՝ փայտից",
                "4420" => "Փայտե արտադրատեսակներ՝ խճանկարային եւ դրվագազարդ, փայտե զարդատուփեր եւ տուփեր՝ ոսկերչական իրերի կամ դանակների եւ նույնանման արտադրատեսակների համար, արձանիկներ եւ դեկորատիվ այլ արտադրատեսակներ՝ փայտից, կահույքի փայտե առարկաներ՝ 94-րդ խմբում չնշված",
                "4421" => "Փայտե այլ արտադրատեսակներ",
                "4501" => "Բնական խցան՝ չմշակած կամ առաջնային մշակման ենթարկված, խցանի թափոններ, մանրացրած, հատիկացված (գրանուլացված) կամ աղացած խցան",
                "4502 " => "Բնական խցան`արտաքին շերտը հեռացված կամ կոպտորեն կտրված կամ ուղղանկյուն (ներառյալ քառանկյուն) բլոկների, սալերի, թերթերի կամ շերտերի տեսքով (ներառյալ խցանների պատրաստման համար նախապատրաստուկները կամ սուր եզրեր ունեցող խցափակիչները)",
                "4503" => "Բնական խցանից պատրաստված արտադրատեսակներ",
                "4504" => "Շեղջաքարացված (ագլոմերացված) խցան (կապակցող նյութով կամ առանց դրա) եւ դրանից պատրաստված արտադրատեսակներ",
                "4601" => "Հյուսածո եւ հյուսքի համար նախատեսված նյութերից ստացված նույնանման արտադրատեսակներ՝ շերտերի կամ ժապավենների տեսքով իրար միացված կամ չմիացված, հյուսքի համար նյութեր, հյուսածո եւ հյուսքի համար նախատեսված նյութերից ստացված նույնանման արտադրատեսակներ՝ զուգահեռ ոլորաթելերի տեսքով գործված կամ թերթերի ձեւով հյուսած, ավարտուն կամ ոչ ավարտուն (օրինակ՝ գորգիկներ, խսիրներ, փեղկավարագույրներ)",
                "4602" => "Զամբյուղային, հյուսածո եւ այլ արտադրատեսակներ՝ պատրաստված անմիջականորեն հյուսքի համար նախատեսված նյութերից կամ 4601 ապրանքային դիրքում նշված ապրանքներից. լուֆայից պատրաստված արտադրատեսակներ",
                "4701 " => "Փայտանյութի զանգված",
                "4702 " => "Փայտի թաղանթանյութ՝ լուծվող տեսակները",
                "4703" => "Փայտի թաղանթանյութ՝ նատրոնային կամ սուլֆատային՝ բացի լուծվող տեսակներից",
                "4704" => "Փայտանյութի թաղանթանյութ՝ սուլֆիտային՝ բացի լուծվող տեսակներից",
                "4705 " => "Փայտանյութի զանգված՝ ստացված եփման մեխանիկական եւ քիմիական եղանակների համակցությամբ",
                "4706" => "Թելքավոր զանգված` ստացված վերականգնված թղթից կամ ստվարաթղթից (տպագրական խոտանից եւ թղթի թափոններից) կամ այլ թելքավոր թաղանթանյութերից",
                "4707" => "Վերականգնված թուղթ կամ ստվարաթուղթ (տպագրական խոտան եւ թղթի թափոններ)",
                "4801 " => "Լրագրային թուղթ՝ գլանափաթեթներով կամ թերթերով",
                "4802" => "Գրելու, տպագրության կամ գծագրական այլ նպատակներով օգտագործվող ոչ կավճապատ թուղթ եւ ստվարաթուղթ, եւ չծակոտած քարտեր ու թղթե ժապավեններ՝ գլանափաթեթներով կամ ցանկացած չափի ուղղանկյուն (ներառյալ քառակուսի) թերթերով, բացի 4801 կամ4803 ապրանքային դիրքերում ընդգրկված թղթից. ձեռքով կաղապարված թուղթ եւ ստվարաթուղթ",
                "4803 " => "Արդուզարդի թղթե անձեռոցիկներ կամ անձեռոցիկներ դեմքի համար, սրբիչներ կամ խանձարուրներ եւ տնտեսական-կենցաղային կամ սանիտարահիգիենիկ նշանակության թղթի այլ տեսակներ, թաղանթանյութի բամբակ եւ թաղանթանյութի մանրաթելից քաթան՝ խորշոմավորված կամ հարթ մակերեւույթով, ծալքավոր կամ ոչ ծալքավոր, դրոշմատպված կամ առանց դրոշմատպման, ծակոտած կամ չծակոտած, ներկված կամ չներկված մակերեսով, տպված կամ չտպված, գլանափաթեթներով կամ թերթերով",
                "4804" => "Կրաֆթ-թուղթ եւ կրաֆթ-ստվարաթուղթ՝ ոչ կավճապատ, գլանափաթեթներով կամ թերթերով՝ բացի 4802 կամ 4803 ապրանքային դիրքում նշվածներից",
                "4805" => "Այլ ոչ կավճապատ թուղթ եւ ստվարաթուղթ՝ գլանափաթեթներով կամ թերթերով, հետագա մշակում չանցած կամ անցած, ինչպես նշված է տվյալ խմբի 3-րդ ծանոթագրության մեջ",
                "4806" => "Բուսական մագաղաթ, անյուղանցիկ թուղթ, կալկա, պերգամին եւ այլ կոկած թափանցիկ կամ կիսաթափանցիկ թուղթ՝ գլանափաթեթներով կամ թերթերով",
                "4807 " => "Բազմաշերտ թուղթ եւ ստվարաթուղթ (պատրաստված թղթի կամ ստվարաթղթի հարթ շերտերը կապակցող նյութով սոսնձելու եղանակով)՝ առանց մակերեսային պատվածքի կամ ներծծման, ամրանավորած կամ չամրանավորած, գլանափաթեթներով կամ թերթերով",
                "4808" => "Ծալքավոր թուղթ եւ ստվարաթուղթ (սոսնձած կամ չսոսնձած արտաքին հարթ շերտերով), խորշոմավորած, դրոշմատպված կամ ծակոտած՝ գլանափաթեթներով կամ թերթերով՝ բացի 4803 ապրանքային դիրքում նշվածներից",
                "4809" => "Պատճենահանող, ինքնապատճենահանող եւ պատճենահանող կամ փոխադրիչ այլ թուղթ (ներառյալ պատճենահանող սարքերի կամ օֆսեթային թիթեղների նախշակաղապարների համար նախատեսված պատվածքով կամ ներծծված թուղթը), տպված կամ չտպված, գլանափաթեթներով կամ թերթերով",
                "4810" => "Թուղթ եւ ստվարաթուղթ՝ մեկ կամ զույգ կողմերից կաոլինով (չինական կավով) կամ այլ անօրգանական նյութերով պատված, կապակցող նյութերի օգտագործմամբ կամ առանց կապակցող նյութերի, եւ առանց որեւէ այլ պատվածքի, ներկած կամ չներկած, զարդարված կամ չզարդարված մակերեսով, տպված կամ չտպված, գլանափաթեթներով կամ ցանկացած չափի ուղղանկյուն (ներառյալ քառակուսի) թերթերով",
                "4811" => "Թուղթ, ստվարաթուղթ, թաղանթանյութի բամբակ եւ թաղանթանյութի մանրաթելերից քաթան՝ պատվածքով, ներծծված, մակաշերտված, ներկված կամ զարդարված մակերեսով կամ տպված, ցանկացած չափի գլանափաթեթներով կամ ուղղանկյուն (ներառյալ քառակուսի) թերթերով, բացի 4803, 4809 կամ 4810 ապրանքային դիրքերում ընդգրկված ապրանքներից",
                "4812 " => "Ֆիլտրման բլոկներ, սալեր եւ թիթեղներ թղթազանգվածից",
                "4813" => "Ծխախոտաթուղթ՝ կտրված կամ չկտրված ըստ չափի կամ գրքույկների կամ փողակների ձեւով",
                "4814" => "Պաստառներ եւ պատի նույնանման պատվածքներ. թափանցիկ թուղթ պատուհանների համար",
                "4816" => "Պատճենահանող, ինքնապատճենահանող եւ այլ պատճենահանող կամ փոխադրիչ թուղթ (բացի 4809 ապրանքային դիրքում ընդգրկված թղթից), նախշակաղապարներ պատճենահանող սարքերի համար եւ օֆսեթային թիթեղներ թղթից՝ տուփերի մեջ փաթեթավորված կամ չփաթեթավորված",
                "4817" => "Թղթից կամ ստվարաթղթից ծրարներ, բացիկներ նամակների համար, փոստային բացիկներ առանց նկարների եւ բացիկներ նամակագրության համար. թղթից կամ ստվարաթղթից տուփեր, պայուսակներ, պատյաններ եւ փոստային թղթապանակներ (կոմպենդիումներ), որոնք պարունակում են գրասենյակային թղթե պարագաների հավաքածուներ",
                "4818" => "Զուգարանի թուղթ եւ նույնանման թուղթ, թաղանթանյութի բամբակ կամ թաղանթանյութի բամբակից քաթան՝ ստացված տնտեսական, կենցաղային կամ սանիտարահիգիենիկ նշանակության թաղանթանյութի մանրաթելերից, 36 սմ-ից ոչ ավելի լայնությամբ գլանափաթեթներով կամ կտրտած՝ ըստ չափի կամ ձեւի. թաշկինակներ, կոսմետիկ անձեռոցիկներ, սրբիչներ, սփռոցներ, անձեռոցիկներ, սավաններ եւ կենցաղային-տնտեսական, սանիտարահիգիենիկ կամ բժշկական նշանակության նույնանման արտադրատեսակներ, հագուստի առարկաներ եւ հագուստի պարագաներ՝ թղթի զանգվածից, թղթից, թաղանթանյութի բամբակից կամ թաղանթանյութի մանրաթելերից պատրաստված քաթանից",
                "4819" => "Ստվարաթղթե տուփեր, արկղեր, տուփեր, պարկեր, թղթե տոպրակներ եւ փաթեթավորման այլ տարաներ՝ թղթից, ստվարաթղթից, թաղանթանյութի բամբակից կամ թաղանթանյութի մանրաթելերից պատրաստված քաթանից. քարտարկղեր, նամակարկղեր եւ նույնանման արտադրատեսակներ՝ թղթից կամ ստվարաթղթից, որոնք օգտագործվում են հիմնարկներում, խանութներում կամ նույնանման նպատակներով",
                "4820" => "Գրանցամատյաններ, հաշվապահական գրքեր, գրառումների տետրեր, պատվերները գրանցելու գրքեր, անդորրագրերի գրքույկներ, նոթատետրեր նամակների, հուշագրությունների համար, օրագրեր եւ նույնանման արտադրատեսակներ, տետրեր, ծծիչ թղթերով նոթատետրեր, հանովի կազմեր (պոկովի թերթիկների համար եւ այլ), թղթապանակներ, արագակարներ, ինքնապատճենահանող՝ գործին առնչվող ձեւաթղթեր, թերթերով միջադրած պատճենահանող հավաքածուներ եւ թղթից կամ ստվարաթղթից գրասենյակային այլ ապրանքներ. ալբոմներ նմուշների կամ հավաքածուների համար եւ գրքի կազմեր թղթից կամ ստվարաթղթից",
                "4821" => "Ամեն տեսակի պիտակներ եւ ապրանքանիշեր՝ թղթից կամ ստվարաթղթից, տպված կամ չտպված",
                "4822" => "Գլանակոճեր, կոճեր, մասրաներ եւ նույնանման բռնիչներ՝ թղթե զանգվածից, թղթից կամ ստվարաթղթից (ծակոտած կամ չծակոտած, ամրանավորված կամ չամրանավորված)",
                "4823" => "Թուղթ, ստվարաթուղթ, թաղանթանյութի բամբակ եւ թաղանթանյութի մանրաթելերից պատրաստված քաթան, այլ, ըստ չափի կամ ձեւի կտրած. արտադրատեսակներ՝ թղթե զանգվածից, թղթից, ստվարաթղթից, թաղանթանյութի բամբակից կամ թաղանթանյութի մանրաթելերի քաթանից, այլ",
                "4901" => "Տպագիր գրքեր, բրոշյուրներ, թռուցիկներ եւ նույնանման տպագրված նյութեր՝ բրոշյուրավորած կամ առանձին թերթերի տեսքով",
                "4902" => "Լրագրեր, ամսագրեր եւ այլ պարբերական հրատարակություններ՝ նկարազարդ կամ ոչ նկարազարդ, գովազդային նյութեր պարունակող կամ չպարունակող",
                "4903 " => "Մանկական գիրք–նկարներ, գրքեր նկարելու կամ գունազարդելու համար",
                "4904 " => "Նոտաներ՝ տպագիր կամ ձեռագիր, կազմով կամ չկազմած, նկարազարդ կամ ոչ նկարազարդ",
                "4905" => "Աշխարհագրական քարտեզներ եւ հիդրոգրաֆիկական կամ նույնանման ցանկացած տեսակի քարտեզներ՝ ներառյալ տպագրված ատլասները, պատի քարտեզները, տեղագրական պլանները եւ գլոբուսները",
                "4906 " => "Պլաններ եւ գծագրեր՝ նախատեսված ճարտարապետական, ինժեներական, արդյունաբերական, առեւտրային, տեղագրական կամ նույնանման այլ նպատակների համար, բնագիր հանդիսացող, ձեռքով կատարված. ձեռագիր տեքստեր. թղթի վրա զգայունացված ֆոտովերարտադրանկարներ եւ վերոհիշյալ ապրանքների պատճենահանված օրինակներ",
                "4907 " => "Չմարած փոստային նամականիշներ, պետտուրքի նամականիշներ կամ ընթացիկ կամ նոր թողարկման նամականիշներ այն երկրի համար, որտեղ դրանք ունեն կամ պիտի ունենան ճանաչված անվանական արժեք. դրոշմաթուղթ. թղթադրամներ. չեկագրքույկներ. բաժնետոմսեր, փոխառության բաժնետոմսեր կամ բոներ (թղթադրամանիշներ) եւ արժեթղթերի նույնանման տեսակներ",
                "4908" => "Փոխադրանկարներ (պատճենատիպ).",
                "4909 " => "Տպագիր կամ նկարազարդ փոստային բացիկներ. տպագրված շնորհավորանքներով, ուղերձով կամ հաղորդագրություններով բացիկներ՝ նկարազարդ կամ ոչ նկարազարդ, ծրարներով կամ առանց ծրարների, զարդարանքով կամ առանց զարդարանքի",
                "4910 " => "Բոլոր տեսակի տպագրված օրացույցներ՝ ներառյալ պոկովի օրացույցները",
                "4911" => "Տպագրական այլ արտադրանք՝ ներառյալ տպագրված վերարտադրանկարները եւ լուսանկարները",
                "5001 " => "Շերամի բոժոժներ, որոնք պիտանի են hետ կծկելու համար",
                "5002 " => "Հումք-մետաքս (չոլորած)",
                "5003 " => "Մետաքսե թափոններ (ներառյալ hետ կծկելու համար ոչ պիտանի բոժոժները, բոժոժաթելի թափոններն ու փխրունացրած հումքը)",
                "5004 " => "Մետաքսե թել (բացի մետաքսե թափոնների մանվածքից)՝ մանրածախ վաճառքի համար չբաժնեծրարված",
                "5005 " => "Մետաքսե թափոններից մանվածք՝ մանրածախ վաճառքի համար չբաժնեծրարված",
                "5006 " => "Մետաքսե թել եւ մետաքսե թափոններից մանվածք՝ բաժնեծրարված մանրածախ վաճառքի համար, շերամի ֆիբրոինից մանրաթել",
                "5007" => "Գործվածքներ՝ մետաքսե թելերից կամ մետաքսե թափոններից",
                "5101" => "Բուրդ՝ չենթարկած սանդերքագզման կամ սանրագզման",
                "5102" => "Կենդանիների մազ՝ բարակ կամ կոշտ, սանդերքագզման կամ սանրագզման չենթարկած",
                "5103" => "Կենդանիների բրդի կամ բարակ կամ կոշտ մազի մնացուկներ՝ ներառյալ մանվածքային մնացուկները, բայց բացառելով փխրունացրած հումքը",
                "5104 " => "Փխրունացրած հումք՝ բրդից կամ կենդանիների բարակ կամ կոշտ մազից",
