                "5211" => "Բամբակե գործվածքներ՝ բամբակի մանրաթելերի 85% զանգվածային բաժնից պակաս պարունակությամբ, հիմնականում կամ բացառապես խառնած քիմիական մանրաթելերի հետ, 200գ/մ²-ից ավելի մակերեսային խտությամբ",
                "5212" => "Այլ բամբակե գործվածքներ",
                "5301" => "Վուշ-հումք կամ մշակած, բայց չմանած. վուշի քոլք եւ մնացուկներ (ներառյալ մանվածքային մնացուկները եւ փխրունացրած հումքը)",
                "5302" => "Կանեփաթել (Cannabis sativa L.), հումք կամ մշակած, բայց չմանած. կանեփաթելի քոլք եւ մնացուկներ՝ (ներառյալ մանվածքային մնացուկները եւ փխրունացրած հումքը)",
                "5303" => "Ջութե մանրաթել եւ թելատուների այլ մանածագործական մանրաթելեր (բացի վուշից, կանեփաթելից եւ ճենականեփի (չինական եղինջ) մանրաթելից), որպես հումք կամ մշակած, բայց չմանած. դրանց քոլքերը եւ մնացուկները (ներառյալ մանվածքային մնացուկները եւ փխրունացրած հումքը)",
