                "5512" => "Սինթետիկ մանրաթելերից գործվածքներ, դրանց 85% զանգվածային բաժին կամ դրանից ավելի պարունակությամբ",
                "5513" => "Սինթետիկ մանրաթելերից գործվածքներ, դրանց 85% զանգվածային բաժնից պակաս պարունակությամբ, հիմնականում կամ բացառապես բամբակե մանրաթելերի հետ խառնած, 170գ/մ²-ից ոչ ավելի մակերեսային խտությամբ",
                "5514" => "Սինթետիկ մանրաթելերից գործվածքներ՝ դրանց 85% զանգվածային բաժնից պակաս պարունակությամբ, հիմնականում կամ բացառապես բամբակե մանրաթելերի հետ խառնած, 170 գ/մ²-ից ավելի մակերեսային խտությամբ",
                "5515" => "Այլ գործվածքներ սինթետիկ մանրաթելերից",
                "5516" => "Գործվածքներ արհեստական մանրաթելերից",
                "5601" => "Բամբակ` մանածագործական նյութերից եւ դրանից պատրաստած արտադրատեսակներ. մանածագործական մանրաթելեր, որոնք երկարությամբ չեն գերազանցում 5 մմ-ը (նրբախավ), մանածագործական մանրափոշի եւ հանգուցիկներ",
                "5602" => "Թաղիք կամ նրբաթաղիք` ներծծված կամ չներծծված, պատվածքով կամ առանց պատվածքի, երկտակված կամ չերկտակված",
                "5603" => "Չգործված կտորեղեն` ներծծված կամ չներծծված, պատվածով կամ առանց պատվածքի, երկտակված կամ չերկտակված",
                "5604" => "Ռետինե թել եւ քուղ, մանածագործական նյութերի պատվածքով, մանածագործական թելեր, 5404 կամ 5405 ապրանքային դիրքերում ընդգրկված հարթ եւ նույնանման թելեր` ներծծված, պատվածքով կամ ռետինե կամ պլաստմասսե թաղանթ ունեցող",
                "5605 " => "Տրեզավոր կամ ոչ տրեզավոր մետաղացված թել, որը 5404 կամ 5405 ապրանքային դիրքում ընդգրկված մանածագործական կամ հարթ կամ նույնանման թել է՝ համակցված թելի շերտով կամ ժապավենով կամ փոշենման մետաղի հետ կամ մետաղով պատված",
                "5606 " => "Տրեզավոր թել եւ 5404 կամ 5405 ապրանքային դիրքում ընդգրկված հարթ եւ նույնանման թել, տրեզավոր թել (բացի 5605 ապրանքային դիրքում ընդգրկված թելից եւ ձիու մազից պատրաստված տրեզավոր թելից). թավաթելի մանվածք՝ (ներառյալ թաղիքե թավաթելը), ձեւավոր հանգուցավոր մանվածք",
                "5607" => "Թոկեր, պարաններ, ճոպաններ եւ մետաղաճոպաններ` հյուսված կամ չհյուսված, հյուսապատվածքով կամ առանց հյուսապատվածքի, ներծծված կամ չներծծված, պատվածքով կամ առանց պատվածքի, ռետինե կամ պլաստմասսայե թաղանթով կամ առանց թաղանթի",
                "5608" => "Ցանցեր եւ ցանցիկներ՝ թոկերից, պարաններից կամ ճոպաններից հյուսած. պատրաստի ձկնորսական ուռկաններ եւ այլ պատրաստի ցանցեր մանածագործական նյութերից",
                "5609 " => "Արտադրատեսակներ թելերից կամ մանվածքից, 5404 կամ 5405 ապրանքային դիրքերում ընդգրկված հարթ կամ նույնանման թելերից, թոկերից, պարաններից, ճոպաններից կամ մետաղաճոպաններից՝ այլ տեղում չնշված կամ չներառված",
                "5701" => "Հանգուցավոր գորգեր եւ հատակի այլ մանածագործական ծածկույթներ՝ պատրաստի կամ անավարտ",
                "5702" => "Գործած գորգեր եւ հատակի այլ մանածագործական ծածկույթներ, առանց թափակար նրբախավի կամ ոչ թաղիքե, պատրաստի կամ անավարտ՝ ներառյալ «կիլիմը», «սումախը», «կերմանին» եւ նույնանման ձեռագործ գորգերը",
                "5703" => "Գորգեր եւ թափակար նրբախավով հատակի այլ մանածագործական ծածկույթներ՝ պատրաստի կամ անավարտ",
                "5704" => "Գորգեր եւ հատակի այլ մանածագործական ծածկույթներ՝ թաղիքից, առանց թափակար նրբախավի կամ ոչ թաղիքե, պատրաստի կամ անավարտ",
                "5705 " => "Գորգեր եւ հատակի այլ մանածագործական ծածկույթներ՝ պատրաստի կամ անավարտ",
                "5801" => "Խավածածկ գործվածքներ եւ գործվածքներ թավաթելից, բացի 5802 կամ 5806 ապրանքային դիրքում ընդգրկված գործվածքներից",
                "5802" => "Գործվածքներ՝ խավավոր սրբիչային եւ նույնանման խավավոր գործվածքներ, բացի 5806 ապրանքային դիրքում ընդգրկված նեղ գործվածքներից. թափակար նրբախավով մանածագործական նյութեր, բացի 5703 ապրանքային դիրքում ընդգրկված արտադրատեսակներից",
                "5803 " => "Գործվածքներ ոլորազարդ (ցանցկեն) հյուսվածքով, բացի 5806 ապրանքային դիրքում ընդգրկված նեղ գործվածքներից",
                "5804" => "Շղարշ եւ այլ ցանցահյուս քաթաններ, բացառությամբ գործված քաթանների, տրիկոտաժե մեքենայական կամ ձեռագործ քաթանների. ժանյակներ կտորով, ժապավեններով կամ առանձին նախշազարդերի տեսքով, բացի 6002–6006 ապրանքային դիրքերում ընդգրկված քաթաններից",
                "5805 " => "Ձեռքով գործված` բելգիական, օբյուսոնյան, բովե եւ նմանատիպ որմնագորգեր եւ որմնագորգեր՝ ասեղով կարված (օրինակ` հարթակարով, խաչակարով), պատրաստի կամ անավարտ",
                "5806" => "Նեղ գործվածքներ, բացի 5807 ապրանքային դիրքում ընդգրկված արտադրատեսակներից. նեղ անթեզաթել գործվածքներ՝ սոսնձմամբ ամրացված (բոլդյուկ)",
                "5807" => "Պիտակներ, խորհրդանշաններ եւ նույնանման արտադրատեսակներ մանածագործական նյութերից` կտորներով, ժապավեններով կամ ըստ ձեւի կամ չափի ձեւած, բայց չասեղնագործված",
                "5808" => "Ժապավենաթել՝ հյուսած, կտորով, դրվագման պարագաներ՝ չասեղնագործված, բացի մեքենայագործ կամ ձեռագործ տրիկոտաժեղենից, ծոպեր, գնդաձեւ ծոպեր եւ նմանատիպ այլ արտադրատեսակներ",
                "5809 " => "Գործվածքներ մետաղական թելերից եւ գործվածքներ 5605 ապրանքային դիրքում ընդգրկված մետաղացված թելերից, որոնք որպես կահույքի գործվածք կամ նույնանման նպատակներով օգտագործվում են հագուստեղենի պատրաստման մեջ՝ այլ տեղում չնշված կամ չներառված",
                "5810" => "Ասեղնագործվածք՝ կտորով, ժապավեններով կամ առանձին նախշազարդերի տեսքով",
                "5811 " => "Մգդակած մանածագործական նյութեր կտորով` մեկ կամ մի քանի մանածագործական նյութերի շերտերից բաղկացած, փափուկ միջադիր շերտով՝ կարով կամ այլ եղանակով միացված՝ բացի 5810 ապրանքային դիրքում ընդգրկված ասեղնագործվածքներից",
                "5901" => "Մանածագործական նյութեր՝ խեժապատ կամ օսլայած, որոնք օգտագործվում են գրքերի կազմեր պատրաստելու կամ նմանատիպ նպատակներով. մոմաթուղթ, նախաներկվածքով կտավ գեղանկարչության համար. սոսնձապատ եւ նմանատիպ կոշտ մանածագործվածքներ՝ գլխարկների հիմնակմախքների համար",
                "5902" => "Կորդային գործվածքներ բեկակալների համար՝ բարձր ամրության նայլոնից կամ այլ պոլիամիդային, պոլիեթերային կամ վիսկոզային թելերից",
                "5903" => "Մանածագործական նյութեր` ներծծված, պատվածքով կամ պլաստմասսայով երկտակված՝ բացառությամբ 5902 ապրանքային դիրքում ընդգրկված նյութերի",
                "5904" => "Լինոլեում՝ ըստ ձեւի ձեւած կամ չձեւած. հատակի ծածկույթներ մանածագործվածքային հիմքով՝ ըստ ձեւի ձեւած կամ չձեւած",
                "5905 " => "Պատի ծածկույթներ՝ մանածագործվածքներից",
                "5906" => "Մանածագործվածքներ՝ ռետինացված, բացի 5902 ապրանքային դիրքում ընդգրկված գործվածքներից",
                "5907 " => "Մանածագործվածքներ, այլ եղանակով ներծծված կամ պատվածքով. նկարազարդ կտավներ, որոնք նախատեսված են որպես թատերական դեկորացիաներ, գեղարվեստական կամ նույնանման այլ ստուդիաների հետնաբեմի դեկորացիաներ",
                "5908 " => "Պատրույգներ մանածագործվածքային, գործված, հյուսված կամ տրիկոտաժից լամպերի, նավթավառների, վառիչների, մոմերի կամ նմանատիպ արտադրատեսակների համար. գլխադիրներ շիկացման լամպերի համար եւ խողովակաձեւ տրիկոտաժե քաթաններ գազայրիչների համար` ներծծված կամ չներծծված",
                "5909 " => "Փողրակներ մանածագործական եւ նմանատիպ մանածագործական ճկափողեր` տակդիրով, երեսպատվածքով կամ այլ նյութերից պատրաստված պարագաներով, կամ առանց դրանց",
                "5910 " => "Փոխակրիչային ժապավեններ կամ շարժափոկեր կամ բելթինգ (ռետինացված գործվածք փոկերի համար)` մանածագործվածքներից, ներծծված կամ չներծծված, պատվածքով կամ առանց պատվածքի, պլաստմասսաներով կամ ամրանավորված մետաղով կամ այլ նյութով երկտակված կամ չերկտակված",
                "5911" => "Մանածագործվածքներ եւ արտադրատեսակներ տեխնիկական նպատակների համար, որոնք նշված են տվյալ խմբի 7-րդ ծանոթագրության մեջ",
                "6001" => "Քաթաններ նրբախավով, տրիկոտաժե, մեքենայագործ եւ ձեռագործ՝ ներառյալ երկար նրբախավով քաթանները եւ խավածածկ քաթանները",
                "6002" => "Տրիկոտաժե քաթաններ՝ մեքենայագործ կամ ձեռագործ, 30 սմ-ից ոչ ավելի լայնությամբ, էլաստոմերային կամ ռետինե թելերի 5% զանգվածային բաժին կամ դրանից ավելի պարունակությամբ, բացի 6001 ապրանքային դիրքում ընդգրկված պաստառներից",
                "6003" => "Տրիկոտաժե քաթաններ՝ մեքենայագործ կամ ձեռագործ, 30 սմ-ից ոչ ավելի լայնությամբ, բացի 6001 կամ 6002 ապրանքային դիրքում ընդգրկված տրիկոտաժե քաթաններից",
                "6004" => "Տրիկոտաժե քաթաններ՝ մեքենայագործ կամ ձեռագործ, 30 սմ-ից ավելի լայնությամբ, էլաստոմերային կամ ռետինե թելերի 5% զանգվածային բաժին. կամ դրանից ավելի պարունակությամբ՝ բացի 6001 ապրանքային դիրքում ընդգրկված քաթաններից",
                "6005" => "Քաթաններ հիմնահյուսվածքով՝ (ներառյալ տրեզներ գործելու համար նախատեսված տրիկոտաժի արտադրության մեքենաներով հյուսվածները), բացի 6001-6004 ապրանքային դիրքերում ընդգրկված տրիկոտաժե քաթաններից",
                "6006" => "Այլ տրիկոտաժե քաթաններ` մեքենայագործ կամ ձեռագործ",
                "6101" => "Վերարկուներ, կիսավերարկուներ, թիկնոցներ, անջրանցիկ վերարկուներ, բաճկոններ, (այդ թվում՝ դահուկային),հողմապահպան, փոթորկապահպան բաճկոններ եւ տղամարդկանց կամ տղաների համար նախատեսված նմանատիպ տրիկոտաժե արտադրատեսակներ՝ մեքենայագործ կամ ձեռագործ, բացի 6103 ապրանքային դիրքում ընդգրկված արտադրատեսակներից",
                "6102" => "Վերարկուներ, կիսավերարկուներ, թիկնոցներ, անջրանցիկ վերարկուներ, բաճկոններ, (այդ թվում՝ դահուկային), հողմապահպան, փոթորկապահպան բաճկոններ եւ կանանց կամ աղջիկների համար նախատեսված նմանատիպ տրիկոտաժե արտադրատեսակներ՝ մեքենայագործ կամ ձեռագործ, բացի 6104 ապրանքային դիրքում ընդգրկված արտադրատեսակներից",
                "6103" => "Կոստյումներ, կոմպլեկտներ, պիջակներ, բլեյզերներ, տաբատներ, կոմբինեզոններ՝ կրծկալներով եւ ուսակապերով, բրիջիներ եւ կիսատաբատներ (բացի լողի համար նախատեսվածներից)՝ տրիկոտաժե, մեքենայագործ կամ ձեռագործ, տղամարդկանց կամ տղաների համար",
                "6104" => "Կոստյումներ, կոմպլեկտներ, ժակետներ, բլեյզերներ, շրջազգեստներ, կիսաշրջազգեստներ, կիսաշրջազգեստ-տաբատներ, տաբատներ, կոմբինեզոններ՝ կրծկալներով եւ ուսակապերով, բրիջիներ եւ կիսատաբատներ (բացի լողի համար նախատեսվածներից)՝ տրիկոտաժե, մեքենայագործ կամ ձեռագործ, կանանց կամ աղջիկների համար",
                "6105" => "Տրիկոտաժե վերնաշապիկներ՝ մեքենայագործ կամ ձեռագործ, տղամարդկանց կամ տղաների համար",
                "6106" => "Բլուզներ, շապիկներ եւ բլուզոններ՝ տրիկոտաժե, մեքենայագործ կամ ձեռագործ, կանանց կամ աղջիկների համար",
                "6107" => "Փոխաններ, կիսավարտիքներ, գիշերաշապիկներ, ննջազգեստներ, լողանալու խալաթներ, տնային խալաթներ եւ նմանատիպ արտադրատեսակներ տրիկոտաժից՝ մեքենայագործ կամ ձեռագործ, տղամարդկանց կամ տղաների համար",
                "6108" => "Կոմբինացիաներ, ներքնաշրջազգեստներ, կիսավարտիքներ, վարտիքներ, գիշերաշապիկներ, ննջազգեստներ, գիշերազգեստներ, լողանալու խալաթներ, տնային խալաթներ եւ նմանատիպ արտադրատեսակներ տրիկոտաժից՝ մեքենայագործ կամ ձեռագործ, կանանց կամ աղջիկների համար",
                "6109" => "Ներքնաշապիկներ, թեւքերով գործովի տաք շապիկներ (ֆուֆայկա) եւ այլ մեքենայագործ կամ ձեռագործ մերկ մարմնի վրա հագնվող գործովի տաք շապիկներ",
                "6110" => "Սվիտերներ, պուլովերներ, բրդե հյուսված ժակետներ, բաճկոնակներ եւ նմանատիպ մեքենայագործ կամ ձեռագործ արտադրատեսակներ՝ տրիկոտաժից",
                "6111" => "Մանկական հագուստ եւ մանկական հագուստի պարագաներ՝ տրիկոտաժից, մեքենայագործ կամ ձեռագործ",
                "6112" => "Կոստյումներ՝ սպորտային, դահուկային եւ լողի՝ տրիկոտաժից, մեքենայագործ կամ ձեռագործ",
                "6113 " => "5903, 5906 կամ 5907 ապրանքային դիրքերում ընդգրկված հագուստի պարագաներ՝ մեքենայագործ կամ ձեռագործ տրիկոտաժե քաթանից",
                "6114" => "Տրիկոտաժե հագուստի այլ պարագաներ՝ մեքենայագործ կամ ձեռագործ",
                "6115" => "Զուգագուլպաներ, գուլպաներ, կիսագուլպաներ, կարճ գուլպաներ, ոտնաթաթագուլպաներ եւ այլ գուլպեղեն՝ ներառյալ բաշխված ճնշումով սեղմումային գուլպեղենը (օրինակ՝ գուլպաներ երակների վարիկոզ լայնացում ունեցողների համար) եւ առանց ներբանի կոշիկներ՝ տրիկոտաժից, մեքենայագործ կամ ձեռագործ",
                "6116" => "Ձեռնոցներ, թաթմաններ եւ առանց մատների ձեռնոցներ՝ տրիկոտաժից, մեքենայագործ կամ ձեռագործ",
                "6117" => "Հագուստի այլ պատրաստի տրիկոտաժե մեքենայագործ կամ ձեռագործ պարագաներ. հագուստի առանձնամասեր կամ պարագաներ՝ տրիկոտաժե, մեքենայագործ կամ ձեռագործ",
                "6201" => "Վերարկուներ, կիսավերարկուներ, թիկնոցներ, անջրանցիկ վերարկուներ, բաճկոններ (այդ թվում դահուկային),հողմապահպան, փոթորկապահպան բաճկոններ եւ տղամարդկանց կամ տղաների համար նախատեսված նմանատիպ արտադրատեսակներ, բացի 6203 ապրանքային դիրքում ընդգրկված արտադրատեսակներից",
                "6202" => "Վերարկուներ, կիսավերարկուներ, թիկնոցներ, անջրանցիկ վերարկուներ, բաճկոններ (այդ թվում դահուկային), հողմապահպան, փոթորկապահպան բաճկոններ եւ կանանց կամ աղջիկների համար նախատեսված նմանատիպ արտադրատեսակներ, բացի 6204 ապրանքային դիրքում ընդգրկված արտադրատեսակներից",
                "6203" => "Կոստյումներ, կոմպլեկտներ, պիջակներ, բլեյզերներ, տաբատներ, կոմբինեզոններ` կրծկալներով եւ ուսակապերով, բրիջիներ եւ կիսատաբատներ (բացի լողի համար նախատեսվածներից)՝ տղամարդկանց կամ տղաների համար",
                "6204" => "Կոստյումներ, կոմպլեկտներ, ժակետներ, բլեյզերներ, շրջազգեստներ, կիսաշրջազգեստներ, կիսաշրջազգեստ-տաբատներ, տաբատներ, կոմբինեզոններ՝ կրծկալներով եւ ուսակապերով, բրիջիներ եւ կիսատաբատներ (բացի լողի համար նախատեսվածներից)՝ կանանց կամ աղջիկների համար",
                "6205" => "Վերնաշապիկներ՝ տղամարդկանց կամ տղաների համար",
                "6206" => "Բլուզներ, շապիկներ եւ բլուզոններ՝ կանանց կամ աղջիկների համար",
                "6207" => "Ներքնաշապիկներ եւ մերկ մարմնի վրա հագնովի գործովի տաք այլ շապիկներ, փոխաններ, կիսավարտիքներ, գիշերաշապիկներ, ննջազգեստներ, լողանալու խալաթներ, տնային խալաթներ եւ նմանատիպ արտադրատեսակներ տղամարդկանց կամ տղաների համար",
                "6208" => "Ներքնաշապիկներ եւ մերկ մարմնի վրա հագնովի գործովի տաք այլ շապիկներ, ներքնազգեստներ, ներքնաշրջազգեստներ, կիսավարտիքներ, վարտիքներ, գիշերաշապիկներ, ննջազգեստներ, գիշերազգեստներ, լողանալու խալաթներ, տնային խալաթներ եւ նմանատիպ արտադրատեսակներ կանանց կամ աղջիկների համար",
                "6209" => "Մանկական հագուստ եւ մանկական հագուստի պարագաներ",
                "6210" => "Հագուստի պարագաներ՝ պատրաստված 5602, 5603, 5903, 5906 կամ 5907 ապրանքային դիրքերում ընդգրկված նյութերից",
                "6211" => "Կոստյումներ՝ մարզական, դահուկային եւ լողի՝ հագուստի այլ պարագաներ",
                "6212" => "Կրծկալներ, գոտիներ, սեղմիրաններ, տաբատակալներ, կապիչներ եւ նմանատիպ արտադրատեսակներ ու դրանց մասերը՝ տրիկոտաժե, մեքենայագործ կամ ձեռագործ կամ ոչ տրիկոտաժե",
                "6213" => "Թաշկինակներ",
                "6214" => "Շալեր, շարֆեր, կաշնե, գլխաշորեր, քողեր եւ նմանատիպ արտադրատեսակներ",
                "6215" => "Փողկապներ, թիթեռնիկ-փողկապներ եւ վզկապներ",
                "6216 " => "Ձեռնոցներ, թաթմաններ եւ առանց մատների ձեռնոցներ",
                "6217" => "Հագուստի այլ պատրաստի պարագաներ. հագուստի առանձնամասեր կամ պարագաներ, բացի 6212 ապրանքային դիրքում ընդգրկված պարագաներից",
                "6301" => "Ծածկոցներ եւ ճանապարհորդական ծածկոցաշալեր",
                "6302" => "Սպիտակեղեն՝ անկողնու, ճաշասենյակի, զուգարանի եւ խոհանոցի",
                "6303" => "Վարագույրներ՝ (ներառյալ դռան վարագույրները) եւ ներսի գալարավարագույրները. լամբրեկեններ կամ եզրազարդեր մահճակալների համար",
                "6304" => "Այլ դեկորատիվ արտադրատեսակներ, բացի 9404 ապրանքային դիրքում ընդգրկված արտադրատեսակներից",
                "6305" => "Պարկեր եւ տոպրակներ՝ փաթեթավորման համար",
                "6306" => "Բրեզենտներ, շվաքարաններ, վրանանման ծածկեր, վրաններ. առագաստներ նավակների համար, վինդսերֆինգի տախտակների կամ ցամաքային տրանսպորտային միջոցների համար. ավտոտուրիստների ճամբարի համար նախատեսված պիտույքներ",
                "6307" => "Այլ պատրաստի արտադրատեսակներ՝ ներառյալ հագուստի ձեւվածքները",
                "6308 " => "Լրակազմեր՝ բաղկացած գործվածքից եւ մանվածքից կամ թելերից՝ պարագաներով կամ առանց պարագաների, գորգերի, որմնագորգերի, ասեղնագործ սփռոցների կամ անձեռոցիկների կամ նույնանման մանածագործական արտադրատեսակների պատրաստման համար՝ մանրածախ վաճառքի համար փաթեթավորված",
                "6309 " => "Օգտագործված հագուստ եւ այլ արտադրատեսակներ",
                "6310" => "Լաթեր՝ օգտագործված կամ նոր, թոկերի, պարանների, ճոպանների ու մետաղաճոպանների կտորներ եւ թոկերից, պարաններից, ճոպաններից կամ մետաղաճոպաններից պատրաստված արտադրատեսակներ՝ մանածագործական նյութերից, օգտագործված",
                "6401" => "Ռետինից կամ պլաստմասսայից կոշկերեսով եւ կոշկատակով անջրանցիկ կոշիկներ, որոնց կոշկերեսը չի ամրացվում կոշկատակին եւ չի միացվում նրա հետ ոչ թելով, ոչ վարսոցով, ոչ մեխով, ոչ պտուտակային, ոչ դուրգամելու, ոչ որեւէ այլ նույնանման եղանակով",
                "6402" => "Կոշկերեսը եւ կոշկատակը ռետինից կամ պլաստմասսայից այլ կոշկեղեն",
                "6403" => "Կոշիկ՝ ռետինից, պլաստմասսայից, բնական կամ կոմպոզիցիոն կաշվից կոշկատակով եւ բնական կաշվից կոշկերեսով",
                "6404" => "Կոշիկ՝ ռետինից, պլաստմասսայից, բնական կամ կոմպոզիցիոն կաշվից կոշկատակով եւ բնական կաշվից կոշկերեսով",
                "6405" => "Այլ կոշկեղեն",
                "6406" => "Կոշիկի մասեր (ներառյալ ամրացված կամ չամրացված հիմնական միջատակով կոշկերեսի ձեւվածքները), դնովի միջատակեր, կրնկատակեր եւ նույնանման արտադրատեսակներ. զանկապաններ, սռնապաններ ու նույնանման արտադրատեսակներ, եւ դրանց մասերը",
                "6501 " => "Գլխարկների կաղապարներ, գլխարկների եւ թասակներ՝ նրբաթաղիքից՝ չկաղապարված, առանց եզրերի. հարթ եւ գլանաձեւ ձեւվածքներ (ներառյալ երկայնակի կտրվածքով)՝ նրբաթաղիքից",
                "6502 " => "Գլխարկների կիսապատրաստվածքներ՝ ցանկացած նյութից շերտեր միացնելու միջոցով հյուսված կամ պատրաստված, չկաղապարված, առանց եզրերի, առանց աստառի եւ առանց վերջնամշակման",
                "6504 " => "Գլխարկներ եւ գլխի այլ հարդարանքներ` ցանկացած նյութից շերտեր միացնելու միջոցով հյուսված կամ պատրաստված, աստառով կամ առանց աստառի, վերջնամշակված կամ առանց վերջնամշակման",
                "6505 " => "Գլխարկներ եւ գլխի այլ հարդարանքներ` տրիկոտաժից, մեքենայով կամ ձեռքով հյուսված, կամ ժանյակի, նրբաթաղիքի կամ այլ մանածագործական նյութերից ամբողջական կտորներից (բայց ոչ շերտերից) պատրաստված, աստառով կամ առանց աստառի, վերջնամշակված կամ առանց վերջնամշակման. ցանցեր՝ մազերի համար՝ ցանկացած նյութից, աստառով կամ առանց աստառի, վերջնամշակված կամ առանց վերջնամշակման",
                "6506" => "Գլխի այլ հարդարանքներ՝ աստառով կամ առանց աստառի, վերջնամշակված կամ առանց վերջնամշակման",
                "6507 " => "Ժապավեններ, աստառներ, պատյաններ, հիմքեր, հենքեր, հովարներ եւ կապեր՝ գլխի հարդարանքների համար",
                "6601" => "Հովանոցներ եւ արեւապաշտպան հովանոցներ (ներառյալ հովանոց–ձեռնափայտերը, պարտեզի հովանոցները եւ նույնանման հովանոցները)",
                "6602 " => "Ձեռնափայտեր, ձեռնափայտ–նստոցներ, ճիպոտներ, մտրակներ ձիավարության համար եւ նույնանման արտադրատեսակներ",
                "6603" => "Մասեր, հարդարման դետալներ եւ պարագաներ՝ 6601 կամ 6602 ապրանքային դիրքի արտադրատեսակների համար",
                "6701 " => "Թռչունների մորթիկներ եւ այլ մասեր՝ փետուրներով կամ աղվափետուրով, փետուրներ, փետուրների մասեր, աղվափետուր եւ այդ նյութերից պատրաստված արտադրատեսակներ (բացի 0505 ապրանքային դիրքի արտադրատեսակներից եւ փետուրների մշակված բներից ու կոթուններից)",
                "6702" => "Ծաղիկներ, տերեւներ եւ պտուղներ՝ արհեստական, եւ դրանց մասերը. արտադրատեսակներ՝ արհեստական ծաղիկներից, տերեւներից կամ պտուղներից.",
                "6703 " => "Մարդու մազեր` սանրած, նոսրացրած, գունազրկած կամ այլ եղանակով մշակած. բուրդ կամ կենդանիների այլ մազ կամ այլ մանածագործական նյութեր` կեղծամներ կամ նույնանման արտադրատեսակներ արտադրելու համար նախապատրաստված",
                "6704" => "Կեղծամներ, մորուքներ՝ դնովի, հոնքեր եւ թարթիչներ, դնովի մազեր եւ նույնանման արտադրատեսակներ՝ մարդու կամ կենդանու մազից կամ մանածագործական նյութերից. արտադրատեսակներ՝ մարդու մազից` այլ տեղում չնշված կամ չներառված",
                "6801 " => "Չորսվակասալ, եզրաքարեր եւ սալիկներ սալարկման համար՝ բնական քարից (բացի թերթաքարից)",
                "6802" => "Մշակված քար (բացի թերթաքարից) հուշարձանների կամ շինարարության համար եւ դրանից պատրաստված արտադրատեսակներ, բացի 6801 ապրանքային դիրքում ընդգրկված ապրանքներից. խորանարդիկներ խճանկարի համար եւ նույնանման արտադրատեսակներ բնական քարից (ներառյալ թերթաքարը)՝ հիմքով կամ առանց հիմքի, արհեստական ներկած գրանուլներ, փշրանք եւ փոշի բնական քարից (ներառյալ թերթաքարը)",
                "6803 " => "Մշակված թերթաքար եւ թերթաքարից կամ շեղջաքարացված (ագլոմերացված) թերթաքարից արտադրատեսակներ",
                "6804" => "Ջրաղացաքարեր, սրաքարեր, հղկելու շրջաններ եւ նույնանման արտադրատեսակներ՝ առանց հենարանային կառուցվածքների՝ նախատեսված հղկելու, սրելու, ողորկելու, հարմարեցնելու կամ կտրելու համար, քարեր՝ ձեռքով սրելու կամ ողորկելու համար եւ դրանց մասերը՝ բնական քարից, բնական կամ արհեստական շեղջաքարացված (ագլոմերացված) հղկանյութերից կամ կերամիկայից՝ հավաքած այլ նյութերից պատրաստված դետալների հետ կամ առանց այդ դետալների",
                "6805" => "Բնական կամ արհեստական հղկափոշի կամ հատիկ՝ գործվածքի, թղթի, ստվարաթղթի կամ այլ հիմքով, կտրատած կամ կարված կամ որոշակի ձեւ ստանալու համար այլ եղանակով մշակած կամ չմշակած",
                "6806" => "Խարամաբամբակ, սիլիկատային հանքաբամբակ եւ նույնանման հանքաբամբակներ, շերտավորված վերմիկուլիտ, փքված կավեր, փրփրած մետաղախարամ եւ նույնանման փքված հանքային նյութեր, ջերմամեկուսիչ, ձայնամեկուսիչ կամ ձայնակլանիչ հանքանյութերի խառնուրդներ եւ դրանցից պատրաստված արտադրատեսակներ՝ բացի 6811 կամ 6812 ապրանքային դիրքերում կամ 69-րդ խմբում ընդգրկված արտադրատեսակներից։",
                "6807" => "Արտադրատեսակներ ասֆալտից կամ նույնանման նյութերից (օրինակ՝ նավթային բիտումից կամ քարածխային կուպրից)",
                "6808 " => "Պանելներ, սալեր, սալիկներ, բլոկներ եւ բուսական թելերից, ծղոտից կամ տաշեղներից, մանրատաշեղից, մասնիկներից, փայտաթեփից կամ փայտանյութի այլ թափոններից պատրաստված նույնանման արտադրատեսակներ՝ ցեմենտով, գիպսով կամ այլ հանքային կապակցող նյութերով շեղջաքարացված (ագլոմերացված)",
                "6809" => "Արտադրատեսակներ գիպսից կամ դրա հիմքով խառնուրդներից",
                "6810" => "Ցեմենտից, բետոնից կամ արհեստական քարից արտադրատեսակներ՝ չամրանավորած կամ ամրանավորած",
                "6811" => "Արտադրատեսակներ ասբոցեմենտից, թաղանթանյութի մանրաթելերով ցեմենտից կամ նույնանման նյութերից",
                "6812" => "Ասբեստային մշակված մանրաթել. ասբեստի կամ ասբեստի ու մագնեզիումի կարբոնատի (մագնեզիտ) հիմքով խառնուրդներ. այդ խառնուրդներից կամ ասբեստից արտադրատեսակներ (օրինակ՝ թելեր, գործվածքներ, հագուստ, գլխի հարդարանքներ, կոշկեղեն, միջադիրներ)՝ ամրանավորած կամ չամրանավորած, բացի 6811 կամ 6813 ապրանքային դիրքերում ընդգրկված ապրանքներից",
                "6813" => "Շփական նյութեր եւ դրանցից պատրաստված արտադրատեսակներ (օրինակ՝ թերթեր, գլանափաթեթներ, ժապավեններ, հատվածամասեր, սկավառակներ, տափօղակներ, միջադիրներ)՝ չմոնտաժված. օգտագործվում են արգելակների, կցորդիչների կամ նույնանման սարքվածքների համար, ասբեստի, այլ հանքային նյութերի կամ թաղանթանյութի հիմքով՝ գործվածքների կամ այլ նյութերի հետ միասին կամ առանց դրանց",
                "6814" => "Մշակված փայլար եւ դրանից պատրաստված արտադրատեսակներ՝ ներառյալ շեղջաքարացված (ագլոմերացված) կամ վերականգնված փայլարը՝ թղթի, ստվարաթղթի կամ այլ հիմքով կամ առանց դրա",
                "6815" => "Արտադրատեսակներ քարից կամ այլ հանքային նյութերից (ներառյալ ածխածնային մանրաթելերը, ածխածնային մանրաթելերից եւ տորֆից պատրաստված արտադրատեսակները), այլ տեղում չնշված կամ չներառված",
                "6901 " => "Աղյուսներ, բլոկեր, սալիկներ եւ կերամիկական այլ արտադրատեսակներ սիլիկահողային քարային փոշուց (օրինակ՝ կիզելգուրից, տրիպոլիտից կամ դիատոմիտից) կամ սիլիկահողային նույնանման հանքային ապարներից",
                "6902" => "Հրակայուն աղյուսներ, բլոկեր, սալիկներ եւ նույնանման հրակայուն կերամիկական շինարարական նյութեր, բացի սիլիկահողային քարային փոշուց կամ սիլիկահողային նույնանման հանքային ապարներից պատրաստված արտադրատեսակներից",
                "6903" => "Այլ հրակայուն կերամիկական արտադրատեսակներ (օրինակ՝ թորանոթներ, հալքանոթներ, թրծատուփեր, գլխադիրներ, փականներ, հենարաններ, փորձանոթներ, խողովակներ, փողակներ, ճաղեր, ճիպոտներ, ձողեր), բացի սիլիկահողային քարային փոշուց կամ նույնանման սիլիկահողային հանքային ապարներից պատրաստված արտադրատեսակներից",
                "6904" => "Աղյուսներ շինարարական, բլոկեր՝ հատակի համար, կերամիկական կրող կամ հեծանային կոնստրուկցիաների լցման համար քարեր եւ նույնանման արտադրատեսակներ կերամիկայից",
                "6905" => "Կղմինդր, դեֆլեկտորներ, ծխատար խողովակների շվաքարաններ, ծխնելույզների առանձնամասեր, ճարտարապետական զարդարանքներ եւ շինարարական այլ դետալներ կերամիկայից",
                "6906 " => "Կերամիկական խողովակներ, մեկուսիչ խողովակաշարեր, ջրահեռացման խողովակներ եւ խողովակների կցամասեր",
                "6907" => "Սալարկման քարեր, երեսապատման սալիկներ` հատակների, վառարանների, բուխարիների կամ պատերի համար, կերամիկական չջնարակված. կերամիկական խորանարդիկներ չջնարակված՝ խճանկարային աշխատանքների համար եւ նույնանման արտադրատեսակներ՝ հիմքով կամ առանց հիմքի",
                "6908" => "Սալարկման քարեր, երեսապատման սալիկներ` հատակների, վառարանների, բուխարիների կամ պատերի համար, կերամիկական չջնարակված. կերամիկական խորանարդիկներ չջնարակված՝ խճանկարային աշխատանքների համար եւ նույնանման արտադրատեսակներ՝ հիմքով կամ առանց հիմքի",
                "6909" => "Կերամիկական արտադրատեսակներ՝ լաբորատոր, քիմիական կամ տեխնիկական այլ նպատակների համար. կերամիկական փողրակներ, տաքարներ (գուռեր) եւ այլ ռեզերվուարներ՝ գյուղատնտեսության մեջ օգտագործվող. կերամիկական թաղարներ, անոթներ եւ ապրանքների տրանսպորտային փոխադրման կամ փաթեթավորման համար օգտագործվող նույնանման արտադրատեսակներ",
                "6910" => "Լվացարանակոնքեր, լվացարաններ, լվացարանակոնքերի բարձակներ, լոգարաններ, բիդեներ, զուգարանակոնքեր, ջրթափ փոքրիկ բաքեր, միզարաններ եւ նույնանման սանիտարատեխնիկական արտադրատեսակներ կերամիկայից",
                "6911" => "Ճաշի, խոհանոցային սպասք եւ տնտեսական ու արդուզարդի համար նախատեսված այլ արտադրատեսակներ ճենապակուց",
                "6912 " => "Ճաշի, խոհանոցային սպասք եւ տնտեսական ու արդուզարդի համար նախատեսված այլ արտադրատեսակներ կերամիկայից՝ բացի ճենապակուց",
                "6913" => "Արձանիկներ եւ դեկորատիվ այլ արտադրատեսակներ` կերամիկայից",
                "6914" => "Կերամիկական այլ արտադրատեսակներ",
                "7001 " => "Ապակու ջարդվածք, ապակու կտորտանք եւ այլ մնացորդներ. ապակի բլոկերով",
                "7002" => "Ապակի գնդերի (բացի 7018 ապրանքային դիրքում ընդգրկված այլ մանրագնդերից), ձողերի կամ խողովակների ձեւով՝ չմշակված",
                "7003" => "Ապակի՝ ձուլած եւ գլանված, թերթերով կամ պրոֆիլավորած, կլանող, անդրադարձնող կամ չանդրադարձնող շերտ ունեցող կամ չունեցող, բայց չմշակած որեւէ այլ եղանակով",
                "7004" => "Ապակի՝ ձգովի կամ փչովի, թերթերով, կլանող, անդրադարձնող կամ չանդրադարձնող շերտով կամ առանց դրա, բայց չմշակված որեւէ այլ եղանակով",
                "7005" => "Ջերմաողորկված ապակի եւ հղկված կամ ողորկված մակերեսով, թերթերով, կլանող, անդրադարձնող կամ չանդրադարձնող շերտ ունեցող կամ չունեցող, բայց այլ եղանակով չմշակված ապակի",
                "7006 " => "7003, 7004 կամ 7005 ապրանքային դիրքերում ընդգրկված ապակի՝ ճկած, երեսակված, փորագրած, գայլիկոնված, արծնապատած կամ մշակած այլ եղանակով, բայց շրջանակի մեջ չդրած կամ չզուգակցած այլ նյութերի հետ",
                "7007" => "Ապակի՝ անվտանգ, ներառյալ ամրացված (թրծված) կամ բազմաշերտ ապակի",
                "7008 " => "Ապակյա բազմաշերտ մեկուսիչ արտադրատեսակներ",
                "7009" => "Ապակե հայելիներ՝ շրջանակների մեջ կամ առանց շրջանակների՝ հետին տեսանելիության հայելիները ներառյալ",
                "7010" => "Շշեր, շշիկներ, սրվակներ, սափորներ, թաղարներ, բանկաներ, սրվակիկներ եւ ապակե այլ տարողություններ՝ ապրանքների պահման, տրանսպորտային փոխադրման կամ փաթեթավորման համար. պահածոյացման համար ապակե բանկաներ. ապակե պահպանական կափույրներ, կափույրներ, կափարիչներ եւ ապակե նույնանման այլ արտադրատեսակներ",
                "7011" => "Ապակյա գլանանոթներ (ներառյալ փորձանոթները եւ փողակները), բաց, դրանց ապակյա մասերը, առանց կցամասերի` էլեկտրական լամպերի, էլեկտրոնաճառագայթային փողակների եւ նույնանման արտադրատեսակների համար",
                "7013" => "Ճաշի եւ խոհանոցային ապակե սպասք, արդուզարդի եւ գրասենյակային պարագաներ, արտադրատեսակներ՝ բնակարանի հարդարման կամ նույնանման նպատակների համար (բացի 7010 կամ 7018 ապրանքային դիրքում ընդգրկված արտադրատեսակներից)",
                "7014 " => "Ապակյա արտադրատեսակներ՝ ազդանշանային սարքվածքների համար եւ ապակուց օպտիկական տարրեր (բացի 7015 ապրանքային դիրքում ընդգրկվածներից), առանց օպտիկական մշակման",
                "7015" => "Ապակիներ ժամացույցների համար եւ նույնանման ապակիներ՝ տեսողությունը կանոնավորող կամ չկանոնավորող ակնոցների համար, կորացրած, գոգավոր՝ խորությամբ, կամ նմանատիպ ապակիներ, օպտիկորեն չմշակված. ապակյա սնամեջ գնդեր եւ դրանց մասերը՝ նշված ապակիները պատրաստելու համար",
                "7016" => "Բլոկեր սալարկման համար, սալեր, աղյուսներ, սալիկներ եւ այլ արտադրատեսակներ՝ մամլած կամ ձուլածո ապակուց, ամրանավորված կամ չամրանավորված, շինարարության մեջ օգտագործվող. հիմքով կամ առանց հիմքի ապակյա խորանարդիկներ եւ այլ ոչ մեծ ապակյա ձեւեր՝ խճանկարի կամ նույնանման դեկորատիվ աշխատանքների համար. ապակենկարներ եւ նույնանման արտադրատեսակներ. բջջավոր կամ փրփրապակի՝ բլոկերի, պանելների, սալերի ձեւով, թաղանթների կամ այլ ձեւերի տեսքով",
                "7017" => "Ապակյա սպասք` լաբորատորային, հիգիենիկ կամ դեղագործական նպատակների համար, աստիճանանշումով կամ առանց աստիճանանշման, տրամաչափված կամ չտրամաչափված",
                "7018" => "Ապակյա հուլունքներ, մարգարտին նմանեցվող արտադրատեսակներ, թանկարժեք կամ կիսաթանկարժեք քարեր ու նույնանման ոչ մեծ ձեւեր ապակուց, դրանցից պատրաստված արտադրատեսակներ, բացի բիժուտերիայից. ապակյա աչքեր՝ բացի պրոթեզներից. արձանիկներ եւ դեկորատիվ այլ առարկաներ ապակուց՝ մշակված զոդալամպով, բացի բիժուտերիայից. միկրոգնդիկներ ապակուց 1 մմ-ից ոչ ավելի տրամագծով",
                "7019" => "Ապակե մանրաթել (ներառյալ ապակե բամբակը) եւ դրանից պատրաստված արտադրատեսակներ (օրինակ՝ մանվածք, գործվածքներ)",
                "7020 " => "Ապակուց ստացված այլ արտադրատեսակներ",
                "7101" => "Մարգարիտ՝ բնական կամ աճեցրած, մշակված կամ չմշակված, տեսակավորված կամ չտեսակավորված, բայց չշարված, չշրջանակված կամ չամրացրած, բնական կամ աճեցրած մարգարիտ` փոխադրման համար հարմարավետության նպատակով ժամանակավոր շարված",
                "7102" => "Ալմաստներ՝ մշակված կամ չմշակված, բայց չշրջանակված կամ չամրացրած",
                "7103" => "Թանկարժեք (բացի ալմաստներից) եւ կիսաթանկարժեք քարեր՝ մշակված կամ չմշակված, տեսակավորված կամ չտեսակավորված, բայց չշարված, չշրջանակած կամ չամրացված. չտեսակավորված թանկարժեք քարեր (բացի ալմաստներից) եւ կիսաթանկարժեք քարեր՝ փոխադրման հարմարավետության նպատակով ժամանակավոր շարված",
                "7104" => "Թանկարժեք կամ կիսաթանկարժեք քարեր՝ արհեստական կամ վերականգնված, մշակված կամ չմշակված, տեսակավորված կամ չտեսակավորված, բայց չշարված, չշրջանակած կամ չամրացված. չտեսակավորված արհեստական կամ վերականգնված թանկարժեք կամ կիսաթանկարժեք քարեր՝ փոխադրման համար հարմարավետության նպատակով ժամանակավոր շարված",
                "7105" => "Փշրանք եւ փոշի՝ բնական կամ արհեստական թանկարժեք կամ կիսաթանկարժեք քարերից",
                "7106" => "Արծաթ (ներառյալ ոսկուց կամ պլատինից գալվանական ծածկույթով)՝ չմշակված կամ կիսամշակված կամ փոշու տեսքով",
                "7107 " => "Մետաղներ՝ ոչ թանկարժեք, արծաթով երեսապատված, կիսամշակված, առանց հետագա մշակման",
                "7108" => "Ոսկի (ներառյալ ոսկի՝ պլատինից գալվանական ծածկույթով)` չմշակված կամ կիսամշակված կամ փոշու տեսքով",
                "7109 " => "Մետաղներ՝ ոչ թանկարժեք կամ արծաթ՝ երեսապատված ոսկով, չմշակված կամ կիսամշակված",
                "7110" => "Պլատին՝ չմշակված կամ կիսամշակված կամ փոշու տեսքով",
                "7111 " => "Մետաղներ՝ ոչ թանկարժեք, արծաթ կամ ոսկի՝ երեսապատված պլատինով, չմշակված կամ կիսամշակված",
                "7112" => "Թանկարժեք մետաղների կամ թանկարժեք մետաղներով երեսապատված մետաղների թափոններ եւ ջարդոն. թանկարժեք մետաղ կամ թանկարժեք մետաղների միացություններ պարունակող այլ թափոններ եւ ջարդոն, որոնք, հատկապես, կիրառվում են թանկարժեք մետաղներ ստանալու համար",
                "7113" => "Ոսկերչական արտադրատեսակներ եւ դրանց մասերը՝ պատրաստված թանկարժեք մետաղներից կամ թանկարժեք մետաղներով երեսապատված մետաղներից",
                "7114" => "Վարպետների ձեռքով պատրաստած ոսկյա եւ արծաթյա արտադրատեսակներ եւ դրանց մասերը՝ պատրաստված թանկարժեք մետաղներից կամ թանկարժեք մետաղներով երեսապատված մետաղներից",
                "7115" => "Այլ արտադրատեսակներ թանկարժեք մետաղներից կամ թանկարժեք մետաղներով երեսապատված մետաղներից",
                "7116" => "Արտադրատեսակներ բնական կամ աճեցրած մարգարիտից, թանկարժեք կամ կիսաթանկարժեք քարերից (բնական, արհեստական կամ վերականգնված)",
                "7117" => "Բիժուտերիա",
                "7118" => "Մետաղադրամներ",
                "7201" => "Թուջ՝ վերամշակելի եւ հայելային՝ ձուլակոճղերով, մետաղակոճղերով կամ այլ առաջնային ձեւերով",
                "7202" => "Ֆեռոհամաձուլվածքներ",
                "7203" => "Երկաթի հանքաքարի անմիջական վերականգնման արգասիքներ եւ սպունգանման այլ երկաթ` կտորներով, բովագնդիկներով եւ նույնանման ձեւերով. երկաթ՝ 99,94% զանգվածային բաժին հիմնական տարրի նվազագույն պարունակությամբ, կտորներով, բովագնդիկներով կամ նույնանման ձեւերով",
                "7204" => "Սեւ մետաղների թափոններ եւ ջարդոն. վերաձուլման համար սեւ մետաղների ձուլակտորներ (բովախառնուրդի ձուլակտորներ)",
                "7205" => "Հատիկներ (գրանուլներ) եւ փոշի վերամշակելի եւ հայելանման թուջից, սեւ մետաղներից",
                "7206" => "Երկաթ եւ չլեգիրված պողպատ՝ ձուլակտորներով կամ այլ սկզբնական ձեւերով (բացի 7203 ապրանքային դիրքի երկաթից)",
                "7207" => "Կիսապատրաստուկներ երկաթից կամ չլեգիրված պողպատից",
                "7208" => "Երկաթից կամ չլեգիրված պողպատից հարթ գլանվածք՝ 600 մմ կամ ավելի լայնությամբ, շիկագլոցված, չերեսապատված, առանց գալվանական կամ այլ ծածկույթի",
                "7209" => "Երկաթից կամ չլեգիրված պողպատից հարթ գլանվածք՝ 600 մմ կամ ավելի լայնությամբ, սառնագլոցված (սառը վիճակում շրջասեղմված), չերեսապատված, առանց գալվանական կամ այլ ծածկույթի.",
                "7210" => "Երկաթից կամ չլեգիրված պողպատից հարթ գլանվածք՝ 600 մմ կամ ավելի լայնությամբ, երեսապատված, գալվանական կամ այլ ծածկույթով",
                "7211" => "Հարթ գլանվածք՝ երկաթից կամ չլեգիրված պողպատից՝ լայնությամբ 600 մմ-ից պակաս, չերեսապատված, առանց գալվանական կամ այլ պատվածքի",
                "7212" => "Հարթ գլանվածք երկաթից կամ չլեգիրված պողպատից՝ 600 մմ-ից պակաս լայնությամբ, երեսապատված գալվանական կամ այլ պատվածքով",
                "7213" => "Շիկագլոցված ձողեր՝ ազատ փաթաթվածքի փաթույթներով, երկաթից կամ չլեգիրված պողպատից",
                "7214" => "Ձողեր` երկաթից կամ չլեգիրված պողպատից, առանց հետագա մշակման, կռումից, տաք գլոցումից, տաք կորզանումից կամ տաք արտամղումից բացի՝ ներառյալ գլանումից հետո ոլորված ձողերը, այլ",
                "7215" => "Այլ ձողեր երկաթից կամ չլեգիրված պողպատից",
                "7216" => "Անկյունակներ, ձեւավոր եւ հատուկ պրոֆիլներ` երկաթից կամ չլեգիրված պողպատից",
                "7217" => "Մետաղալար երկաթից կամ չլեգիրված պողպատից",
                "7218" => "Պողպատ կոռոզիակայուն ձուլակտորներով կամ այլ սկզբնական ձեւերով. կիսապատրաստուկներ կոռոզիակայուն պողպատից",
                "7219" => "Կոռոզիակայուն պողպատից հարթ գլանվածք` 600 մմ կամ ավելի լայնությամբ",
                "7220" => "Կոռոզիակայուն պողպատից հարթ գլանվածք՝ 600 մմ–ից պակաս լայնությամբ",
                "7221 " => "Շիկագլոցված ձողեր՝ ազատ փաթաթվածքի փաթույթներով, կոռոզիակայուն պողպատից",
                "7222" => "Այլ կոռոզիակայուն պողպատից ձողեր. անկյունակներ, ձեւավոր եւ հատուկ պրոֆիլներ՝ այլ կոռոզիակայուն պողպատից",
                "7223 " => "Մետաղալար կոռոզիակայուն պողպատից",
                "7224" => "Այլ պողպատ՝ լեգիրված ձուլակտորներով կամ այլ սկզբնական ձեւերով. կիսապատրաստուկներ այլ լեգիրված պողպատից",
                "7225" => "Այլ լեգիրված պողպատից հարթ գլանվածք՝ 600 մմ կամ ավելի լայնությամբ",
                "7226" => "Այլ լեգիրված պողպատից հարթ գլանվածք՝ 600 մմ–ից պակաս լայնությամբ",
                "7227" => "Շիկագլոցված ձողեր՝ ազատ փաթաթվածքի փաթույթներով, այլ լեգիրված պողպատից",
                "7228" => "Այլ լեգիրված պողպատից ձողեր. անկյունակներ, ձեւավոր եւ հատուկ պրոֆիլներ՝ այլ լեգիրված պողպատից. լեգիրված կամ չլեգիրված պողպատից սնամեջ ձողեր՝ հորատման աշխատանքների համար",
                "7229" => "Մետաղալար այլ լեգիրված պողպատից",
                "7301" => "Ագուցավոր կառուցվածքներ սեւ մետաղներից` գայլիկոնած կամ չգայլիկոնած, ծակոտած կամ չծակոտած, միաձույլ կամ պատրաստված հավաքովի տարրերից. անկյունակներ, ձեւավոր եւ հատուկ պրոֆիլներ եռակցված սեւ մետաղներից",
                "7302" => "Արտադրատեսակներ սեւ մետաղներից, որոնք օգտագործվում են երկաթուղային եւ տրամվայի գծերի համար. ռելսեր, զուգառելսեր եւ ատամնավոր ռելսեր, ուղեփոխման ռելսեր, խուլ փոխհատման ուղեփոխիչներ, ուղեփոխման մետաղաձողեր եւ այլ լայնական միացումներ, փայտակոճեր, կցվանքային մակադրակներ եւ տակդիրներ, սեպեր, հենասալեր, ռելսային կեռավոր հեղույսներ, բարձեր եւ առձգիչներ, հենոցներ, լայնադրակներ եւ այլ դետալներ՝ նախատեսված ռելսերի միացման կամ ամրացման համար",
                "7303 " => "Խողովակներ, փողակներ եւ սնամեջ տրամատներ (պրոֆիլներ)՝ թուջե ձուլվածքից",
                "7304" => "Խողովակներ, փողակներ եւ սնամեջ տրամատներ (պրոֆիլներ)՝ առանց կարի, սեւ մետաղներից (թուջե ձուլվածքից բացի)",
                "7305" => "Այլ խողովակներ եւ փողակներ՝ (օրինակ` եռակցման, գամած կամ նույնանման եղանակով միացրած) կլոր հատմամբ, որոնց արտաքին տրամագիծը 406,4 մմ–ից ավելի է, սեւ մետաղներից",
                "7306" => "Այլ խողովակներ, փողակներ եւ սնամեջ տրամատներ (պրոֆիլներ) (օրինակ` բաց կարով կամ եռակցման, գամած կամ նույնանման եղանակով միացրած)՝ սեւ մետաղներից",
                "7307" => "Կցամասեր՝ խողովակների կամ փողակների համար (օրինակ` միացքներ, ծունկեր, խողովակակցիչներ), սեւ մետաղներից",
                "7308" => "Մետաղակոնստրուկցիաներ սեւ մետաղներից (բացի 9406 ապրանքային դիրքի հավաքովի շինարարական կոնստրուկցիաներից) եւ դրանց մասերը (օրինակ՝ կամուրջներ եւ դրանց սեկցիաները, ջրարգելակների դարպասներ, աշտարակներ, վանդակավոր կայմեր, ծածկեր տանիքների համար, շինարարական ֆերմաներ, դռներ եւ պատուհաններ ու դրանց շրջանակները, դռան շեմքեր, շերտափեղկեր, ճաղաշարքեր, հենարաններ եւ դրանց հենասյուները), մետաղակոնստրուկցիաների մեջ օգտագործման համար նախատեսված թիթեղաթերթեր, ձողեր, ձեւավոր տրամատներ (պրոֆիլներ), խողովակներ եւ նույնանման արտադրատեսակներ սեւ մետաղներից",
                "7309 " => "Ամբարներ, ցիստեռններ, բաքեր եւ նույնանման տարողություններ սեւ մետաղներից, ամեն տեսակի նյութերի համար (բացի սեղմված կամ հեղուկացված գազից) 300 լ–ից ավելի տարողությամբ, երեսապատումով կամ ջերմամեկուսացումով կամ առանց դրանց, բայց առանց մեխանիկական կամ ջերմատեխնիկական սարքավորումների",
                "7310" => "Ցիստեռններ, տակառներ, թմբուկներ, կանիստրներ, արկղեր եւ նույնանման տարողություններ սեւ մետաղներից, ցանկացած նյութի համար (բացի սեղմված կամ հեղուկացված գազից) 300 լիտրից ոչ ավելի տարողությամբ, երեսապատումով կամ ջերմամեկուսացումով կամ առանց դրանց, սակայն առանց մեխանիկական կամ ջերմատեխնիկական սարքավորումների",
                "7311 " => "Տարողություններ սեղմված կամ հեղուկացված գազի համար՝ սեւ մետաղներից",
                "7312" => "Ոլորված մետաղալար, մետաղաճոպաններ, մետաղապարաններ, հյուսված քուղեր, առասաններ եւ նույնանման արտադրատեսակներ սեւ մետաղներից՝ առանց էլեկտրական մեկուսացման",
                "7313 " => "Փշալար սեւ մետաղներից. ոլորված գոտեկապի պողպատ կամ մի մասից կազմված (ոչ կրկնակի) հարթ մետաղալար՝ փշապատ կամ ոչ փշապատ, ցանկապատման համար նախատեսված կրկնակի ազատ ոլորված մետաղալար՝ սեւ մետաղներից",
                "7314" => "Մետաղագործվածք (ներառյալ անծայր ժապավենները), վանդակաճաղեր, ցանցեր եւ ցանկապատեր՝ մետաղալարից, սեւ մետաղներից. ծակոտկեն–օդաքաշ թիթեղաթերթ սեւ մետաղներից",
                "7315" => "Շղթաներ եւ դրանց մասերը սեւ մետաղներից",
                "7316 " => "Խարիսխներ, ճանկիչներ եւ դրանց մասերը՝ սեւ մետաղներից",
                "7317 " => "Մեխեր, կոճգամներ, գծագրական կոճգամներ, ակոսավոր մեխեր, բռնակներ (բացի 8305 ապրանքային դիրքում ընդգրկվածներից) եւ նույնանման արտադրատեսակներ՝ սեւ մետաղներից, այլ նյութերից գլխիկներով կամ առանց գլխիկների, բացի պղնձե գլխիկներով արտադրատեսակներից",
                "7318" => "Պտուտակներ, հեղույսներ, մանեկներ, հաստամեխեր, ներպտտային կեռեր, գամեր, երիթներ, երիթակներ, տափօղակներ (այդ թվում՝ զսպանականման) եւ նույնանման արտադրատեսակներ սեւ մետաղներից",
                "7319" => "Կարի ասեղներ, հյուսելու շյուղեր, բիզեր, հյուսելու հելուններ, դեկկերային ասեղներ եւ նույնանման արտադրատեսակներ ձեռքի աշխատանքի համար՝ սեւ մետաղներից. անգլիական եւ այլ քորոցներ՝ սեւ մետաղներից, այլ ապրանքային դիրքերում չնշված կամ չներառված",
                "7320" => "Զսպանակներ, զսպակներ եւ թիթեղաթերթեր դրանց համար՝ սեւ մետաղներից",
                "7321" => "Վառարաններ ջեռուցման, ջեռուցման–եփման եւ վառարաններ ուտելիք պատրաստելու համար (ներառյալ կենտրոնական ջեռուցման ներկառուցված կաթսաներով), ճարպաջեռոցներ, բովարաններ, հրածորաններ սալերի համար, ջեռակներ ուտելիք տաքացնելու համար եւ նույնանման ոչ էլեկտրական կենցաղային սարքեր` սեւ մետաղներից",
                "7322" => "Ռադիատորներ կենտրոնական ջեռուցման համար՝ ոչ էլեկտրական, եւ դրանց մասերը, սեւ մետաղներից. օդատաքացուցիչներ եւ բաշխիչ սարքեր տաք օդի մատուցման համար (ներառյալ թարմ կամ լավորակված (կոնդիցիոնացված) օդի մատուցման սարքերը)՝ ոչ էլեկտրական, ներկառուցված օդափոխիչներով, կամ օդափուքերը շարժիչից ձգվող հաղորդակով, եւ դրանց մասերը՝ սեւ մետաղներից",
                "7323" => "Ճաշի, խոհանոցային արտադրատեսակներ կամ կենցաղային կարիքները հոգալու համար այլ արտադրատեսակներ եւ դրանց մասերը՝ սեւ մետաղներից. «բուրդ»՝ սեւ մետաղներից. ճիլոպներ խոհանոցային սպասքը մաքրելու համար, բարձիկներ՝ մաքրելու եւ ողորկելու համար, ձեռնոցներ եւ նույնանման արտադրատեսակներ՝ սեւ մետաղներից",
                "7324" => "Սանիտարատեխնիկական սարքավորումներ եւ դրանց մասերը՝ սեւ մետաղներից",
                "7325" => "Այլ ձուլված արտադրատեսակներ՝ սեւ մետաղներից",
                "7326" => "Այլ արտադրատեսակներ՝ սեւ մետաղներից",
                "7401 " => "Պղնձի շտայն, պղինձ՝ ցեմենտայնացման (պղինձ՝ նստվածքային)",
                "7402 " => "Չզտված պղինձ. պղնձե անոդներ էլեկտրոլիտիկ եղանակով զտման համար",
                "7403" => "Զտված պղինձ եւ չմշակված պղնձային համաձուլվածքներ",
                "7404 " => "Պղնձի թափոններ եւ ջարդոն",
                "7405 " => "Պղնձի հիմքով լիգատուրաներ",
                "7406" => "Պղնձի փոշիներ եւ թեփուկներ",
                "7407" => "Պղնձե ձողեր եւ պրոֆիլներ",
                "7408" => "Պղնձալար",
                "7409" => "Պղնձե սալեր, թերթեր, շերտեր կամ ժապավեններ՝ 0,15 մմ-ից ավելի հաստությամբ",
                "7410" => "Պղնձե նրբաթիթեղ (առանց հիմքի կամ թղթի, ստվարաթղթի, պլաստմասսայի կամ նույնանման նյութերի հիմքով)՝ 0,15 մմ-ից ոչ ավելի հաստությամբ (հիմքը չհաշված)",
                "7411" => "Պղնձե խողովակներ եւ փողակներ",
                "7412" => "Պղնձե կցամասեր խողովակների եւ փողակների համար (օրինակ` կցորդիչներ, ծունկեր, կցաշուրթեր)",
                "7413 " => "Ոլորած մետաղալարեր, մետաղաճոպաններ, հյուսված քուղեր եւ նույնանման արտադրատեսակներ պղնձից՝ առանց էլեկտրամեկուսացման",
                "7415" => "Մեխեր, կոճգամներ, գծագրական կոճգամներ, պահանգներ (բացի 8305 ապրանքային դիրքին դասվող արտադրատեսակներից) եւ պղնձից կամ պղնձե գլխիկներով սեւ մետաղներից նույնանման արտադրատեսակներ. պտուտակներ, հեղույսներ, մանեկներ, հաստամեխեր, ներպտտային կեռեր, գամեր, երիթներ, երիթակներ, տափօղակներ (այդ թվում՝ զսպանակավորները) եւ պղնձե նույնանման արտադրատեսակներ",
                "7418" => "Ճաշի, խոհանոցային կամ կենցաղային կարիքների համար այլ արտադրատեսակներ եւ դրանց մասերը՝ պղնձից. ճիլոպներ խոհանոցային սպասքը մաքրելու համար, բարձիկներ՝ մաքրելու կամ փայլեցնելու համար, ձեռնոցներ եւ նույնանման արտադրատեսակներ՝ պղնձից, պղնձե սանիտարատեխնիկական սարքավորումներ եւ դրանց մասերը",
                "7419" => "Պղնձից այլ արտադրատեսակներ",
                "7501" => "Նիկելի շտայն, նիկելի օքսիդների շեղջաքարեր (ագլոմերատներ) եւ մետաղագործական այլ միջանկյալ արգասիքներ նիկելից",
                "7502" => "Չմշակված նիկել",
                "7503 " => "Նիկելի թափոններ եւ ջարդոն",
                "7504 " => "Նիկելի փոշիներ եւ թեփուկներ",
                "7505" => "Նիկելից ձողեր, պրոֆիլներ եւ մետաղալար",
                "7506" => "Նիկելից սալեր, թերթեր, շերտեր կամ ժապավեններ եւ նրբաթիթեղ",
                "7507" => "Նիկելից խողովակներ, փողակներ եւ դրանց կցամասերը (օրինակ` կցորդիչներ, ծունկեր, կցաշուրթեր)",
                "7508" => "Նիկելից արտադրատեսակներ՝ այլ",
                "7601" => "Ալյումին չմշակված",
                "7602 " => "Ալյումինի թափոններ եւ ջարդոն",
                "7603" => "Ալյումինի փոշիներ եւ թեփուկներ",
                "7604" => "Ալյումինե ձողեր եւ պրոֆիլներ",
                "7605" => "Ալյումինե մետաղալար",
                "7606" => "Ալյումինե սալեր, թերթեր, շերտեր կամ ժապավեններ՝ 0,2 մմ–ից ավելի հաստությամբ",
                "7607" => "Ալյումինե նրբաթիթեղ (առանց հիմքի կամ թղթի, ստվարաթղթի, պլաստմասսայի կամ նույնանման նյութերի հիմքով) 0,2 մմ–ից ոչ պակաս հաստությամբ (չհաշված հիմքը)",
                "7608" => "Ալյումինե խողովակներ եւ փողակներ",
                "7609 " => "Կցամասեր՝ ալյումինից խողովակների կամ փողակների համար (օրինակ` կցորդիչներ, ծունկեր, կցաշուրթեր)",
                "7610" => "Ալյումինե մետաղակոնստրուկցիաներ (բացի 9406 ապրանքային դիրքի շինարարական հավաքովի կոնստրուկցիաներից) եւ դրանց մասերը (օրինակ` կամուրջներ եւ դրանց սեկցիաները, աշտարակներ, վանդակաճաղ կայմեր, տանիքի համար ծածկեր, շինարարական ֆերմաներ, դռներ, պատուհաններ եւ դրանց շրջանակները, դռների համար շեմքեր, ճաղաշարքեր, հենարաններ եւ սյուներ). թերթեր, ձողեր, պրոֆիլներ, խողովակներ եւ ալյումինե նույնանման արտադրատեսակներ՝ նախատեսված շինարարական մետաղակոնստրուկցիաներում օգտագործելու համար",
                "7611 " => "Ամբարներ, ցիստեռններ, բաքեր եւ նույնանման ալյումինե տարողություններ ցանկացած նյութերի համար (բացի սեղմված եւ հեղուկացված գազից)՝ 300 լիտրից ավելի տարողությամբ, երեսպատումով կամ ջերմամեկուսացումով կամ առանց դրանց, բայց առանց մեխանիկական կամ ջերմատեխնիկական սարքավորումների",
                "7612" => "Տակառներ, թմբուկներ, բանկաներ, արկղեր եւ ալյումինե նույնանման տարողություններ (ներառյալ ոչ հավաքովի կամ հավաքովի խողովակաձեւ տարողությունները) ցանկացած նյութի համար (բացի սեղմված կամ հեղուկացված գազից), 300 լիտրից ոչ ավելի տարողությամբ, երեսպատումով կամ ջերմամեկուսացումով կամ առանց դրանց, առանց մեխանիկական կամ ջերմատեխնիկական սարքավորումների",
                "7613 " => "Ալյումինե տարողություններ սեղմված կամ հեղուկացված գազի համար",
                "7614" => "Ոլորված մետաղալարեր, ճոպաններ, հյուսված քուղեր եւ ալյումինե նույնանման արտադրատեսակներ՝ առանց էլեկտրական մեկուսացման",
                "7615" => "Ճաշի, խոհանոցային կամ այլ արտադրատեսակներ կենցաղային կարիքների համար եւ դրանց՝ ալյումինից պատրաստված մասերը. ճիլոպներ խոհանոցային սպասքը մաքրելու համար, բարձիկներ՝ մաքրելու կամ փայլեցնելու համար, ձեռնոցներ եւ ալյումինից պատրաստված նույնանման արտադրատեսակներ. սանիտարատեխնիկական սարքավորումներ եւ դրանց՝ ալյումինից պատրաստված մասերը",
                "7616" => "Ալյումինից պատրաստված այլ արտադրատեսակներ",
                "7801" => "Կապար՝ չմշակված",
                "7802 " => "Կապարի թափոններ եւ ջարդոն",
                "7804" => "Կապարից սալեր, թերթեր, շերտեր կամ ժապավեններ եւ նրբաթիթեղ. կապարի փոշի ու թեփուկներ",
                "7806 " => "Կապարից այլ արտադրատեսակներ",
                "7901" => "Չմշակված ցինկ",
                "7902 " => "Ցինկի թափոններ եւ ջարդոն",
                "7903" => "Ցինկի մանրափոշի, փոշի եւ թեփուկներ",
                "7904 " => "Ձողեր, պրոֆիլներ եւ մետաղալարեր՝ ցինկից",
                "7905 " => "Սալեր, թերթեր, շերտեր կամ ժապավեններ եւ նրբաթիթեղ՝ ցինկից",
                "7907 " => "Այլ արտադրատեսակներ՝ ցինկից",
                "8001" => "Անագ՝ չմշակված",
                "8002 " => "Անագի թափոններ եւ ջարդոն",
                "8003 " => "Ձողեր, պրոֆիլներ եւ մետաղալար՝ անագից",
                "8007 " => "Անագից արտադրատեսակներ՝ այլ",
                "8101" => "Վոլֆրամ եւ դրանից պատրաստված արտադրատեսակներ՝ ներառյալ թափոնները եւ ջարդոնը",
                "8102" => "Մոլիբդեն եւ դրանից պատրաստված արտադրատեսակները՝ ներառյալ թափոնները եւ ջարդոնը",
                "8103" => "Տանտալ եւ դրանից պատրաստված արտադրատեսակներ՝ ներառյալ թափոնները եւ ջարդոնը",
