                "8105" => "Կոբալտի շտայն եւ կոբալտի մետալուրգիայի ոլորտում այլ միջանկյալ արտադրանք, կոբալտ եւ դրանից պատրաստված արտադրատեսակներ՝ ներառյալ թափոնները եւ ջարդոնը",
                "8106 " => "Բիսմութ եւ դրանից պատրաստված արտադրատեսակներ՝ ներառյալ թափոնները եւ ջարդոնը",
                "8107" => "Կադմիում եւ դրանից պատրաստված արտադրատեսակներ՝ ներառյալ թափոնները եւ ջարդոնը",
                "8108" => "Տիտան եւ դրանից պատրաստված արտադրատեսակներ՝ ներառյալ թափոնները եւ ջարդոնը",
                "8109" => "Ցիրկոնիում եւ դրանից պատրաստված արտադրատեսակներ՝ ներառյալ թափոնները եւ ջարդոնը",
                "8110" => "Ծարիր եւ դրանից պատրաստված արտադրատեսակներ՝ ներառյալ թափոնները եւ ջարդոնը",
                "8111 " => "Մանգան եւ դրանից պատրաստված արտադրատեսակներ՝ ներառյալ թափոնները եւ ջարդոնը",
                "8112" => "Բերիլիում, քրոմ, գերմանիում, վանադիում, գալիում, հաֆնիում, ինդիում, նիոբիում (կոլումբիում), ռենիում, թալիում եւ դրանցից պատրաստված արտադրատեսակներ՝ ներառյալ թափոնները եւ ջարդոնը",
                "8113 " => "Մետաղակերամիկա եւ դրանից պատրաստված արտադրատեսակներ՝ ներառյալ թափոնները եւ ջարդոնը",
                "8201" => "Ձեռքի գործիքներ՝ սվինաձեւ եւ թիանման բահեր, բրիչներ, քլունգներ, ուրագներ, եղաններ եւ փոցխեր, կացիններ, հատիչներ եւ նույնանման կտրող գործիքներ, էտոցների բոլոր տեսակները, գերանդիներ, մանգաղներ, դանակներ խոտը մանրացնելու համար, այգեգործական մկրատներ, սեպեր փայտ ճեղքելու համար եւ գյուղատնտեսության, այգեգործության կամ անտառային տնտեսության մեջ օգտագործվող այլ գործիքներ",
                "8202" => "Ձեռքի սղոցներ, սղոցաշեղբեր ամեն տեսակի սղոցների համար (ներառյալ երկայնակի սղոցման, փորակների կտրման համար նախատեսված սղոցաշեղբերը կամ անատամ գործիքները)",
                "8203" => "Խարտոցներ, նրբախարտոցներ, ռաշպիլներ, աքցաններ (ներառյալ կցաքցանները), տափակաշուրթ աքցաններ, համաքցաններ, նրբունելիներ, ունելիներ, մկրատներ մետաղ կտրելու համար, խողովակահատիչ հարմարանքներ, հեղույսահատ մկրատներ, անցքահատներ եւ ձեռքի նույնանման գործիքներ",
                "8204" => "Ձեռքի մանեկային դարձակներ (ներառյալ ոլորքաչափերով մանեկային դարձակները՝ բացառյալ պտտիկները). փոխովի գլխիկներ մանեկային դարձակների համար, բռնակներով կամ առանց դրանց",
                "8205" => "Ձեռքի գործիքներ (ներառյալ ալմաստային ապակեկտրիչները), այլ տեղում չնշված կամ չներառված, զոդալամպեր, մամլակներ, սեղմակներ եւ նույնանման արտադրատեսակներ՝ բացի հաստոցների պարագաներից ու մասերից, զնդաններ, շարժական հնոցներ, հենարանային կառուցվածքներով հղկասկավառակներ, ձեռքի կամ ոտքի շարժակով",
                "8206 " => "8202–8205 ապրանքային դիրքերում ընդգրկված, մանրածախ վաճառքի համար նախատեսված երկու կամ ավելի գործիքներ՝ հավաքածուներով",
                "8207" => "Փոխովի աշխատանքային մասեր ձեռքի գործիքների համար՝ մեխանիկական հաղորդակով կամ առանց դրա կամ հաստոցների համար (օրինակ` մամլման, դրոշմման, արտահատման, պարուրակների ակոսման, գայլիկոնման, ներտաշման, միջաձգման, ֆրեզման, խառատային մշակման կամ ներպտուտակման համար)՝ ներառյալ մետաղի կորզանման կամ արտամղման համար գործիքները, լեռնային ապարները կամ գրունտը հորատելու համար գործիքները",
                "8208" => "Դանակներ եւ կտրող սայրեր մեքենաների կամ մեխանիկական հարմարանքների համար",
                "8209 " => "Թիթեղներ, սրոցաքարեր, ծայրապանակներ եւ նույնանման արտադրատեսակներ գործիքների համար, դրանց վրա չտեղակայված, մետաղակերամիկայից",
                "8210 " => "Ձեռքի մեխանիկական սարքվածքներ 10կգ կամ պակաս զանգվածով, սննդի կամ ըմպելիքների պատրաստման, մշակման կամ մատուցման համար",
                "8211" => "Դանակներ կտրող սայրերով, սղոցանման կամ ոչ (ներառյալ ծառերը եզրահատելու դանակները), բացի 8208 ապրանքային դիրքում ընդգրկված դանակներից եւ դրանց համար նախատեսված սայրերից",
                "8212" => "Ածելիներ եւ սայրեր դրանց համար (ներառյալ սայրերի համար նախապատրաստուկները)",
                "8213 " => "Մկրատներ, դերձակի եւ նույնանման մկրատներ ու սայրեր դրանց համար",
                "8214" => "Կտրող արտադրատեսակներ՝ այլ (օրինակ` մազերը կտրելու մեքենաներ, հատուկ դանակներ մսագործների համար կամ խոհանոցային հատուկ դանակներ եւ մանրիչներ, դանակներ թղթի համար), մատնահարդարման եւ ոտնահարդարման հավաքածուներ եւ գործիքներ (ներառյալ եղունգների խարտոցները)",
                "8215" => "Գդալներ, պատառաքաղներ, շերեփներ, քափքաշներ, թիակներ` տորթերի համար, դանակներ` ձկան, կարագի համար, ունելիներ` շաքարի համար եւ խոհանոցային կամ ճաշի նույնանման սպասք",
                "8301" => "Կողպեքներ՝ կախովի եւ ներդրովի (գործող բանալու կամ կոդային համակցության օգնությամբ կամ էլեկտրական), ոչ թանկարժեք մետաղներից. սողնակներ եւ շրջանակներ սողնակներով՝ համակցված կողպեքների հետ, ոչ թանկարժեք մետաղներից. բանալիներ՝ վերը նշված ցանկացած արտադրատեսակի համար, ոչ թանկարժեք մետաղներից",
                "8302" => "Ամրակման արմատուրա, ֆուրնիտուրա եւ նույնանման արտադրատեսակներ ոչ թանկարժեք մետաղներից, որոնք օգտագործվում են կահույքի, դռների, աստիճանների, պատուհանների, գալարավարագույրների, տրանսպորտային միջոցների սրահների, փոկային արտադրատեսակների, ճամպրուկների, արկղերի, զարդատուփերի կամ նույնանման արտադրատեսակների համար. կախոցներ գլխարկների համար, ճարմանդներ գլխարկների համար, բարձակներ եւ նույնանման արտադրատեսակներ ոչ թանկարժեք մետաղներից. կահույքային անիվներ ամրակման հարմարանքներով, ոչ թանկարժեք մետաղներից. դռները փակելու համար նախատեսված ավտոմատ սարքվածքներ՝ ոչ թանկարժեք մետաղներից",
                "8303 " => "Չհրկիզվող պահարաններ, սեյֆեր եւ դռներ ու կողպվող արկղեր՝ բանկային պահոցներում թանկարժեք իրերի անվտանգ պահպանության համար, արկղեր՝ հատուկ նախատեսված դրամ եւ փաստաթղթեր պահելու համար ու նույնանման արտադրատեսակներ՝ զրահապատված կամ ամրանավորված, ոչ թանկարժեք մետաղներից",
                "8304 " => "Պահարաններ դոսյեների համար, պահարաններ քարտարանների համար, արկղեր թղթերի համար, տակդիրներ թղթերի համար, արկղեր գրիչների համար, տակդիրներ կնիքների համար եւ գրասենյակային նույնանման սարքավորումներ ոչ թանկարժեք մետաղներից, բացի 9403 ապրանքային դիրքում ընդգրկված գրասենյակային կահույքից",
                "8305" => "Ֆուրնիտուրա արագակարների կամ թղթապանակների համար, գրասենյակային սեղմիչներ եւ ամրակներ, ինդեքսային քարտային ցուցիչներ եւ գրասենյակային նույնանման արտադրատեսակներ ոչ թանկարժեք մետաղներից. մետաղալարային կապեր՝ բլոկներով (օրինակ` գրասենյակային նպատակների համար, կահույքի պաստառներ, փաթեթներ), ոչ թանկարժեք մետաղներից",
                "8306" => "Զանգեր, գոնգեր եւ նույնանման արտադրատեսակներ ոչ էլեկտրական, ոչ թանկարժեք մետաղներից. արձանիկներ եւ այլ զարդարանքներ ոչ թանկարժեք մետաղներից. շրջանակներ` լուսանկարների, նկարների համար կամ նույնանման շրջանակներ ոչ թանկարժեք մետաղներից. հայելիներ ոչ թանկարժեք մետաղներից",
                "8307" => "Ճկուն խողովակներ ոչ թանկարժեք մետաղներից՝ կցամասերով կամ առանց դրանց",
                "8308" => "Օղլակներ, շրջանակներ օղլակներով, ճարմանդներ, ճարմանդ-օղլակներ, կեռիկներ, օղակներ, ամրօղակներ եւ նույնանման արտադրատեսակներ ոչ թանկարժեք մետաղներից, որոնք օգտագործվում են հագուստների, կոշկեղենի, ծածկերի, պայուսակների, ճանապարհորդական պարագաների եւ այլ պատրաստի արտադրատեսակների համար. խողովակաձեւ կամ երկատված գամեր ոչ թանկարժեք մետաղներից. հուլունքներ եւ փայլազարդեր ոչ թանկարժեք մետաղներից",
                "8309" => "Խցաններ, թասակներ եւ կափարիչներ (ներառյալ թագակերպ թասակները, պտուտակվող թասակները եւ խցանները` տարալցման հարմարանքով), խցանման կափարիչներ շշերի համար, խցաններ` պարուրակով խցանների պատյաններ, հերմետիկացնող եւ փաթեթավորման այլ պարագաներ ոչ թանկարժեք մետաղներից",
                "8310 " => "Աղյուսակներ ցուցիչներով, անվանումներով, հասցեներով եւ նույնանման աղյուսակներ, համարներ, տառեր եւ այլ խորհրդանիշեր ոչ թանկարժեք մետաղներից՝ բացի 9405 ապրանքային դիրքում ընդգրկված արտադրատեսակներից",
                "8311" => "Մետաղալարեր, ձողեր, խողովակներ, թիթեղաշերտեր, էլեկտրոդներ եւ նույնանման արտադրատեսակներ ոչ թանկարժեք մետաղներից կամ մետաղների կարբիդներից, պատվածքով կամ հալանյութային միջուկով, որոնք օգտագործվում են ցածր ջերմաստիճանի կամ բարձր ջերմաստիճանի պայմաններում զոդման համար, մետաղների կամ մետաղների կարբիդների եռակցման կամ պարզեցման համար. մետաղալար կամ ձողեր ոչ թանկարժեք մետաղների եռակցված փոշիներից, փոշեցրումով մետաղապատման համար օգտագործվող",
                "8401" => "Միջուկային ռեակտորներ. ջերմանջատիչ տարրեր (ՋԱՏ-ներ)` չճառագայթված միջուկային ռեակտորների համար. սարքավորումներ եւ սարքվածքներ իզոտոպների բաժանման համար",
                "8402" => "Շոգեկաթսաներ կամ այլ շոգեարտադրող կաթսաներ (բացի կենտրոնական ջեռուցման ջրակաթսաներից, որոնք կարող են արտադրել ցածր ճնշման գոլորշի), ջրային կաթսաներ՝ գերտաքացուցիչներով",
                "8403" => "Կենտրոնական ջեռուցման կաթսաներ՝ բացի 8402 ապրանքային դիրքում նշված կաթսաներից",
                "8404" => "Օժանդակ սարքավորումներ, որոնք օգտագործվում են 8402 կամ 8403 ապրանքային դիրքերում նշված կաթսաների հետ (օրինակ` ջերմօգտագործիչներ, շոգեգերտաքացուցիչներ, մրի հեռացուցիչներ, գազային վերաօգտագործիչներ), կոնդենսատորներ՝ շոգեջրային կամ այլ շոգեուժային կայանքների համար",
                "8405" => "Գազագեներատորներ կամ շոգեգեներատորներ՝ մաքրիչ կայանքներով կամ առանց դրանց. ացետիլենային գեներատորներ եւ նույնանման գազագեներատորներ՝ մաքրիչ կայանքներով կամ առանց դրանց",
                "8406" => "Ջրային շոգետուրբիններ եւ այլ շոգետուրբիններ",
                "8407" => "Կայծային բռնկմամբ ներքին այրման շարժիչներ՝ մխոցի պտտվող կամ հետադարձ-առաջընթաց շարժմամբ",
                "8408" => "Սեղմումով բոցավառվող ներքին այրման մխոցային շարժիչներ (դիզելներ եւ կիսադիզելներ)",
                "8409" => "Մասեր՝ բացառապես կամ հիմնականում 8407 կամ 8408 ապրանքային դիրքում ընդգրկված շարժիչների համար նախատեսված",
                "8410" => "Հիդրավլիկ տուրբիններ, ջրային անիվներ եւ կարգավորիչներ դրանց համար",
                "8411" => "Շարժիչներ` տուրբոռեակտիվ եւ տուրբոպտուտակային, այլ գազային տուրբիններ",
                "8412" => "Այլ շարժիչներ եւ ուժային կայանքներ",
                "8413" => "Պոմպեր հեղուկային, ծախսաչափերով կամ առանց դրանց. հեղուկների վերհաններ",
                "8414" => "Պոմպեր օդային կամ վակուումային, օդային կամ գազային կոմպրեսորներ եւ օդափոխիչներ, օդափոխիչ կամ վերաշրջանառու օդաքաշ թասակներ կամ պահարաններ` օդափոխիչներով, ֆիլտրերով կամ առանց ֆիլտրերի",
                "8415" => "Օդորակման համար նախատեսված կայանքներ՝ շարժիչային օդափոխիչով եւ օդի ջերմաստիճանն ու խոնավությունը փոխելու համար սարքերով սարքավորված՝ ներառյալ օդորակիչները, որոնցում խոնավությունն առանձին չի կարգավորվում",
                "8416" => "Բոցամուղներ հեղուկ վառելիքի համար, փոշիացված պինդ վառելիքի համար կամ գազային հրածորաններ. մեխանիկական հնոցներ` ներառյալ դրանց մեխանիկական կրակակալ ճաղացանցերը, մեխանիկական մոխրահեռացուցիչները եւ նույնանման սարքվածքներ",
                "8417" => "Հնոցներ եւ վառարաններ՝ արդյունաբերական կամ լաբորատոր՝ ներառյալ աղբայրիչ վառարանները, ոչ էլեկտրական",
                "8418" => "Էլեկտրական կամ այլ տիպերի սառնարաններ, սառցարաններ եւ այլ սառնարանային կամ սառցարանային սարքավորումներ. ջերմային պոմպեր՝ 8415 ապրանքային դիրքում ընդգրկված օդորակման կայանքներից",
                "8419" => "Արդյունաբերական կամ լաբորատոր մեքենաներ, սարքավորումներ՝ էլեկտրական կամ ոչ էլեկտրական տաքացմամբ (բացառելով 8514 ապրանքային դիրքում ընդգրկված վառարանները, ջեռուցիչ խցերը եւ այլ սարքավորումներ)՝ ջերմաստիճանների փոփոխման հետեւյալ գործընթացներում նյութերի մշակման համար՝ տաքացում, եփում, տապակում, թորում, բազմաթորում, մանրէազերծում, պաստերիզացում, շոգեհարում, չորացում, շոգեախտահանում, կոնդենսացում կամ սառեցում՝ բացառությամբ կենցաղային նպատակներով օգտագործվող մեքենաների ու սարքավորումների, հոսանուտ եւ կուտակային (ունակային) ջրատաքացուցիչներ՝ ոչ էլեկտրական",
                "8420" => "Գլոցիչներ կամ այլ գլանիկավոր (հոլովակավոր) մեքենաներ, բացի մետաղ եւ ապակի մշակող մեքենաներից, գլանիկներ դրանց համար",
                "8421" => "Կենտրոնախուսակներ՝ ներառյալ կենտրոնախույս չորանոցները, սարքավորումներն ու սարքվածքները՝ հեղուկները եւ գազերը ֆիլտրելու կամ զտելու համար",
                "8422" => "Սպասք լվացող մեքենաներ, սարքավորումներ՝ շշեր կամ այլ տարողություններ լվանալու կամ չորացնելու համար, սարքավորումներ՝ շշեր, բանկաներ լցնելու, խցանելու համար, արկղեր, պարկեր եւ այլ տարողություններ փակելու, դրանք կնքելու եւ պիտակավորելու համար, սարքավորումներ՝ շշերի, բանկաների, պարկուճների (տյուբիկների) եւ նույնանման տարողությունների՝ կափույրներով կամ կափարիչներով հերմետիկ խցանափակման համար, այլ սարքավորումներ՝ փաթեթավորման կամ փաթաթման համար (փաթեթավորման նյութերի ջերմանստեցմամբ ապրանքի փաթաթման սարքավորումները), սարքավորումներ՝ ըմպելիքներ գազավորելու համար",
                "8423" => "Սարքավորումներ՝ ապրանքները կշռելու համար (բացի 0,05 գ կամ ավելի զգայնություն ունեցող կշեռքներից)՝ ներառյալ ապրանքի զանգվածը հաշվարկող եւ վերահսկող մեքենաները, որոնք գործարկվում են կշռվող ապրանքի ծանրության ուժով, մանրակշռաքարեր՝ բոլոր տիպերի կշեռքների համար",
                "8424" => "Մեխանիկական սարքվածքներ (ձեռքի ղեկավարումով կամ առանց դրա) հեղուկը կամ փոշին արտամղելու, ցողելու կամ փոշեցրելու համար, կրակմարիչներ՝ լիցքավորված կամ չլիցքավորված, հեղուկացիրներ եւ նույնանման սարքվածքներ, շոգեշիթային կամ ավազաշիթային ու նույնանման արտամղիչ սարքվածքներ",
                "8425" => "Վերհան բազմաճախարակներ եւ վերհաններ՝ բացի սկիպային վերհաններից, կարապիկներ եւ կաբեստաններ, ամբարձիչներ (դոմկրատներ)",
                "8426" => "Նավային դերրիկ-կռունկներ, վերհան կռունկներ՝ ներառյալ ճոպանավոր կռունկները, վերհան ֆերմաներ՝ շարժական, սայլակավոր բեռնիչներ եւ սայլակներ, համալրված վերհան կռունկով",
                "8427" => "Ավտոբեռնիչներ եղանավոր բռնիչով, այլ բեռնիչներ՝ համալրված վերհան կամ բեռնիչ-բեռնաթափիչ սարքավորումներով",
                "8428" => "Բարձրացնելու, տեղափոխելու, բեռնելու կամ բեռնաթափելու համար այլ մեքենաներ ու սարքվածքներ (օրինակ` վերելակներ, շարժասանդուղքներ, փոխակրիչներ (կոնվեյերներ), ճոպանուղիներ)",
                "8429" => "Բուլդոզերներ (մղաններ)` ոչ դարձկեն եւ դարձկեն հարթաշերեփով, ուղեհարթիչներ ու հարթիչներ, կեռաշերեփներ (սկրեպերներ), մեխանիկական թիեր, էքսկավատորներ, միաշերեփ բեռնիչներ, տոփանիչ մեքենաներ, ճանապարհային գլանիվներ, ինքնագնաց",
                "8430" => "Այլ մեքենաներ եւ մեխանիզմներ՝ բնահողը, օգտակար հանածոները կամ հանքաքարերը տեղափոխելու, համահարթելու, պրոֆիլավորելու, մշակելու, տոփանելու, խտացնելու, հեռացնելու կամ հորատելու համար. սարքավորումներ՝ ցցեր խփելու եւ հանելու համար. գութանային եւ ռոտորային ձյունամաքրիչներ",
                "8431" => "Մասեր՝ նախատեսված բացառապես կամ հիմնականում 8425–8430 ապրանքային դիրքերում դասակարգված սարքավորումների համար",
                "8432" => "Հողի նախապատրաստման եւ մշակման համար գյուղատնտեսական, այգեգործական կամ անտառատնտեսական մեքենաներ. գլանիվներ՝ սիզամարգերի ու սպորտային հրապարակների համար",
                "8433" => "Մեքենաներ կամ մեխանիզմներ գյուղատնտեսական կուլտուրաները հավաքելու կամ կալսելու համար՝ ներառյալ մամլիչ-հասկահավաքները, ծղոտը կամ խոտը հակավորող մամլիչները. խոտհնձիչները կամ սիզամարգերի հնձիչները. ձվերը, մրգերը կամ գյուղատնտեսական այլ մթերքներ մաքրելու, տեսակավորելու կամ տրամաչափարկելու համար մեքենաներ՝ բացի 8437 ապրանքային դիրքում ընդգրկված մեքենաներից",
                "8434" => "Կթելու համար սարքվածքներ եւ ապարատներ, կաթը մշակելու եւ վերամշակելու համար սարքավորումներ",
                "8435" => "Մամլիչներ, ջարդիչներ եւ նույնանման սարքավորումներ՝ գինեգործության, սիդրի, մրգահյութերի կամ նույնանման ըմպելիքների արտադրության համար",
                "8436" => "Սարքավորումներ՝ գյուղատնտեսության, այգեգործության, անտառատնտեսության, թռչնաբուծության կամ մեղվաբուծության համար՝ ներառյալ սերմեր աճեցնելու համար սարքավորումները` մեխանիկական կամ տաքացնող սարքվածքներով, այլ. ինկուբատորներ՝ թռչնաբուծության համար եւ բրուդերներ",
                "8437" => "Մեքենաներ՝ սերմեր, հացահատիկներ կամ չոր լոբազգի կուլտուրաներ մաքրելու, տեսակավորելու կամ տրամաչափարկելու համար. սարքավորումներ՝ ալրաղացի արդյունաբերության համար կամ հացահատիկների կամ չոր լոբազգի կուլտուրաների մշակման համար՝ բացի գյուղատնտեսական ֆերմաներում օգտագործվող սարքավորումներից",
                "8438" => "Սարքավորումներ՝ սննդամթերքի կամ ըմպելիքների արդյունաբերական պատրաստման կամ արտադրության համար, տվյալ խմբի այլ տեղում չնշված կամ չներառված՝ բացի կենդանական կամ բուսական ծագման չցնդող ճարպերից կամ յուղերից լուծամզման կամ պատրաստման համար նախատեսված սարքավորումներից",
                "8439" => "Սարքավորումներ` թաղանթանյութային թելքավոր նյութերից զանգվածի արտադրության կամ թղթի կամ ստվարաթղթի արտադրության կամ վերջնամշակման համար",
                "8440" => "Կազմարարական սարքավորումներ՝ ներառյալ գրքի բլոկները կարելու համար նախատեսված մեքենաները",
                "8441" => "Սարքավորումներ՝ թղթային զանգվածից, թղթից կամ ստվարաթղթից արտադրատեսակներ արտադրելու համար՝ ներառյալ ամեն տիպի կտրող մեքենաները. այլ",
                "8442" => "Մեքենաներ, ապարատուրաներ եւ սարքեր (բացի 8456–8465 ապրանքային դիրքերում նշված հաստոցներից)` թիթեղների, գլանների կամ տպագրական այլ ձեւերի նախապատրաստման կամ պատրաստման համար. թիթեղներ, գլաններ եւ այլ տպագրական ձեւեր. թիթեղներ, գլաններ եւ վիմագրության քարեր՝ նախապատրաստված տպագրական նպատակների համար (օրինակ` տաշած, հղկած կամ ողորկած)",
                "8443" => "8442 ապրանքային դիրքում ընդգրկված թիթեղների, գլանների եւ այլ տպագրական ձեւերի միջոցով տպագրության համար օգտագործվող տպագրական մեքենաներ, միացված կամ չմիացված այլ տպիչներ, պատճենահան ապարատներ եւ ֆաքսիմիլային ապարատներ, դրանց մասերն ու պարագաները",
                "8444 " => "Մեքենաներ՝ քիմիական մանածագործական նյութերը արտամղելու, արտաձգելու, տեքստուրավորելու կամ կտրելու համար",
                "8445" => "Մեքենաներ՝ մանածագործական մանրաթելերի նախապատրաստման համար. մանող, միահյուսող կամ ոլորող մեքենաներ եւ այլ սարքավորումներ՝ մանածագործական մանվածք պատրաստելու համար. բոժոժամանող կամ կծկող (ներառյալ թեզանաթել կծկող) մանածագործական մեքենաներ եւ 8446 կամ 8447 ապրանքային դիրքերում նշված մեքենաների վրա օգտագործելու համար մանվածք նախապատրաստող մեքենաներ",
                "8446" => "Մանածագործական հաստոցներ",
                "8447" => "Տրիկոտաժային, հյուսող–կարող մեքենաներ՝ ժապավենաթել, շղարշ, ժանյակներ ստանալու, ասեղնագործության, երիզներ կամ ցանցեր հյուսելու եւ գորգեր պատրաստելու համար",
                "8448" => "Օժանդակ սարքավորումներ՝ 8444, 8445, 8446 կամ 8447 ապրանքային դիրքերում դասակարգված մեքենաների համար (օրինակ` ազբամբարձ սայլակները, ժակարդային մեքենաները, դադարակի ավտոմատ մեխանիզմները, մաքոքները փոխելու մեխանիզմները), մասեր եւ պարագաներ՝ բացառապես կամ հիմնականում նախատեսված 8444, 8445, 8446 կամ 8447 ապրանքային դիրքերում դասակարգված մեքենաների համար նախատեսված (օրինակ` իլիկներ ու երկժանիներ, ասեղնավոր տեսակաշար (գարնիտուր), սանրեր, թելակորզաններ, մաքոքներ, ազբիկներ ու ազբիկային շրջանակներ, տրիկոտաժային ասեղներ)",
                "8449 " => "Սարքավորումներ կտորներով կամ ձեւվածքով թաղիքի կամ նրբաթաղիքի կամ չգործված կտորեղենի արտադրության կամ վերջնամշակման համար՝ ներառյալ նրբաթաղիքից գլխարկներ արտադրելու համար սարքավորումները. գլխարկներ պատրաստելու կաղապարներ",
                "8450" => "Լվացքի մեքենաներ` կենցաղային կամ լվացքատների համար՝ ներառյալ քամիչ սարքվածքով համալրված մեքենաները",
                "8451" => "Սարքավորումներ (8450 ապրանքային դիրքում ընդգրկված մեքենաներից բացի)՝ մանվածքը, գործվածքները եւ պատրաստի մանածագործական արտադրատեսակները լվանալու, մաքրելու, քամելու, չորացնելու, արդուկելու, մամլելու (ներառյալ նյութերի ջերմասեւեռակման համար մամլիչները), սպիտակեցնելու, ներկելու, ապրետավորելու, վերջնամշակելու, ծածկապատելու եւ տոգորելու համար, եւ մեքենաներ՝ մանածագործական կամ այլ հիմքի վրա մածուկ քսելու համար, որոնք օգտագործվում են լինոլեումի նման հատակի ծածկույթների արտադրության մեջ. մեքենաներ՝ մանածագործվածքները կծկելու, հետ կծկելու, ծալելու, կտրելու կամ ծակելու համար",
                "8452" => "Կարի մեքենաներ՝ բացի 8440 ապրանքային դիրքում ընդգրկված գրքերի բլոկները կարելու մեքենաներից. հատուկ կարի մեքենաների համար նախատեսված կահույք, հենամասեր եւ պատյաններ. կարի մեքենաների համար ասեղներ",
                "8453" => "Սարքավորումներ՝ մորթի կամ կաշի նախապատրաստելու, դաբաղելու կամ մշակելու համար, կաշվե կոշիկներ կամ մորթուց կամ կաշվից այլ իրեր պատրաստելու կամ նորոգելու համար, բացի կարի մեքենաներից",
                "8454" => "Կոնվերտերներ, ձուլաշերեփներ, կոճղակաղապարներ եւ ձուլամեքենաներ, որոնք օգտագործվում են մետաղագործության կամ ձուլման արտադրության մեջ",
                "8455" => "Մետաղագլոցման հաստոններ եւ գլանիկներ դրանց համար",
                "8456" => "Ցանկացած նյութի մշակման հաստոցներ՝ լազերային կամ այլ լուսային կամ ֆոտոնային ճառագայթով, ուլտրաձայնային, էլեկտրալիցքավորման, էլեկտրաքիմիական, էլեկտրաճառագայթային, իոնաճառագայթային կամ պլազմա-աղեղային պրոցեսների միջոցով նյութերի հեռացման համար. ջրաշիթային կտրող մեքենաներ",
                "8457" => "Մշակող կենտրոններ, միադիրք եւ բազմադիրք ագրեգատային հաստոցներ` մետաղի մշակման համար",
                "8458" => "Խառատային մետաղակտրիչ հաստոցներ (ներառյալ բազմանպատակ խառատային հաստոցները)",
                "8459" => "Մետաղահատ հաստոցներ (ներառյալ գծային դասավորությամբ ագրեգատային հաստոցները) գայլիկոնման, ներտաշման, ֆրեզման, ներքին կամ արտաքին պարուրակի ակոսման համար՝ մետաղի հեռացման միջոցով, բացի 8458 ապրանքային դիրքում նշված խառատային հաստոցներից (ներառյալ բազմանպատակ խառատային հաստոցները)",
                "8460" => "Քերթիչ–հղկիչ, սրիչ, հղկիչ, հոնինգման, կիպահղկման, ողորկման հաստոցներ եւ հաստոցներ՝ հղկաքարերի, հղկանյութերի եւ ողորկող միջոցների օգնությամբ մետաղների կամ մետաղակերամիկայի մաքրամշակման այլ գործողություններ կատարելու համար՝ բացի 8461 ապրանքային դիրքում ընդգրկված ատամնահատ, ատամնահղկման կամ ատամնամշակման հաստոցներից",
                "8461" => "Երկայնառանդման, լայնական ռանդման, թործային, միջաձգիչ, ատամնահատ, ատամնահղկման կամ ատամնամշակման, սղոցող, կտորահատիչ հաստոցներ եւ այլ հաստոցներ՝ նյութի հեռացման միջոցով մետաղի կամ մետաղակերամիկայի մշակման համար, այլ տեղերում չնշված կամ չներառված",
                "8462" => "Հաստոցներ (ներառյալ մամլիչները)՝ ծավալային դրոշմման, կռման կամ դրոշմման միջոցով մետաղները մշակելու համար, մետաղների մշակման համար կորացման, եզրակորացման, հարդարման, կտորահատիչ, անցքահատիչ կամ արտահատիչ հաստոցներ (ներառյալ մամլիչները), ինչպես նաեւ վերեւում չնշված մամլիչներ՝ մետաղների կամ մետաղների կարբիդների մշակման համար",
                "8463" => "Այլ հաստոցներ՝ մետաղների կամ մետաղակերամիկայի մշակման համար՝ առանց նյութի հեռացման",
                "8464" => "Հաստոցներ՝ քար, կերամիկա, բետոն, ասբեստացեմենտ եւ նույնանման հանքային նյութեր մշակելու համար կամ ապակու սառնամշակման համար",
                "8465" => "Հաստոցներ փայտի, խցանի, ոսկորի, էբոնիտի, պինդ պլաստմասսաների կամ նույնանման պինդ նյութերի մշակման համար (ներառյալ մեխերով, ամրակներով, սոսնձով կամ այլ միջոցներով հավաքման համար մեքենաները)",
                "8466" => "Մասեր եւ պարագաներ` նախատեսված բացառապես կամ հիմնականում 8456–8465 ապրանքային դիրքերում դասակարգված սարքավորումների համար՝ ներառյալ գործիքը կամ դետալներն ամրակելու հարմարանքները, ինքնաբացվող պարուրահատ գլխիկները, բաժանարար գլխիկները եւ այլ հատուկ հարմարանքներ հաստոցների համար. հարմարանքներ ամեն տիպի ձեռքի գործիքների համար նախատեսված աշխատանքային գործիքները ամրակելու համար",
                "8467" => "Ձեռքի գործիքներ օդաճնշական, հիդրավլիկ կամ ներկառուցված էլեկտրական կամ ոչ էլեկտրական շարժիչով",
                "8468" => "Սարքավորումներ եւ ապարատներ՝ ցածր ջերմաստիճանով զոդելու, բարձր ջերմաստիճանով զոդելու կամ եռակցելու համար, կտրելու համար պիտանի կամ ոչ պիտանի, բացի 8515 ապրանքային դիրքին պատկանող մեքենաներից եւ ապարատներից. մակերեսային ջերմամշակման համար մեքենաներ եւ ապարատներ՝ գազով աշխատող",
                "8469 " => "Գրամեքենաներ՝ բացի 8443 ապրանքային դիրքի տպիչներից. հարմարանքներ՝ տեքստերի մշակման համար",
                "8470" => "Հաշվարկիչներ եւ գրանցման, վերարտադրության ու տվյալների տեսողական ներկայացման համար գրպանի մեքենաներ` հաշվարկչի գործառույթներով. հաշվապահական մեքենաներ, փոստային դրոշմանշիչ մեքենաներ, տոմսային ապարատներ եւ այլ նույնանման մեքենաներ՝ հաշվիչ սարքվածքներով. դրամարկղային ապարատներ",
                "8471" => "Հաշվիչ մեքենաներ եւ դրանց բլոկները, մագնիսական կամ օպտիկական հաշվարկման սարքվածքներ, մեքենաներ՝ տեղեկատվության տվյալները կրիչների վրա ծածկագրված ձեւով փոխադրելու համար եւ մեքենաներ՝ նման տեղեկատվությունը մշակելու համար, այլ տեղում չնշված կամ չընդգրկված",
                "8472" => "Այլ գրասենյակային սարքավորումներ (օրինակ` հեկտոգրաֆիական կամ բազմացնող տրաֆարետային ապարատներ, հասցեների մեքենաներ, ավտոմատ սարքվածքներ՝ թղթադրամներ տրամադրելու համար, մեքենաներ՝ մետաղադրամները տեսակավորելու, հաշվելու կամ փաթեթավորելու համար, մատիտներ սրելու մեքենաներ, սորատային մեքենաներ կամ մեքենաներ՝ երկաթակապերով ամրակելու համար)",
                "8473" => "Մասեր եւ պարագաներ (բացի տեղափոխման համար նախատեսված պատյաններից, ծածկոցներից եւ նույնանման արտադրատեսակներից) բացառապես կամ հիմնականում 8469–8472 ապրանքային դիրքերում դասակարգված մեքենաների համար նախատեսված",
                "8474" => "Սարքավորումներ` բնահողը, քարը, հանքաքարը կամ այլ հանքային հանածոներ պինդ (այդ թվում՝ փոշենման կամ մածուկանման) վիճակում տեսակավորելու, քարմաղելու, զատելու, լվանալու, մանրացնելու, աղալու, խառնելու կամ միախառնելու համար. սարքավորումներ՝ պինդ հանքային վառելանյութի, կերամիկական բաղադրությունների, չկարծրացած ցեմենտի, գիպսային նյութերի կամ այլ փոշենման կամ մածուկանման հանքային արտադրանքի շեղջաքարացման (ագլոմերացման), կաղապարման կամ ձուլման համար. կաղապարման մեքենաներ՝ ավազե ձուլակաղապարներ պատրաստելու համար",
                "8475" => "Մեքենաներ՝ էլեկտրական կամ էլեկտրոնային լամպերի, խողովակների կամ էլեկտրոնաճառագայթային խողովակների կամ ապակյա անոթներում գազապարպման լամպերի հավաքման համար. մեքենաներ ապակու կամ ապակյա արտադրատեսակների պատրաստման կամ տաք մշակման համար",
                "8476" => "Ավտոմատներ վաճառքի գործունեություն իրականացնելու համար (օրինակ` փոստային նամականիշների, սիգարետների, պարենային ապրանքների կամ ըմպելիքների վաճառքի համար)` ներառյալ թղթադրամ եւ մետաղադրամ մանրելու ավտոմատները",
                "8477" => "Սարքավորումներ ռետինի կամ պլաստմասսաների մշակման կամ այդ նյութերից արտադրանք արտադրելու համար` տվյալ խմբի այլ տեղում չնշված կամ չներառված",
                "8478" => "Սարքավորումներ` ծխախոտի նախապատրաստման կամ պատրաստման համար, տվյալ խմբի այլ տեղում չնշված կամ չներառված",
                "8479" => "Մեքենաներ եւ մեխանիկական սարքվածքներ՝ անհատական գործառույթներ ունեցող՝ տվյալ խմբի այլ տեղում չնշված կամ չներառված",
                "8480" => "Ձուլման կաղապարարկղեր մետաղաձուլական արտադրության համար, ձուլման տակդիրներ, ձուլամոդելներ, կաղապարներ (բացի կոճղակաղապարներից) մետաղների, մետաղական կարբիդների, ապակու, հանքանյութերի, ռետինի կամ պլաստմասսաների ձուլման համար",
                "8481" => "Ծորակներ, կափույրներ, փականներ եւ նույնանման ամրաններ՝ խողովակատարների, կաթսաների, ամբարների, ցիստեռնների, բաքերի կամ նույնանման տարողությունների համար՝ ներառյալ նվազիչ (ռեդուկցիոն) եւ ջերմակարգավորիչ կափույրները",
                "8482" => "Գնդիկավոր կամ հոլովակավոր առանցքակալներ",
                "8483" => "Փոխհաղորդիչ լիսեռներ (ներառյալ բռնցքավոր եւ ծնկավոր) եւ շուռտվիկներ, առանցքակալների տուփեր եւ սահքի առանցքակալներ՝ լիսեռների համար՝ ժանանիվներ եւ ատամնավոր փոխանցիչներ, գնդիկավոր կամ հոլովակավոր պտուտակային փոխանցիչներ՝ փոխանցատուփեր եւ արագության այլ վարիատորներ՝ ներառյալ հիդրոտրանսֆորմատորները, թափանիվներ եւ փոկանիվներ՝ ներառյալ փոկանիվների բլոկները, կցորդիչներ եւ սարքեր լիսեռների միացման համար (ներառյալ ունիվերսալ հոդակապերը)",
                "8484" => "Միջադիրներ եւ նույնանման կապող տարրեր, թերթավոր մետաղից այլ նյութի համադրությամբ կամ մետաղի երկու կամ ավելի շերտերից բաղկացած, միջադիրների եւ նույնանման կապող տարրերի հավաքածուներ ու լրակազմեր՝ տարբեր բաղկացուցիչներով, փաթեթավորված կապոցներով, ծրարներով կամ նույնանման փաթեթավորմամբ, մեխանիկական խցվածքներ",
                "8486" => "Մեքենաներ եւ ապարատուրա, որոնք բացառապես կամ հիմնականում օգտագործվում են կիսահաղորդչային բուլյաների կամ թիթեղների արտադրության համար, կիսահաղորդչային սարքերի, էլեկտրոնային ինտեգրալային սխեմաների կամ հարթ ցուցասարքային (դիսփլեյային) պանելների արտադրության համար. տվյալ խմբի 9Գ ծանոթագրության մեջ նշված մեքենաները եւ ապարատուրան, դրանց մասերը եւ պարագաները",
                "8487" => "Սարքավորումների մասեր, որոնք չունեն էլեկտրական միացումներ, մեկուսիչներ, հպակներ, կոճեր կամ էլեկտրական դետալներ՝ այլ տեղում չնշված եւ չներառված",
                "8501" => "Էլեկտրական շարժիչներ եւ գեներատորներ (բացի էլեկտրագեներատորային կայանքներից)",
                "8502" => "Էլեկտրագեներատորային կայանքներ եւ պտտվող էլեկտրական կերպափոխիչներ",
                "8503 " => "Մասեր՝ բացառապես կամ հիմնականում 8501 կամ 8502 ապրանքային դիրքերում ընդգրկված մեքենաների համար նախատեսված",
                "8504" => "Տրանսֆորմատորներ էլեկտրական, ստատիկ էլեկտրական կերպափոխիչներ (օրինակ՝ ուղղիչներ), ինդուկտիվության կոճեր եւ դրոսելներ",
                "8505" => "Էլեկտրամագնիսներ, հաստատուն մագնիսներ եւ արտադրատեսակներ` նախատեսված մագնիսացումից հետո հաստատուն մագնիսների վերափոխման համար, էլեկտրամագնիսային կամ հաստատուն մագնիսներով սեղմակային կոթառներ, պրկիչներ եւ նույնանման ֆիքսող սարքվածքներ, էլեկտրամագնիսական կցորդիչներ, օղագոտիներ եւ արգելակներ, էլեկտրամագնիսային վերհան գլխիկներ",
                "8506" => "Առաջնային տարրեր եւ առաջնային մարտկոցներ",
                "8507" => "Կուտակիչներ (ակումուլյատորներ) էլեկտրական՝ ներառյալ դրանց համար զատիչները` ուղղանկյուն (այդ թվում՝ քառակուսի) կամ այլ ձեւի",
                "8508" => "Փոշեկուլներ",
                "8509" => "Ներկառուցված էլեկտրական շարժիչներով էլեկտրամեխանիկական կենցաղային մեքենաներ՝ բացի 8508 ապրանքային դիրքում ընդգրկված փոշեկուլներից",
                "8510" => "Էլեկտրաածելիներ, մեքենաներ` մազերը խավատելու եւ մազերը հեռացնելու հարմարանքներ` ներկառուցված էլեկտրաշարժիչներով",
                "8511" => "Էլեկտրասարքավորումներ ներքին այրման շարժիչների վառման եւ գործարկման համար` կայծից կամ վառելիքային խառնուրդի սեղմումից բոցավառումով (օրինակ` մագնետո, վառքի կոճեր, վառքի մոմեր, շիկացման մոմեր, մեկնարկիչներ), գեներատորներ (օրինակ՝ հաստատուն եւ փոփոխական հոսանքի) եւ այդ շարժիչների հետ օգտագործվող ընդհատիչներ",
                "8512" => "Էլեկտրալուսավորության կամ ազդանշանման սարքավորումներ (բացի 8539 ապրանքային դիրքում նշված արտադրատեսակներից), ապակեմաքրիչներ, հակասառցապատիչներ եւ հակաքրտակալիչներ՝ հեծանիվների վրա եւ շարժիչային տրանսպորտային միջոցներում օգտագործվող",
                "8513" => "Էլեկտրական դյուրակիր լապտերներ, որոնք աշխատում են էներգիայի սեփական աղբյուրով (օրինակ` չոր տարրերի մարտկոցներով, կուտակիչներով, մագնետոներով)՝ բացի 8512 ապրանքային դիրքում դասակարգված լուսավորման սարքավորումներից",
                "8514" => "Արդյունաբերական եւ լաբորատոր էլեկտրական վառարաններ եւ խուցեր (ներառյալ ինդուկցիոն կամ դիէլեկտրիկ կորուստների երեւույթների հիմքով աշխատող վառարանները), այլ արդյունաբերական կամ լաբորատոր սարքավորումներ նյութերի՝ ինդուկցիոն կամ դիէլեկտրիկ կորուստների երեւույթների միջոցով ջերմամշակման համար",
                "8515" => "Մեքենաներ եւ ապարատներ էլեկտրական (այդ թվում՝ գազի էլեկտրական տաքացումով), լազերային կամ այլ լուսային կամ ֆոտոնային, գերձայնային, էլեկտրոնաճառագայթային, մագնիսաիմպուլսային կամ պլազմաաղեղային ցածրաջերմաստիճան զոդման, բարձրաջերմաստիճան զոդման կամ եռակցման համար, անկախ այն բանից՝ կարող են դրանք կատարել կտրման գործողություն, թե՝ ոչ, էլեկտրական մեքենաներ եւ ապարատներ մետաղների կամ մետաղակերամիկայի տաք փոշեպատման համար",
                "8516" => "Էլեկտրական հոսանուտ կամ կուտակային (ունակային) ջրատաքացուցիչներ, ընկղմվող էլեկտրատաքացուցիչներ, Էլեկտրասարքավորումներ՝ տարածքի ջեռուցման եւ բնահողի տաքացման համար, էլեկտրաջերմային ապարատներ՝ մազերի խնամքի համար (օրինակ` մազերի չորացուցիչներ, վարսափաթաթուկ (բիգուդի), տաք գանգրացման համար նախատեսված ունելի) եւ ձեռքերի չորացուցիչներ, էլեկտրական արդուկներ, կենցաղային այլ էլեկտրատաքացուցիչ սարքեր, դիմադրության հիմունքով տաքացնող սարքեր՝ բացի 8545 ապրանքային դիրքում նշվածներից",
                "8517" => "Հեռախոսային ապարատներ՝ ներառյալ հեռախոսային ապարատները բջջային կապի ցանցի կամ այլ առանց հաղորդալարի ցանցի համար, այլ ապարատուրա՝ ձայնի, պատկերի կամ այլ տվյալների հաղորդման կամ ընդունման համար՝ ներառյալ հաղորդալարային կամ առանց լարի ցանցում (օրինակ՝ կապի լոկալ կամ գլոբալ ցանց) հաղորդակցման համար ապարատուրաներըё բացառությամբ 8443, 8525, 8527 կամ 8528 ապրանքային դիրքերում գտնվող հաղորդող կամ ընդունող ապարատուրայի",
                "8518" => "Միկրոֆոններ եւ տակդիրներ դրանց համար, բարձրախոսներ՝ կորպուսների մեջ մոնտաժված կամ չմոնտաժված, ականջակալներ եւ գլխամասային հեռախոսներ՝ միկրոֆոնի հետ զուգակցված կամ չզուգակցված, եւ լրակազմեր, որոնք բաղկացած են մեկ կամ ավելի բարձրախոսներից, ձայնային հաճախականության էլեկտրական ուժեղարարներ, էլեկտրական ձայնաուժեղացնող լրակազմեր",
                "8519" => "Ապարատուրա ձայնագրող կամ ձայնավերարտադրիչ",
                "8521" => "Տեսագրության կամ տեսավերարտադրության ապարատուրա՝ զուգորդված կամ չզուգորդված տեսաընդունիչով",
                "8522" => "Մասեր եւ պարագաներ, որոնք բացառապես կամ հիմնականում պիտանի են 8519 կամ 8521 ապրանքային դիրքերում ընդգրկված ապարատուրայի հետ օգտագործման համար",
                "8523" => "Սկավառակներ, ժապավեններ, էներգաանկախ պնդմարմին սարքվածքներ՝ տվյալները պահելու համար, «ինտելեկտուալ քարտեր» եւ այլ կրիչներ՝ ձայնի կամ այլ երեւույթների գրանցման համար, գրանցած կամ չգրանցած՝ ներառյալ մատրիցները եւ սկավառակների արտադրության համար մաստեր–սկավառակները՝ բացի 37-րդ խմբի արտադրատեսակներից",
                "8525" => "Հաղորդող ապարատուրա՝ ռադիոհեռարձակման կամ հեռուստատեսության համար, իր կազմում ընդունող, ձայնագրող կամ ձայնավերարտադրող ապարատուրա ընդգրկող կամ չընդգրկող, հեռուստատեսային խցիկներ, թվային խցիկներ եւ գրառող տեսախցիկներ",
                "8526" => "Ռադիոտեղորոշման, ռադիոնավագնացային ապարատուրա եւ հեռակառավարման ռադիոապարատուրա",
                "8527" => "Ընդունող ապարատուրա` ռադիոհեռարձակման համար, մեկ կորպուսում ձայնագրող կամ ձայնավերարտադրող ապարատուրայի կամ ժամացույցների հետ համատեղված կամ չհամատեղված",
                "8528" => "Մոնիտորներ եւ պրոյեկտորներ, իր մեջ ընդունիչ հեռուստատեսային ապարատուրա չընդգրկող, ընդունիչ ապարատուրա՝ հեռուստատեսային կապի համար, իր մեջ լայնահեռարձակման ռադիոընդունիչ կամ ձայնը կամ պատկերը գրառող կամ վերարտադրող ապարատուրա ընդգրկող կամ չընդգրկող",
                "8529" => "Մասեր՝ բացառապես կամ հիմնականում 8525 - 8528 ապրանքային դիրքերում ընդգրկված ապարատուրայի համար նախատեսված",
                "8530" => "Էլեկտրաազդանշանային սարքվածքներ՝ երկաթուղային գծերում, տրամվայի ուղիներում, ավտոմոբիլային ճանապարհներում, ներքին ջրային ուղիներում, կայանային հրապարակներում, նավահանգիստներում կամ օդանավակայաններում անվտանգությունը ապահովելու կամ երթեւեկությունը կարգավորելու համար (բացի 8608 ապրանքային դիրքում ընդգրկված սարքավորումներից)",
                "8531" => "Էլեկտրասարքավորումներ՝ ձայնային կամ տեսողական ազդանշանային (օրինակ` զանգեր, շչակներ, ինդիկատորային պանելներ, պահպանության ազդանշանային սարքվածքներ կամ հրդեհի ազդանշանային սարքվածքներ), բացի 8512 կամ 8530 ապրանքային դիրքերում ընդգրկված սարքավորումներից",
                "8532" => "Կոնդենսատորներ՝ էլեկտրական հաստատուն, փոփոխական կամ ենթալարվող",
                "8533" => "Էլեկտրական ռեզիստորներ (ներառյալ ռեոստատները եւ պոտենցաչափերը), բացի ջեռուցիչ տարրերից",
                "8534 " => "Տպասխեմաներ",
                "8535" => "Էլեկտրական ապարատուրա կոմուտացիայի կամ էլեկտրական շղթաների պահպանման համար կամ էլեկտրական շղթաներին միացնելու համար (օրինակ` անջատիչներ, փոխարկիչներ, ընդհատիչներ, հալուն ապահովիչներ, շանթարգելներ, լարման սահմանափակիչներ, լարման ցատկերի մարիչներ, հոսանքընդունիչներ, հոսանքահաններ եւ այլ միակցիչներ, միակցման տուփեր) 1000 Վ-ից ավելի լարման համար",
                "8536" => "Էլեկտրական ապարատուրա կոմուտացիայի կամ էլեկտրական շղթաների պահպանման համար կամ էլեկտրական շղթաներին միացնելու համար կամ էլեկտրական շղթաներում (օրինակ` անջատիչներ, փոխարկիչներ, ընդհատիչներ, ռելե, հալուն ապահովիչներ, լարման թռիչքների մարիչներ, խրոցակների եղանիկներ եւ վարդակներ, էլեկտրական լամպերի կոթառներ եւ այլ միակցիչներ, միակցման տուփեր) 1000 Վ-ից ոչ ավելի լարման համար. օպտիկական մանրաթելերի համար միակցիչներ, թելքաօպտիկական լարանների կամ մալուխների համար",
                "8537" => "Պուլտեր, պանելներ, բարձակներ, սեղաններ, բաշխիչ վահաններ եւ այլ հիմքեր էլեկտրական ապարատուրայի համար` սարքավորված 8535 կամ 8536 ապրանքային դիրքերում ընդգրկված երկու կամ ավելի սարքվածքներով, էլեկտրական հոսանքի ղեկավարման կամ բաշխման համար, այդ թվում` իրենց մեջ 90–րդ խմբի սարքերը կամ սարքվածքները եւ թվային ղեկավարման ապարատներն ընդգրկող, բացի 8517 ապրանքային դիրքի կոմուտացիոն սարքվածքներից",
                "8538" => "Մասեր՝ բացառապես կամ հիմնականում 8535, 8536 կամ 8537 ապրանքային դիրքերում ընդգրկված ապարատուրայի համար նախատեսված",
                "8539" => "Շիկացման լամպեր՝ էլեկտրական կամ գազապարպման՝ ներառյալ լույսի ուղղորդումով հերմետիկ լամպերը, ինչպես նաեւ ուլտրամանուշակագույն կամ ինֆրակարմիր լամպերը. աղեղային լամպեր",
                "8540" => "Ջերմակատոդով, սառը կատոդով կամ լուսակատոդով էլեկտրոնային լամպեր եւ խողովակներ (օրինակ` վակուումային կամ շոգե- կամ գազալցված լամպեր եւ խողովակներ, սնդիկային ուղղիչ աղեղային լամպեր եւ էլեկտրոնաճառագայթային խողովակներ, հեռուստատեսային հաղորդիչ խողովակներ)",
                "8541" => "Դիոդներ, տրանզիստորներ եւ նույնանման կիսահաղորդչային սարքեր, լուսազգայուն կիսահաղորդչային սարքեր՝ ներառյալ լուսագալվանական տարրերը, մոդուլով հավաքված կամ չհավաքված, պանելի վրա մոնտաժված կամ չմոնտաժված. լուսարձակող դիոդներ. հավաքված պյեզոէլեկտրական բյուրեղներ",
                "8542" => "Էլեկտրոնային ինտեգրալ սխեմաներ",
                "8543" => "Էլեկտրական մեքենաներ եւ ապարատուրա՝ անհատական ֆունկցիաներ ունեցող՝ տվյալ խմբի այլ տեղում չնշված կամ չներառված",
                "8544" => "Հաղորդալարեր մեկուսացված (ներառյալ արծնապատները կամ անոդավորվածները), մալուխներ (ներառյալ համառանցքային մալուխները) եւ այլ մեկուսացված էլեկտրական հաղորդիչներ՝ միացնող հարմարանքներով կամ առանց դրանց, մալուխներ թելքաօպտիկական, անհատական կորպուսներով մանրաթելից կազմված, անկախ նրանից՝ դրանք հավաքված են էլեկտրահաղորդիչների կամ միացնող հարմարանքների հետ, թե ոչ",
                "8545" => "Ածխային էլեկտրոդներ, ածխային խոզանակներ, ածուխներ՝ լամպերի կամ մարտկոցների համար եւ այլ արտադրատեսակներ գրաֆիտից կամ ածխածնի այլ տեսակներից՝ մետաղի հետ կամ առանց մետաղի, այլ, որոնք կիրառվում են էլեկտրատեխնիկայում",
                "8546" => "Ցանկացած նյութից էլեկտրական մեկուսիչներ",
                "8547" => "Մեկուսիչ ամրաններ՝ էլեկտրական մեքենաների, սարքվածքների կամ սարքավորումների համար՝ ամբողջովին մեկուսիչ նյութերից պատրաստված՝ չհաշված որոշ մետաղական կազմամասերը (օրինակ` պարուրակավոր կոթառները), որոնք ներմոնտաժվում են կաղապարման դեպքում բացառապես հավաքման նպատակով՝ բացի 8546 ապրանքային դիրքում նշված մեկուսիչներից, էլեկտրամեկուսիչ խողովակներ եւ ոչ թանկարժեք մետաղներից միակցիչ դետալներ դրանց համար՝ երեսապատված մեկուսիչ նյութով",
                "8548" => "Թափոններ եւ ջարդոն՝ առաջնային տարրերի, առաջնային մարտկոցների եւ էլեկտրական կուտակիչների (ակումուլյատորների), սպառված առաջնային տարրեր, սպառված առաջնային մարտկոցներ եւ սպառված էլեկտրական կուտակիչներ, սարքավորումների կամ ապարատուրայի էլեկտրական մասեր` տվյալ խմբի այլ տեղում չնշված կամ չներառված",
                "8601" => "Երկաթուղային լոկոմոտիվներ՝ էլեկտրաէներգիայի արտաքին աղբյուրից կամ կուտակիչներից սնուցումով",
                "8602" => "Երկաթուղային լոկոմոտիվներ՝ այլ. լոկոմոտիվային տենդերներ",
                "8603" => "Շարժիչով երկաթուղային կամ տրամվայի վագոններ՝ ուղեւորատար, ապրանքատար կամ ուղեբեռային, բաց հենահարթակներ՝ բացի 8604 ապրանքային դիրքում նշվածներից",
                "8604 " => "Տրանսպորտային միջոցներ՝ ինքնագնաց կամ ոչ ինքնագնաց՝ երկաթուղային կամ տրամվայի գծերի վերանորոգման կամ տեխնիկական սպասարկման համար նախատեսված (օրինակ` վագոն-արհեստանոցներ, կռունկներ, կոճախփիչ մեքենաներ, ուղեհարդարիչ մեքենաներ, վերահսկիչ-չափիչ վագոններ եւ տրանսպորտային միջոցներ՝ ուղիների զննման համար)",
                "8605 " => "Ուղեւորատար վագոններ՝ երկաթուղային կամ տրամվայի, ոչ ինքնագնաց. վագոններ՝ ուղեբեռային, փոստային եւ երկաթուղային կամ տրամվայի այլ հատուկ վագոններ, ոչ ինքնագնաց (բացի 8604 ապրանքային դիրքում նշվածներից)",
                "8606" => "Վագոններ՝ երկաթուղային կամ տրամվայի, բեռնատար, ոչ ինքնագնաց",
                "8607" => "Երկաթուղային լոկոմոտիվների կամ տրամվայի շարժիչավոր վագոնների կամ շարժակազմի մասեր",
                "8608 " => "Ուղեգծային սարքավորումներ եւ սարքվածքներ՝ երկաթուղային կամ տրամվայի գծերի համար. մեխանիկական (ներառյալ էլեկտրամեխանիկական) ազդանշանային սարքավորումներ, երկաթգծերում, տրամվայի գծերում, ավտոճանապարհներին, ներքին ջրային ուղիներում, կայանման կառույցներում, նավահանգիստներում կամ օդանավակայաններում անվտանգությունն ապահովելու կամ երթեւեկությունը ղեկավարելու համար սարքվածքներ. նշված սարքվածքների եւ սարքավորումների մասերը",
                "8609 " => "Բեռնարկղեր (ներառյալ հեղուկների կամ գազերի տեղափոխման համար տարողությունները)՝ հատուկ նախատեսված կամ սարքավորված մեկ կամ մի քանի տեսակի տրանսպորտով տեղափոխելու համար",
                "8701" => "Տրակտորներ (բացի 8709 ապրանքային դիրքում դասակարգված տրակտորներից)",
                "8702" => "Շարժիչային տրանսպորտային միջոցներ՝ նախատեսված 10 կամ ավելի մարդ՝ ներառյալ վարորդին փոխադրելու համար",
                "8703" => "Թեթեւ մարդատար ավտոմոբիլներ եւ շարժիչային այլ տրանսպորտային միջոցներ՝ բացառապես նախատեսված մարդկանց փոխադրելու համար (բացի 8702 ապրանքային դիրքում ընդգրկված շարժիչային տրանսպորտային միջոցներից)՝ ներառյալ բեռնաուղեւորատար ֆուրգոն-ավտոմոբիլները եւ մրցարշավային ավտոմոբիլները",
                "8704" => "Շարժիչային տրանսպորտային միջոցներ՝ բեռներ փոխադրելու համար",
                "8705" => "Հատուկ նշանակության շարժիչային տրանսպորտային միջոցներ (օրինակ` բեռնատար ավտոմոբիլներ վթարները վերացնելու համար, ավտոամբարձիչներ, հրշեջ տրանսպորտային միջոցներ, ավտոբետոնախառնիչներ, ճանապարհները մաքրող ավտոմոբիլներ, ջրող-լվացող ավտոմոբիլներ, ավտոարհեստանոցներ, ռենտգենյան կայանքներով ավտոմոբիլներ)՝ բացի ուղեւորներ կամ բեռներ փոխադրելու համար օգտագործվող տրանսպորտային միջոցներից",
                "8706 " => "Տեղադրված շարժիչներով ամրաշրջանակ՝ 8701–8705 ապրանքային դիրքերում ընդգրկված շարժիչային տրանսպորտային միջոցների համար",
                "8707" => "Թափքեր (ներառյալ խցիկները)՝ 8701–8705 ապրանքային դիրքերում ընդգրկված շարժիչային տրանսպորտային միջոցների համար",
                "8708" => "8701–8705 ապրանքային դիրքերում ընդգրկված շարժիչային տրանսպորտային միջոցների մասեր եւ պարագաներ",
                "8709" => "Արդյունաբերական նշանակության տրանսպորտային միջոցներ, ինքնագնացներ՝ չսարքավորված վերամբարձ կամ բեռնման սարքվածքներով, օգտագործվող գործարաններում, պահեստներում, նավահանգիստներում կամ օդանավակայաններում՝ կարճ տարածություններում բեռներ փոխադրելու համար, երկաթուղային կայանների հարթակներում օգտագործվող տրակտորներ, վերոնշված տրանսպորտային միջոցների մասերը",
                "8710 " => "Տանկեր եւ մարտական ինքնագնաց զրահապատ այլ տրանսպորտային միջոցներ՝ սպառազինությամբ կամ առանց սպառազինության եւ դրանց մասերը",
                "8711" => "Մոտոցիկլներ (ներառյալ մոպեդները) եւ հեծանիվներ՝ տեղակայված օժանդակ շարժիչով, սայլակներով կամ առանց սայլակների, սայլակներ",
                "8712 " => "Երկանիվ հեծանիվներ եւ առանց շարժիչի այլ հեծանիվներ (ներառյալ բեռների առաքման համար նախատեսված եռանիվ հեծանիվները)",
                "8713" => "Տեղաշարժվել չկարողացող մարդկանց համար սայլակներ` սարքավորված կամ չսարքավորված շարժիչով կամ տեղաշարժվելու համար նախատեսված այլ մեխանիկական սարքվածքներով",
                "8714" => "8711–8713 ապրանքային դիրքերում ընդգրկված տրանսպորտային միջոցների մասեր եւ պարագաներ",
                "8715 " => "Մանկական սայլակներ եւ դրանց մասերը",
                "8716" => "Կցորդներ եւ կիսակցորդներ, ոչ ինքնագնաց այլ տրանսպորտային միջոցներ, դրանց մասերը",
                "8801 " => "Օդապարիկներ (աերոստատներ) եւ դիրիժաբլներ. սավառնակներ, դելտապլաններ եւ այլ առանց շարժիչի թռչող ապարատներ",
                "8802" => "Այլ թռչող ապարատներ (օրինակ՝ ուղղաթիռներ, ինքնաթիռներ), տիեզերական ապարատներ (ներառյալ արբանյակները) եւ ենթաօրբիտային ու տիեզերական կրող-հրթիռներ",
                "8803" => "8801 կամ 8802 ապրանքային դիրքում ընդգրկված թռչող ապարատների մասեր",
                "8804 " => "Անկարգելներ (պարաշյուտներ) (ներառյալ ղեկավարվող անկարգելները եւ պարապլանները) եւ պտտվող պարաշյուտներ. դրանց մասերը եւ պարագաները",
                "8805" => "Մեկնարկային սարքավորումներ թռչող ապարատների համար. տախտամածային արգելակային կամ նույնանման սարքվածքներ. վերգետնյա վարժական սարքեր թռիչքակազմի համար. դրանց մասերը",
                "8806" => "Անօդաչու թռչող ապարատներ",
                "8901" => "Նավեր՝ ծովագնացության, էքսկուրսիայի, լաստանավեր, բեռնատար նավեր, բեռնանավեր (բարժաներ) եւ ուղեւորների կամ բեռների տեղափոխման համար նախատեսված նույնանման այլ լողացող միջոցներ",
                "8902 " => "Նավեր՝ ձկնորսական. լողացող բազաներ եւ այլ նավեր՝ ձկնամթերքի վերամշակման եւ պահածոյացման համար",
                "8903" => "Զբոսանավեր եւ այլ լողացող միջոցներ՝ հանգստի կամ սպորտի համար. թիանավեր եւ կանոե",
                "8904 " => "Քարշանավեր եւ հրիչ նավեր",
                "8905" => "Լողացող փարոսներ, հրշեջ նավեր, հողածուծ սարքեր, լողացող ամբարձիչ կռունկներ եւ լողացող այլ միջոցներ, որոնց համար նավագնացային հատկանիշները երկրորդական են՝ իրենց հիմնական գործառույթի համեմատ. լողացող նավանորոգարաններ. լողացող կամ ջրի տակ աշխատող հորատման կամ շահագործման հենահարթակներ",
                "8906" => "Նավեր՝ այլ՝ ներառյալ ռազմական նավերը եւ փրկարար նավերը՝ բացի թիանավակներից",
                "8907" => "Լողացող կառուցվածքներ՝ այլ (օրինակ` լաստանավակներ, լողացող բաքեր, սուզարկղեր (կեսոններ), լողացող նավամատույցներ (դեբարկադերներ), ազդալողաններ (բույեր) եւ խարսխավոր լողաններ (բակեններ)",
                "8908 " => "Ջարդման ենթակա նավեր եւ այլ լողացող կառուցվածքներ",
                "9001" => "Օպտիկական մանրաթելեր եւ թելքաօպտիկական լարաններ. թելքաօպտիկական մալուխներ՝ բացի 8544 ապրանքային դիրքում նշվածներից. բեւեռացնող նյութից թերթեր եւ թիթեղներ. ոսպնյակներ (ներառյալ կոնտակտային ոսպնյակները), պրիզմաներ, հայելիներ եւ այլ օպտիկական տարրեր ցանկացած նյութից, առանց շրջանակի՝ բացի օպտիկական չմշակված ապակուց պատրաստված այդպիսի տարրերից",
                "9002" => "Ոսպնյակներ, պրիզմաներ, հայելիներ եւ այլ օպտիկական տարրեր՝ ցանկացած նյութից, հավաքված, որոնք գործիքների եւ սարքերի կամ հարմարանքների մասեր են՝ բացի օպտիկական չմշակված ապակուց պատրաստված այդպիսի տարրերից",
                "9003" => "Շրջանակներ եւ ամրաններ` ակնոցների, պաշտպանիչ ակնոցների կամ նույնանման օպտիկական սարքերի համար, եւ դրանց մասերը",
                "9004" => "Ակնոցներ, պաշտպանիչ ակնոցներ եւ նույնանման օպտիկական սարքեր՝ շտկող, պաշտպանիչ կամ այլ",
                "9005" => "Հեռադիտակներ, մենօկուլյարներ, այլ դիտափողեր եւ դրանց ամրանները. այլ աստղագիտական սարքեր եւ դրանց ամրանները՝ բացի ռադիոաստղագիտական սարքերից",
                "9006" => "Ֆոտոխցիկներ (բացի կինոխցիկներից). լուսաբռնկիչներ եւ լամպ-բռնկիչներ՝ բացի 8539 ապրանքային դիրքում նշված գազապարպման լամպերից",
                "9007" => "Կինոխցիկներ եւ կինոպրոյեկտորներ՝ ձայնագրող կամ ձայնավերարտադրող սարքվածքներ պարունակող կամ չպարունակող",
                "9008" => "Պատկերների պրոյեկտորներ՝ բացի կինեմատոգրաֆիական պրոյեկտորներից. լուսախոշորացուցիչներ եւ պատկերները փոքրացնելու միջոցով պրոյեկտող սարքավորումներ (բացի կինեմատոգրաֆիականից)",
                "9010" => "Ապարատուրա եւ սարքավորումներ՝ լուսանկարչական լաբորատորիաների համար (ներառյալ կինոլաբորատորիաների համար), տվյալ խմբում այլ տեղում չնշված կամ չներառված. նեգատոսկոպներ. պրոյեկցիոն էկրաններ",
                "9011" => "Բարդ օպտիկական մանրադիտակներ՝ ներառյալ միկրոլուսանկարահանումների, միկրոկինոնկարահանումների կամ միկրոպրոյեկտման մանրադիտակները",
                "9012" => "Մանրադիտակներ՝ բացի օպտիկական մանրադիտակներից. դիֆրակցիոն ապարատներ",
                "9013" => "Հեղուկ բյուրեղների հիմքով սարքվածքներ՝ բացի այն արտադրատեսակներից, որոնք առավել ճշգրիտ նկարագրված են այլ ապրանքային դիրքերում. լազերներ՝ բացի լազերային դիոդներից. օպտիկական այլ սարքեր եւ գործիքներ՝ տվյալ խմբում այլ տեղում չնշված կամ չներառված",
                "9014" => "Կողմնացույցներ՝ ուղղությունը որոշելու համար. նավիգացիոն այլ սարքեր եւ գործիքներ",
                "9015" => "Սարքեր եւ գործիքներ՝ գեոդեզիական կամ տեղագրական (ներառյալ լուսանկարչաչափականները), ջրագրական (հիդրոգրաֆիկական), օվկիանոսագրական, ջրաբանական (հիդրոլոգիական), օդերեւութաբանական կամ երկրաֆիզիկական՝ բացի կողմնացույցներից, հեռաչափեր",
                "9016 " => "Կշեռքներ՝ 0,05 գրամ կամ ավելի զգայունությամբ, մանրակշռաքարերով կամ առանց դրանց",
                "9017" => "Գործիքներ՝ գծագրության, նշումների կամ մաթեմատիկական հաշվարկների համար (օրինակ` գծագրական մեքենաներ, պանտոգրաֆներ, անկյունաչափեր, գծագրական լրակազմեր, լոգարիթմական քանոններ, սկավառակային հաշվիչներ). ձեռքի գործիքներ՝ գծային չափեր կատարելու համար (օրինակ` չափիչ ձողեր ու չափերիզներ, միկրոմետրեր, չափակարկիններ)՝ տվյալ խմբում այլ տեղում չնշված կամ չներառված",
                "9018" => "Բժշկության, վիրաբուժության, ատամնաբուժության կամ անասնաբուժության մեջ օգտագործվող սարքեր եւ սարքվածքներ՝ ներառյալ սցինտիգրաֆիկական ապարատուրաները, էլեկտրաբժշկական այլ ապարատուրաներ եւ տեսողությունը հետազոտելու սարքեր",
                "9019" => "Սարքվածքներ մեքենաբուժության համար, մերսման ապարատներ, ունակությունների որոշման համար հոգեբանական թեստերի անցկացման ապարատուրա, օզոնային, թթվածնային եւ աերոզոլային թերապիայի ապարատուրա, արհեստական շնչառության կամ այլ թերապեւտիկ շնչառական ապարատներ",
                "9020 " => "Շնչառական այլ սարքավորումներ եւ գազային դիմակներ՝ բացի առանց մեխանիկական դետալների եւ փոխովի ֆիլտրերի պաշտպանիչ դիմակներից",
                "9021" => "Օրթոպեդիկ հարմարանքներ՝ ներառյալ հենակները, վիրաբուժական գոտիները եւ կալանդները, բեկակալները եւ այլ հարմարանքներ՝ կոտրվածքները բուժելու համար. մարմնի արհեստական մասեր, լսողական ապարատներ եւ այլ հարմարանքներ՝ մարմնի վրա կրելու, մոտը պահելու կամ մարմնի մեջ պատվաստվելու համար՝ օրգանի արատը կամ դրա անաշխատունակությունը փոխհատուցելու համար",
                "9022" => "Ապարատուրա՝ հիմնված ռենտգենյան, ալֆա, բետա եւ գամմա ճառագայթների օգտագործման վրա, բժշկական, վիրաբուժական, ատամնաբուժական կամ անասնաբուժական օգտագործման համար նախատեսված կամ չնախատեսված՝ ներառյալ ռենտգենագրական կամ ռադիոթերապեւտիկ հետազոտությունների համար ապարատուրաները, ռենտգենյան խողովակները եւ ռենտգենյան ճառագայթման այլ գեներատորները, բարձր լարման գեներատորները, վահանները եւ կառավարման վահանակները, էկրանները, սեղանները, բազկաթոռները եւ նույնանման այլ արտադրատեսակներ՝ հետազոտության կամ բուժման համար",
                "9023 " => "Սարքեր, ապարատուրա եւ մոդելներ, որոնք նախատեսված են ցուցադրության նպատակների համար (օրինակ` ուսուցման կամ ցուցադրման ժամանակ), պիտանի չեն այլ նպատակներով օգտագործման համար",
                "9024" => "Մեքենաներ եւ սարքվածքներ նյութերի կարծրությունը, ամրությունը, սեղմվածությունը, առաձգականությունը կամ նյութերի այլ մեխանիկական հատկությունները փորձարկելու համար (օրինակ` մետաղների, փայտեղենի, մանածագործական նյութերի, թղթի, պլաստմասսայի)",
                "9025" => "Խտաչափեր եւ նույնանման սարքեր` հեղուկների մեջ ընկղմվելիս գործող, ջերմաչափեր, հրաչափեր, բարոմետրեր, խոնավաչափեր եւ խոնավաջերմաչափեր՝ գրանցող սարքվածքով կամ առանց գրանցման սարքվածքի, եւ այդ սարքերի ցանկացած համակցությունը",
                "9026" => "Սարքեր եւ ապարատուրա՝ հեղուկների կամ գազի ծախսի, մակարդակի, ճնշման կամ այլ փոփոխական հատկանիշների չափման կամ հսկման համար (օրինակ` ծախսաչափեր, մակարդակի ցուցիչներ, ճնշաչափեր (մանոմետրեր), ջերմահոսաչափեր)՝ բացի 9014, 9015, 9028 եւ 9032 ապրանքային դիրքերում նշված սարքերից եւ ապարատուրայից",
                "9027" => "Սարքեր եւ ապարատուրա՝ ֆիզիկական կամ քիմիական անալիզի համար (օրինակ` բեւեռաչափեր, բեկումաչափեր, սպեկտրաչափեր, գազա– կամ ծխաանալիզատորներ). սարքեր եւ ապարատուրա՝ մածուցիկության, ծակոտկենության, ընդարձակման, մակերեսային ձգունության չափման կամ հսկման համար եւ նույնանման սարքեր ու ապարատուրա. սարքեր եւ ապարատուրա՝ ջերմության, ձայնի կամ լույսի չափման կամ հսկման համար (ներառյալ էքսպոնոմետրերը).",
                "9028" => "Հաշվիչներ՝ գազի, հեղուկի կամ էլեկտրաէներգիայի մատակարարման կամ արտադրության՝ ներառյալ ստուգարկիչները",
                "9029" => "Հաշվիչներ` պտույտների թվի, արտադրանքի քանակի որոշման համար, սակահաշվիչներ (տաքսոմետրեր), անցած հեռավորությունը մղոններով չափող սարքեր, քայլաչափեր եւ նույնանման սարքեր. արագաչափեր եւ պտուտաչափեր (տախոմետրեր)՝ բացի 9014 կամ 9015 ապրանքային դիրքում նշված սարքերից եւ գործիքներից. ստրոբոսկոպներ",
                "9030" => "Օսցիլոսկոպներ, սպեկտրաանալիզատորներ, այլ սարքեր եւ ապարատուրա` էլեկտրական մեծությունների չափման կամ հսկման համար՝ բացի 9028 ապրանքային դիրքում նշված չափիչ սարքերից. սարքեր եւ ապարատուրա` ալֆա, բետա, գամմա, ռենտգենյան, տիեզերական կամ այլ իոնացնող ճառագայթումները հայտնաբերելու կամ չափելու համար",
                "9031" => "Չափող կամ հսկիչ սարքեր, սարքվածքներ եւ մեքենաներ՝ տվյալ խմբում այլ տեղում չնշված կամ չներառված. պրոֆիլային պրոյեկտորներ",
                "9032" => "Սարքեր եւ սարքվածքներ` ավտոմատ կարգավորման կամ կառավարման համար",
                "9033 " => "90–րդ խմբում ընդգրկված մեքենաների, սարքերի, գործիքների կամ ապարատուրայի մասեր եւ պարագաներ (տվյալ խմբում այլ տեղում չնշված կամ չներառված)",
                "9101" => "Ժամացույցներ՝ ձեռքի, գրպանի եւ այլ՝ նախատեսված վրան կրելու կամ մոտը պահելու համար՝ ներառյալ վայրկենաչափերը, կորպուսով, պատրաստված թանկարժեք մետաղից կամ թանկարժեք մետաղով երեսապատված մետաղից",
                "9102" => "Ժամացույցներ՝ ձեռքի, գրպանի եւ այլ՝ նախատեսված վրան կրելու կամ մոտը պահելու համար՝ ներառյալ վայրկենաչափերը՝ բացի 9101 ապրանքային դիրքում ընդգրկված ժամացույցներից եւ վայրկենաչափերից",
                "9103" => "Ժամացույցներ՝ վրան կրելու կամ մոտը պահելու համար չնախատեսված, ժամացույցի մեխանիզմներով՝ վրան կրելու կամ մոտը պահելու համար նախատեսված ժամացույցների համար՝ բացի 9104 ապրանքային դիրքում նշված ժամացույցներից",
                "9104 " => "Ժամացույցներ՝ կառավարման վահանակների վրա տեղադրվող, եւ նույնանման ժամացույցներ վերգետնյա տրանսպորտային միջոցների, թռչող ապարատների, տիեզերական ապարատների կամ նավերի համար",
                "9105" => "Ժամացույցներ՝ վրան կրելու կամ մոտը պահելու համար չնախատեսված, այլ",
                "9106" => "Ապարատուրա՝ օրվա ժամերը գրանցելու համար եւ ապարատուրա՝ ժամանակի միջակայքերը որեւէ եղանակով չափելու, գրանցելու կամ ցուցանշելու համար, ցանկացած ժամացույցի մեխանիզմով կամ սինխրոն շարժիչով (օրինակ` ժամանակի գրանցիչներ, ժամանակի գրառման սարքվածքներ)",
                "9107 " => "Ժամանակի փոխարկիչներ` ցանկացած տեսակի ժամացույցի մեխանիզմով կամ սինխրոն շարժիչով",
                "9108" => "Ժամացույցի մեխանիզմներ` վրան կրելու կամ մոտը պահելու համար նախատեսված ժամացույցների համար, կոմպլեկտավորված եւ հավաքված",
                "9109" => "Ժամացույցի մեխանիզմներ` վրան կրելու կամ մոտը պահելու համար նախատեսված ժամացույցների համար, կոմպլեկտավորված եւ հավաքված",
                "9110" => "Ժամացույցի մեխանիզմներ` կոմպլեկտավորված, չհավաքված կամ մասնակիորեն հավաքված (ժամացույցի մեխանիզմների կոմպլեկտներ). ժամացույցի մեխանիզմներ` չկոմպլեկտավորված, հավաքված. ժամացույցի մեխանիզմներ՝ նախապես կոպիտ հավաքված",
                "9111" => "Կորպուսներ՝ վրան կրելու կամ մոտը պահելու համար նախատեսված ժամացույցների համար, եւ դրանց մասերը",
                "9112" => "Կորպուսներ՝ վրան կրելու կամ մոտը պահելու համար չնախատեսված ժամացույցների համար, եւ նույնանման կորպուսներ՝ տվյալ խմբի այլ արտադրատեսակների համար, եւ դրանց մասերը",
                "9113" => "Գոտիներ, ժապավեններ եւ ապարանջաններ՝ վրան կրելու կամ մոտը պահելու համար նախատեսված ժամացույցների համար, եւ դրանց մասերը",
                "9114" => "Բոլոր տեսակի ժամացույցների մասերը՝ այլ",
                "9201" => "Դաշնամուր, ներառյալ ավտոմատ դաշնամուրները. կլավեսիններ եւ այլ ստեղնավոր լարային գործիքներ",
                "9202" => "Երաժշտական այլ լարային գործիքներ (օրինակ` կիթառներ, ջութակներ, տավիղներ)",
                "9205" => "Երաժշտական փողային գործիքներ (օրինակ՝ ստեղնավոր փողերով երգեհոններ, ակորդեոններ, կլարնետներ, փողեր, պարկապզուկներ)՝ բացի տոնավաճառային երգեհոններից եւ մեխանիկական երգեհոնիկներից",
                "9206 " => "Հարվածային երաժշտական գործիքներ (օրինակ՝ թմբուկներ, քսիլոֆոններ, ափսեներ, կաստանետներ, մարակասներ)",
                "9207" => "Երաժշտական գործիքներ, որոնց մոտ ձայնը վերարտադրվում է կամ պետք է ուժեղացվի էլեկտրականության միջոցով (օրինակ՝ երգեհոններ, կիթառներ, ակորդեոններ)",
                "9208" => "Երաժշտական արկղիկներ, երգեհոններ տոնավաճառային, երգեհոնիկներ մեխանիկական, երգող մեխանիկական թռչուններ, երաժշտական սղոցներ եւ երաժշտական գործիքներ՝ տվյալ խմբում այլ տեղում չնշված կամ չներառված, այլ. ամեն տեսակի հրապուրաշվիկներ (մանոկներ), սուլիչներ, շեփորներ եւ փողային այլ ազդանշանային գործիքներ",
                "9209" => "Երաժշտական գործիքների մասեր (օրինակ` երաժշտական արկղիկների մեխանիզմներ) եւ պարագաներ (օրինակ` քարտեր, սկավառակներ եւ գլանիկներ մեխանիկական գործիքների համար). մետրոնոմներ, կամերտոններ, փողեր ամեն տեսակի՝ ձայնի սեւեռված բարձրությամբ",
                "9301" => "Մարտական զենք՝ բացի ռեւոլվերներից, ատրճանակներից եւ 9307 ապրանքային դիրքում նշված զենքերից",
                "9302 " => "Ռեւոլվերներ եւ ատրճանակներ՝ բացի 9303 կամ 9304 ապրանքային դիրքերում ընդգրկվածներից",
                "9303" => "Հրազենային այլ զենք եւ նույնանման սարքվածքներ, որոնք գործում են պայթուցիկ լիցքի օգտագործման միջոցով (օրինակ` սպորտային զենքեր եւ հրացաններ, հրազենային զենք, որը լիցքավորվում է փողից, հրթիռանետներ եւ այլ սարքվածքներ միայն ազդանշանային հրթիռներ բաց թողնելու համար, ատրճանակներ եւ ռեւոլվերներ դատարկ գնդակներով կրակելու համար, ատրճանակներ թռչող ձողերով՝ կենդանիների «հումանիստական» սպանդի համար, լինեմետներ)",
                "9304 " => "Այլ զենք (օրինակ` զսպանակավոր օդաճնշական (պնեւմատիկ) կամ գազային հրացաններ եւ ատրճանակներ, մահակներ)՝ բացի 9307 ապրանքային դիրքում նշվածներից",
                "9305" => "9301–9304 ապրանքային դիրքերի ապրանքների մասեր եւ պարագաներ",
                "9306" => "Ռումբեր, նռնակներ, տորպեդներ, ականներ, հրթիռներ եւ նույնանման միջոցներ մարտական գործողություններ վարելու համար եւ դրանց մասերը. փամփուշտներ, այլ զինամթերք, արկեր եւ դրանց մասերը, ներառյալ մանրագնդակները եւ փամփուշտների համար նախատեսված խցկանները",
                "9307 " => "Թրեր, սրեր, սուսերներ, թրադաշույններ, սվիններ, նիզակներ եւ նույնանման զենք, նշված զենքի տեսակների մասերը, պատյաններ եւ տուփեր դրանց համար",
                "9401" => "Կահույք նստելու համար (բացի 9402 ապրանքային դիրքում նշվածներից), որոնք ձեւափոխվում են կամ չեն ձեւափոխվում որպես մահճակալներ, եւ դրա մասերը",
                "9402" => "Կահույք` բժշկական, վիրաբուժական, ատամնաբուժական կամ անասնաբուժական (օրինակ` վիրահատական սեղաններ, զննման համար սեղաններ, մեխանիկական հարմարանքներով հիվանդանոցային մահճակալներ, ատամնաբուժական բազկաթոռներ). վարսավիրական եւ նույնանման բազկաթոռներ` պտտելու եւ միաժամանակ բարձրացնելու եւ թեքելու հարմարանքներով. վերոհիշյալ արտադրատեսակների մասեր",
                "9403" => "Այլ կահույք եւ դրա մասերը",
                "9404" => "Ներքնակային հիմքեր. անկողնային պարագաներ եւ կահավորման նույնանման արտադրատեսակներ (օրինակ` ներքնակներ, մգդակած վերմակներ, մգդակած բմբուլե վերմակներ, բազմոցային բարձեր, փափկաթոռներ եւ բարձեր)՝ զսպանակներով կամ լցված ցանկացած նյութերով կամ պատրաստված ծակոտկեն ռետինից կամ պլաստմասսայից, ծածկած կամ չծածկած",
                "9405" => "Լամպեր եւ լուսավորման սարքավորումներ՝ ներառյալ լուսարձակները, լամպեր լույսի նեղ ուղղվածությամբ, ցոլալապտերներ եւ դրանց մասերը՝ այլ տեղում չնշված կամ չներառված. լուսային ցուցանակներ, լուսային ցուցատախտակներ՝ անունով կամ անվանմամբ կամ հասցեով, եւ նույնանման արտադրատեսակներ՝ ներկառուցված լույսի աղբյուր ունեցող, եւ դրանց մասերը՝ այլ տեղում չնշված կամ չներառված",
                "9406 " => "Շինարարական հավաքովի կոնստրուկցիաներ",
                "9503 " => "Եռանիվ հեծանիվներ, ինքնաշարժեր, ոտնակավոր ավտոմոբիլներ եւ նույնանման խաղալիքներ անիվների վրա, սայլակներ տիկնիկների համար, տիկնիկներ, այլ խաղալիքներ, փոքրացրած չափերով («մասշտաբով») մոդելներ եւ նույնանման ժամանցային մոդելներ՝ գործող կամ չգործող, ամեն տեսակի գլուխկոտրուկներ՝",
                "9504" => "Բարձակներ ու սարքավորումներ տեսախաղերի համար, ապրանքներ ժամանցի համար, սեղանի կամ սենյակի խաղեր՝ ներառյալ պինբոլ, բիլիարդ խաղալու համար սեղանները, հատուկ սեղաններ խաղատներում խաղերի համար եւ ավտոմատ սարքավորումներ կեգլիի համար",
                "9505" => "Տոնահանդիսության, կառնավալների համար արտադրատեսակներ կամ այլ արտադրատեսակներ զվարճությունների համար՝ ներառյալ աճպարարություններ ու կատակներ ցուցադրելու համար առարկաները",
                "9506" => "Գույք եւ սարքավորումներ՝ ընդհանուր ֆիզկուլտուրայով, մարմնամարզությամբ, թեթեւ ատլետիկայով, այլ սպորտաձեւերով զբաղվելու համար (ներառյալ սեղանի թենիսը) կամ բացօթյա խաղերի համար, տվյալ խմբի այլ տեղում չնշված կամ չներառված. լողավազաններ եւ ավազաններ երեխաների համար",
                "9507" => "Ձկնորսական կարթեր, ձկնորսական կեռիկներ եւ այլ պիտույքներ ձուկ որսալու համար` օգտագործելով կարթաթելը, ձկնորսական ցանցեր, ցանցեր թիթեռների համար եւ նույնանման ցանցեր, խայծեր թռչունների մուլյաժների տեսքով (բացի 9208 կամ 9705 ապրանքային դիրքերում նշվածներից) եւ նույնանման պարագաներ որսորդության եւ հրաձգության համար",
                "9508" => "Կարուսելներ, ճոճանակներ, հրաձգարաններ ու այլ ատրակցիոններ, շրջիկ կրկեսներ եւ շրջիկ գազանանոցներ, շրջիկ թատրոններ",
                "9601" => "Մշակած եւ փորագրության համար պիտանի փղոսկր, ոսկոր, կրիայի պատյան, եղջյուր, եղջերուի եղջյուրներ, կորալներ, սադափ, կենդանական ծագման այլ նյութեր եւ այդ նյութերից պատրաստված արտադրատեսակներ (ներառյալ կաղապարման եղանակով ստացված արտադրատեսակները)",
                "9602 " => "Բուսական կամ հանքային ծագման մշակված նյութեր՝ փորագրության համար պիտանի, եւ դրանցից պատրաստված արտադրատեսակներ. մոմից, բնաճարպից, բնական խեժերից կամ բնական կաուչուկից կամ մոդելային մածուկներից ձեւավորված կամ փորագրված արտադրատեսակներ եւ ձեւավորված կամ փորագրված այլ արտադրատեսակներ՝ այլ տեղում չնշված կամ չներառված. դոնդողանյութ՝ մշակված, չկարծրացած (բացի 3503 ապրանքային դիրքում նշված դոնդողանյութից) եւ չկարծրացած դոնդողանյութից արտադրատեսակներ",
                "9603" => "Ավելներ, խոզանակներ (ներառյալ մեխանիզմների, սարքերի կամ տրանսպորտային միջոցների մաս հանդիսացող խոզանակները), առանց շարժիչների ձեռքի մեխանիկական խոզանակներ՝ նախատեսված հատակի մաքրման համար, հատակի ձողափայտեր եւ փետուրե ավելիկներ փոշին սրբելու համար. հանգույցներ եւ փնջիկներ՝ պատրաստված ավելներ կամ խոզանակային արտադրատեսակներ պատրաստելու համար. ներկարարական բարձիկներ եւ գլանիկներ՝ ներկելու համար. ռեզինե հատակի ձողափայտեր (բացի խոնավությունը վերացնելու համար նախատեսված ռեզինե գլանիկներից)",
                "9604 " => "Մաղեր եւ քարմաղներ՝ ձեռքի",
                "9605 " => "Ճամփորդական հավաքածուներ՝ անձնական հիգիենայի համար, հագուստը եւ կոշիկները կարելու կամ մաքրելու համար",
                "9606" => "Կոճակներ, կոճգամներ, ճարմանդ–փականներ, կոճակների ձեւեր եւ այդ արտադրատեսակների այլ մասեր. կոճակների ձեւվածքներ",
                "9607" => "Կայծակ–ճարմանդներ եւ դրանց մասերը",
                "9608" => "Գրիչներ գնդիկավոր. գրիչներ եւ նշիչներ ֆետրից կամ այլ ծակոտկեն նյութերից ծայրով. թանաքով ինքնահոսներ, ստիլոգրաֆներ եւ այլ գրիչներ. պատճենահան գրչածայրեր. մատիտներ՝ սահող կամ շարժական միջուկով. գրչածայրերի կալիչներ, մատիտների կալիչներ եւ նույնանման կալիչներ. վերը թվարկած արտադրատեսակների մասեր (ներառյալ կափարիչները եւ սեղմակները)՝ բացի 9609 ապրանքային դիրքում նշված արտադրատեսակներից",
                "9609" => "Մատիտներ հասարակ (բացի 9608 ապրանքային դիրքում նշվածներից), գունավոր մատիտներ, մատիտների գրիֆելներ, պաստելներ, ածխային մատիտներ, կավիճներ գրելու կամ նկարելու համար եւ կավիճներ դերձակների համար",
                "9610 " => "Գրիֆելային տախտակներ գրելու կամ նկարելու համար՝ շրջանակների մեջ կամ առանց շրջանակների",
                "9611 " => "Դրոշմակներ թվագրելու, կնքելու համար կամ համարացույցներ եւ նույնանման հարմարանքեր (ներառյալ պիտակները տպելու եւ դրոշմելու սարքավորումները)՝ նախատեսված ձեռքի աշխատանքի համար. ձեռքի դակիչներ, ձեռքի շարոցներ եւ տպագրության ձեռքի լրակազմեր, որոնք իրենց մեջ ներառում են նման շարոցներ",
                "9612" => "Ժապավեններ՝ նախատեսված գրամեքենաների համար կամ նույնանման ժապավեններ՝ ներծծված թանաքով կամ մշակված այլ եղանակով, նախատեսված դրոշմատիպեր ստանալու համար, կոճերով, ժապավենատուփերով կամ առանց դրանց. կնքաբարձիկներ՝ ներծծված կամ չներծծված թանաքով, տուփերով կամ առանց տուփերի",
                "9613" => "Կրակայրիչներ՝ նախատեսված ծխախոտների համար, եւ այլ կրակայրիչներ՝ ներառյալ մեխանիկական եւ էլեկտրական կրակայրիչները, եւ դրանց համար նախատեսված մասերը՝ բացի կայծքարերից եւ պատրույգներից",
                "9614 " => "Ծխամորճեր (ներառյալ դրանց բաժականման մասերը), մուշտուկներ՝ նախատեսված սիգարների կամ սիգարետների համար, եւ դրանց մասերը",
                "9615" => "Սանրեր, խտատամ սանրեր եւ այլ նույնանման առարկաներ. հերակալներ, սեղմակներ գանգրացման համար, վարսափաթթուկներ (բիգուդիներ) եւ նույնանման առարկաներ՝ բացի 8516 ապրանքային դիրքում նշվածներից, եւ դրանց մասերը",
                "9616" => "Փոշեցիրներ՝ հոտավետ նյութերի եւ հիգիենիկ նպատակների համար նախատեսված նույնանման փոշեցիրներ, դրանց գլխադիրները եւ գլխիկները. աղվափնջիկներ եւ բարձիկներ՝ կոսմետիկ կամ արդուզարդի միջոցների համար",
                "9617 " => "Թերմոսներ եւ վակուումային այլ անոթներ՝ հավաքված տեսքով. դրանց մասերը՝ բացի ապակե փորձանոթներից",
                "9618 " => "Մանեկեններ դերձակների համար եւ այլ մանեկեններ. ավտոմատ–մանեկեններ եւ շարժական իրեր՝ նախատեսված ցուցափեղկերի ձեւավորման համար",
                "9619 " => "Կանացի հիգիենիկ միջադիրներ եւ խծուծներ (տամպոններ), մանկական խանձարուրներ եւ տակդիրներ ու նույնանման արտադրատեսակներ՝ ցանկացած նյութից",
                "9701" => "Նկարներ, գծանկարներ եւ գունամատիտանկարներ (պաստելներ)՝ ամբողջությամբ կատարված ձեռքով՝ բացի 4906 ապրանքային դիրքում նշված գծանկարներից եւ ձեռքով նկարազարդված կամ զարդանախշված այլ պատրաստի արտադրատեսակներից, կոլաժներ եւ նույնանման դեկորատիվ պատկերներ",
                "9702 " => "Փորագրանկարների, էստամպների եւ վիմատիպ նկարների բնօրինակներ",
                "9703 " => "Քանդակների եւ արձանիկների բնօրինակներ` ցանկացած նյութերից",
                "9704 " => "Փոստային նամականիշներ կամ պետտուրքի նամականիշներ, փոստային վճարման նշաններ՝ ներառյալ մարման առաջին օրվա նշանները, փոստային գրենական պիտույքներ (զինանշանով թուղթ) եւ նույնանման առարկաներ՝ օգտագործված կամ չօգտագործված՝ բացառությամբ 4907 ապրանքային դիրքում ընդգրկված ապրանքների",
                "9705 " => "Հավաքածուներ եւ հավաքածուներ կազմելու առարկաներ` կենդանաբանության, բուսաբանության, հանքաբանության, անատոմիայի, պատմության, հնագիտության, հնէաբանության, ազգագրության կամ դրամագիտության վերաբերյալ",
                "9706 " => "100 տարուց ավելի հնություն ունեցող հնաոճ իրեր",
                "01.61" => "Մշակաբույսերի աճեցման հետ կապված օժանադակ ծառայություններ բուսաբուծության բնագավառում",
                "01.62" => "Կենդանիների բուծման հետ կապված օժանդակ ծառայություններ",
                "01.64" => "Սերմերի մշակման և սերմացվի ֆոնդի ձևավորման հետ կապված ծառայություններ",
                "01.70" => "Որսորդություն, վայրի կենդանիների որսում և հարակից ծառայություններ",
                "02.10" => "Անտառատնկարանների ծառայություններ, տնկիների աճեցման հետ կապված ծառայություններ",
                "02.40" => "Փայտամթերումներ և հարակից  ծառայություններ",
                "03.00" => "Ձուկ և ձկնորսության այլ արտադրանք, ձկնաբուծության արտադրանք, ձկնորսության և ձկնաբուծության հետ կապված ծառայություններ",
                "09.10" => "Նավթի և բնական գազի արդյունահանման հետ կապված տեխնիկական ծառայություններ",
                "09.90" => "Հանքագործական արդյունաբերության այլ ճյուղերի տեխնիկական ծառայություններ",
                "10.11 " => "Միս թարմ և պահածոյացված ",
                "13.30" => "Մանվածքի և գործվածքի վերջնամշակման ծառայություններ",
                "16.21" => "Նրբատախտակ և պանելներ",
                "18.11" => "Թերթերի տպագրության ծառայություններ",
                "18.12" => "Տպագրական այլ ծառայություններ",
                "18.13" => "Նախատպագրական և տպագրական ծառայություններ",
                "18.14" => "Կազմարարական և զուգընթաց ծառայություններ",
                "18.20" => "Ձայնա- տեսագրությունների, ծրագրային միջոցների պատճենահանման ծառայություններ",
                "23.19" => "Այլ ապակի, ներառյալ տեխնիկական արտադրատեսակներ ապակուց",
                "23.69" => "Այլ շինվածքներ բետոնից, գիպսից և ցեմենտից",
                "24.51" => "Թուջի և երկաթի ձուլման ծառայություններ",
                "24.52" => "Պողպատի ձուլման ծառայություններ",
                "24.53" => "Թեթև մետաղների ձուլման ծառայություններ",
                "24.54" => "Այլ գունավոր մետաղների ձուլման ծառայություններ",
                "25.50" => "Թերթավոր մետաղի կռման, մամլման, դրոշմման և պրոֆիլավորման ծառայություններ. փոշեմետաղագործության եղանակով արտադրատեսակների արտադրության ծառայություններ",
                "25.61" => "Մետաղների մշակման և ծածկապատման ծառայություններ",
                "25.62" => "Մետաղական արտադրատեսակների մշակման ծառայություններ, մեքենաշինության հիմնական տեխնոլոգիական գործընթացների կիրառմամբ",
                "33.11" => "Պատրաստի մետաղե արտադրատեսակների նորոգման ծառայություններ",
                "33.12" => "Սարքավորանքի նորոգման ծառայություններ",
                "33.13" => "Էլեկտրոնային և օպտիկական սարքավորանքի նորոգման ծառայություններ",
                "33.14" => "Էլեկտրական սարքավորանքի նորոգման ծառայություններ",
                "33.15" => "Նավերի և նավակների նորոգման և տեխնիկական սպասարկման ծառայություններ",
                "33.16" => "Օդանավերի և տիեզերանավերի նորոգման և տեխնիկական սպասարկման ծառայություններ",
                "33.17" => "Այլ տրանսպորտային միջոցների և սարքավորանքի նորոգման և տեխնիկական սպասարկման ծառայություններ",
                "33.19" => "Այլ սարքավորանքի նորոգման ծառայություններ",
                "33.20" => "Արդյունաբերական մեքենաների և սարքավորանքի հավաքակցման ծառայություններ",
                "35.12" => "Էլեկտրաէներգիայի փոխանցման ծառայություններ",
                "35.13" => "Էլեկտրաէներգիայի բաշխման ծառայություններ",
                "35.14" => "Էլեկտրաէներգիայի վաճառքի ծառայություններ",
                "35.22" => "Խողովակաշարերով գազակերպ վառելիքի բաշխման ծառայություններ",
                "35.23" => "Գազամատակարարման համակարգով գազի վաճառքի ծառայություններ",
                "35.30" => "Գոլորշու և լավորակ օդի մատակարարման ծառայություններ",
                "36.00" => "Բնական ջուր, ջրի մաքրման և մատակարարման ծառայություններ",
                "37.00" => "Կոյուղու ծառայություններ. կեղտաջրերի ապարախյուս (շլամ)",
                "38.11" => "Ոչ վնասակար թափոններ. ոչ վնասակար թափոնների հավաքման ծառայություններ
                        Տվյալ դասը ներառում է նաև`
                        - շինարարական թափոնների և շենքերի ու կառույցների քանդման արդյունքում առաջացած աղբի հավաքման ծառայություններ
                        - բեկորների, վրձինների և համանման այլ շինարարական աղբի հավաքման և ոչնչացման ծառայություններ
                        - մանածագործական արտադրատեսակների արտադրությունից առաջացած թափոնների հավաքման ծառայություններ",
                "38.12" => "Վնասակար թափոններ. վնասակար թափոնների հավաքման ծառայություններ",
                "38.21" => "Ոչ վնասակար թափոնների մշակման և հեռացման ծառայություններ",
                "38.22" => "Վնասակար թափոնների մշակման և հեռացման ծառայություններ",
                "38.32" => "Տեսակավորված նյութերի օգտահանման ծառայություններ. երկրորդային հումք",
                "39.00" => "Աղտոտվածքի վնասազերծման և թափոնների հեռացման այլ ծառայություններ
                        Տվյալ դասը ներառում է`
                        - արդյունաբերական օբյեկտների շահագործման կամ վթարների արդյունքում առաջացած աղտոտվածքի վնասազերծման ծառայություններ` աղտոտված բնահողի, ջրի, օդի անմիջապես տեղում մաքրման կամ տեղայնացման նպատակով",
                "43.22" => "Ջրամատակարարման, կոյուղու, ջեռուցման և օդի լավորակման համակարգերի հավաքակցման աշխատանքներ",
                "43.29" => "Այլ շինարարական հավաքակցման աշխատանքներ",
                "43.32" => "Ատաղձագործական և հյուսնի աշխատանքներ",
                "43.99" => "Այլ մասնագիտացված շինարարական աշխատանքներ, չներառված ուրիշ խմբավորումներում",
                "45.11" => "Մարդատար ավտոմոբիլների և թեթև ավտոտրանսպորտային միջոցների առևտրի ծառայություններ",
                "45.19" => "Այլ ավտոտրանսպորտային միջոցների առևտրի ծառայություններ",
                "45.20" => "Ավտոտրանսպորտային միջոցների տեխնիկական սպասարկման և նորոգման ծառայություններ",
                "45.31" => "Ավտոմեքենաների մասերի, հանգույցների և պարագաների մեծածախ առևտրի ծառայություններ",
                "45.32" => "Ավտոմեքենաների մասերի, հանգույցների և պարագաների մանրածախ առևտրի ծառայություններ",
                "45.40" => "Մոտոցիկլների և դրանց մասերի, հանգույցների ու պարագաների առևտրի, տեխնիկական սպասարկման և նորոգման ծառայություններ
                        Տվյալ դասը ներառում է նաև`
                        - մոպեդների և դրանց մասերի, հանգույցների ու պարագաների առևտրի, տեխնիկական սպասարկման և նորոգման ծառայություններ
                        Բացառվում է`
                            - հեծանիվների և դրանց մասերի, հանգույցների ու պարագաների առևտրի, տեխնիկական սպասարկման և նորոգման ծառայությունները",
                "46.11" => "Գյուղատնտեսական հումքի, կենդանի կենդանիների, մանածագործական հումքի և կիսապատրաստվածքների մեծածախ առևտրի ծառայություններ` վարձատրությամբ կամ պայմանագրային հիմունքով",
                "46.12" => "Վառելիքի, հանքաքարերի, մետաղների և արդյունաբերական քիմիական նյութերի մեծածախ առևտրի ծառայություններ` վարձատրությամբ կամ պայմանագրային հիմունքով",
                "46.13" => "Բնափայտի և շինանյութի մեծածախ առևտրի ծառայություններ` վարձատրությամբ կամ պայմանագրային հիմունքով",
                "46.14" => "Մեքենաների, արդյունաբերական սարքավորանքի, նավերի և թռչող սարքերի մեծածախ առևտրի ծառայություններ` վարձատրությամբ կամ պայմանագրային հիմունքով",
                "46.15" => "Կահույքի, կենցաղային ապրանքների և երկաթեղենի, դանակային և այլ մետաղական արտադրատեսակների մեծածախ առևտրի ծառայություններ` վարձատրությամբ կամ պայմանագրային հիմունքով",
                "46.16" => "Մանածագործական արտադրատեսակների, հագուստի, մորթե արտադրատեսակների, կոշիկի և կաշվե արտադրատեսակների մեծածախ առևտրի ծառայություններ` վարձատրությամբ կամ պայմանագրային հիմունքով",
                "46.17" => "Սննդամթերքի, խմիչքների և ծխախոտային արտադրատեսակների մեծածախ առևտրի ծառայություններ` վարձատրությամբ կամ պայմանագրային հիմունքով",
                "46.18" => "Այլ ապրանքների մեծածախ առևտրի ծառայություններ` վարձատրությամբ կամ պայմանագրային հիմունքով",
                "46.19" => "Լայն տեսականու ապրանքների մեծածախ առևտրի ծառայություններ` վարձատրությամբ կամ պայմանագրային հիմունքով",
                "46.21" => "Հացահատիկի, անմշակ ծխախոտի, սերմերի և անասնակերերի մեծածախ առևտրի ծառայություններ` վարձատրությամբ կամ պայմանագրային հիմունքով",
                "46.22" => "Ծաղիկների և բույսերի մեծածախ առևտրի ծառայություններ` վարձատրությամբ կամ պայմանագրային հիմունքով",
                "46.23" => "Կենդանի կենդանիների մեծածախ առևտրի ծառայություններ` վարձատրությամբ կամ պայմանագրային հիմունքով",
                "46.24" => "Մորթիների, կաշվի և մշակված կաշվի մեծածախ առևտրի ծառայություններ` վարձատրությամբ կամ պայմանագրային հիմունքով",
                "46.31" => "Մրգերի և բանջարեղենի մեծածախ առևտրի ծառայություններ",
                "46.32" => "Մսի և մսամթերքի մեծածախ առևտրի ծառայություններ",
                "46.33" => "Կաթնամթերքի, ձվի, սննդային յուղերի և ճարպերի մեծածախ առևտրի ծառայություններ",
                "46.34" => "Ալկոհոլային և այլ խմիչքների մեծածախ առևտրի ծառայություններ",
                "46.35" => "Ծխախոտային արտադրատեսակների մեծածախ առևտրի ծառայություններ",
                "46.36" => "Շաքարի, շոկոլադի, շաքարային հրուշակեղենի մեծածախ առևտրի ծառայություններ",
                "46.37" => "Սուրճի, թեյի, կակաոյի և համեմունքների մեծածախ առևտրի ծառայություններ",
                "46.38" => "Այլ սննդամթերքի, ներառյալ ձկան, խեցեմորթների և կակղամորթների մեծածախ առևտրի ծառայություններ",
                "46.39" => "Սննդամթերքի, խմիչքների և ծխախոտային արտադրատեսակների ոչ մասնագիտացված մեծածախ առևտրի ծառայություններ",
                "46.41" => "Մանածագործական արտադրատեսակների մեծածախ առևտրի ծառայություններ",
                "46.42" => "Հագուստի և կոշիկի մեծածախ առևտրի ծառայություններ",
                "46.43" => "Կենցաղային Էլեկտրասարքերի մեծածախ առևտրի ծառայություններ",
                "46.44" => "Ճենապակե և ապակե արտադրատեսակների և մաքրող միջոցների մեծածախ առևտրի ծառայություններ",
                "46.45" => "Օծանելիքի և կոսմետիկական միջոցների մեծածախ առևտրի ծառայություններ",
                "46.46" => "Դեղագործական ապրանքների մեծածախ առևտրի ծառայություններ",
                "46.47" => "Կահույքի, գորգերի և լուսավորման սարքերի մեծածախ առևտրի ծառայություններ",
                "46.48" => "Ժամացույցների և ոսկերչական արտադրատեսակների մեծածախ առևտրի ծառայություններ",
                "46.49" => "Այլ կենցաղային ապրանքների մեծածախ առևտրի ծառայություններ",
                "46.51" => "Համակարգիչների, համակարգչային ու ծայրամասային սարքավորանքի և ծրագրային ապահովման մեծածախ առևտրի ծառայություններ",
                "46.52" => "Էլեկտրոնային ու հեռահաղորդակցական սարքավորանքի և դրանց մասերի մեծածախ առևտրի ծառայություններ",
                "46.61" => "Գյուղատնտեսական մեքենաների, սարքավորանքի և գործիքների մեծածախ առևտրի ծառայություններ",
                "46.62" => "Հաստոցների մեծածախ առևտրի ծառայություններ",
