                "46.64" => "Մանածագործական, կարի և տրիկոտաժի արտադրության համար մեքենաների մեծածախ առևտրի ծառայություններ",
                "46.65" => "Գրասենյակային կահույքի մեծածախ առևտրի ծառայություններ",
                "46.66" => "Այլ գրասենյակային մեքենաների և սարքավորանքի մեծածախ առևտրի ծառայություններ",
                "46.69" => "Այլ մեքենաների և սարքավորանքի մեծածախ առևտրի ծառայություններ",
                "46.71" => "Պինդ, հեղուկ ու գազակերպ վառելիքի և հարակից արտադրանքի մեծածախ առևտրի ծառայություններ",
