                "46.73" => "Փայտանյութի, շինանյութերի և սանտեխնիկական սարքավորանքի մեծածախ առևտրի ծառայություններ",
                "46.74" => "Երկաթեղենի, ջրմուղի ու ջեռուցման սարքավորանքի և պարագաների մեծածախ առևտրի ծառայություններ",
                "46.75" => "Քիմիական արտադրանքի մեծածախ առևտրի ծառայություններ",
                "46.76" => "Այլ միջանկյալ արտադրանքի մեծածախ առևտրի ծառայություններ",
