                "47.00" => "Մանրածախ առևտրի ծառայություններ, բացի տրանսպորտային միջոցների և մոտոցիկլների առևտրի ծառայություններից",
                "49.10" => "Երկաթուղային միջքաղաքային մարդատար տրանսպորտի ծառայություններ",
