                "55.10" => "Հյուրանոցների ծառայություններ և ժամանակավոր բնակատեղերի տրամադրման համանման ծառայություններ",
                "55.20" => "Հանգստի և այլ վայրերում Ժամանակավոր բնակատեղերի տրամադրման ծառայություններ",
                "55.30" => "Քեմպինգների, շարժական ամառանոցների և բնակելի ավտոկցանքների համար կայանատեղիների ծառայություններ",
                "55.90" => "Ժամանակավոր բնակատեղերի տրամադրման այլ ծառայություններ",
