                "56.21" => "Հանրային սննդի մատակարարման և տոնական միջոցառումների սպասարկման ծառայություններ",
                "56.29" => "Սննդի կազմակերպման այլ ծառայություններ",
                "56.30" => "Խմիչքների մատուցման ծառայություններ",
