                "58.21" => "Համակարգչային խաղերի հրատարակման ծառայություններ",
                "58.29" => "Այլ ծրագրային ապահովման հրատարակման ծառայություններ",
                "59.11" => "Կինոնկարների, տեսաֆիլմերի և հեռուստածրագրերի արտադրության ծառայություններ",
