                "59.13" => "Կինո- և տեսաֆիլմերի, հեռուստատեսային ծրագրերի տարածման ծառայություններ",
                "59.14" => "Կինոֆիլմերի ցուցադրության ծառայություններ",
                "59.20" => "Ձայնագրությունների և երաժշտական ստեղծագործությունների հրատարակման ծառայություններ",
                "60.10" => "Ռադիոհեռարձակման ծառայություններ",
                "60.20" => "Հեռուստածրագրերի կազզման և հեռուստահաղորդման ծառայություններ. հեռուստահաղորդումների բնօրինակներ",
                "61.10" => "Լարային (մալուխային) հեռահաղորդակցական ծառայություններ",
                "61.20" => "Անլար հեռահաղորդակցական կապի ծառայություններ",
                "61.30" => "Արբանյակային կապի ծառայություններ",
                "61.90" => "Հեռահաղորդակցական կապի այլ ծառայություններ",
                "62.01" => "Համակարգչային ծրագրավորման ծառայություններ",
                "62.02" => "Խորհրդատվական ծրայություններ հաշվողական տեխնիկայի բնագավառում
                        Բացառվում է`
                            - ծառայությունները, որոնք մատուցվում են ըստ պայմանաագրի, համաձայն որի խորհրդը խորհրդատվական ծառայությունները վերաբերվում են տեղեկատվական տեխնոլոգիաների բնագավառում լուծումների նախագծման և մշակման հետ (վեբ կայքեր, տվյալների հիմնապահեստներ, կիրառական ծրագրեր, ցանցեր և այլն), տես 62.01.1, համապատասխան տեղեկատվական տեխնոլոգիայի նախագծման և մշակման ծառայությունները
                            - գործարարության ռազմավարության հետ կապված խորհրդատվությունները, օրինակ` էլեկտրոնային առևտրի ռազմավարության մշակման հետ կապված խորհրդատվությունները",
                "62.03" => "Համակարգչային սարքավորանքի կառավարման ծառայություններ",
                "62.09" => "Տեղեկատվական տեխնոլոգիաների և հաշվողական տեխնիկայի բնագավառում այլ ծառայություններ",
                "63.11" => "Տվյալների մշակման, տեղաբաշխման և հարակից ծառայություններ",
                "63.91" => "Տեղեկատվական գործակալությունների ծառայություններ",
                "63.99" => "Տեղեկատվության բնագավառում այլ ծառայություններ, չներառված ուրիշ խմբավորումներում",
                "64.11" => "Կենտրոնական բանկի ծառայություններ",
                "64.19" => "Դրամավարկային ոլորտի միջնորդության այլ ծառայություններ",
                "64.20" => "Հոլդինգ ընկերությունների ծառայություններ",
                "64.30" => "Հիմնադրամների և դրամական միջոցներ տրամադրող համանման ֆինանսական կազմակերպությունների ծառայություններ",
                "64.91" => "Ֆինանսական վարձակալության (լիզինգի) ծառայություններ",
                "64.92" => "Վարկերի տրամադրման այլ ծառայություններ",
                "64.99" => "Այլ ֆինանսական ծառայություններ, չներառված ուրիշ խմբավորումներում, բացի ապահովագրության և կենսաթոշակային ապահովման ծառայություններից",
                "65.11" => "Կյանքի ապահովագրության ծառայություններ",
                "65.12" => "Ընդհանուր ապահովագրության ծառայություններ",
                "65.20" => "Վերաապահովագրության ծառայություններ",
                "65.30" => "Կենսաթոշակային ապահովության ծառայություններ",
                "66.11" => "Ֆինանսական շուկաների կազմակերպման հետ կապված ծառայություններ",
                "66.12" => "Արժեթղթերի և ապրանքների հետ կապված միջնորդային գործառնությունների ծառայություններ",
                "66.19" => "Ֆինանսական ծառայություններին առնչվող այլ օժանդակ ծառայություններ, բացի ապահովագրությունից և կենսաթոշակային ապահովությունից",
                "66.21" => "Ապահովագրական ռիսկերի և վնասների գնահատման ծառայություններ",
                "66.22" => "Ապահովագրության գործակալների և միջնորդների ծառայություններ",
                "66.29" => "Ապահովագրության և կենսաթոշակային ապահովության վերաբերյալ այլ օժանդակ ծառայություններ",
                "66.30" => "Հիմնադրամների կառավարման ծառայություններ",
                "68.10" => "Սեփական անշարժ գույքի առուվաճառքի ծառայություններ",
                "68.31" => "Անշարժ գույքի գործառքների հետ կապված ծառայությունների մատուցում` վարձատրությամբ կամ պայմանագրային հիմունքով",
                "68.32" => "Անշարժ գույքի կառավարման ծառայություններ` վարձատրությամբ կամ պայմանագրային հիմունքով",
                "69.10" => "Իրավաբանական ծառայություններ",
                "69.20" => "Հաշիվների կազմման, հաշվապահական հաշվառման, ֆինանսական վերստուգման ծառայություններ. խորհրդատվական ծառայություններ հարկադրման բնագավառում",
                "70.10" => "Գլխամասային գրասենյակների ծառայություններ",
                "70.21" => "Հասարակության հետ կապերի և հաղորդակցության ծառայություններ",
                "70.22" => "Ձեռնարկատիրական և կառավարման հարցերով այլ խորհրդատվական ծառայություններ",
                "71.11" => "Ճարտարապետության բնագավառում ծառայություններ",
                "71.12" => "Ճարտարագիտական ծառայություններ և փոխկապակցված տեխնիկական խորհրդատվական ծառայություններ",
                "71.20" => "Տեխնիկական փորձարկումների և վերլուծությունների հետ կապված ծառայություններ",
                "72.11" => "Գիտական հետազոտությունների և փորձարարական մշակումների հետ կապված ծառայություններ կենսատեխնոլոգիաների բնագավառում",
                "72.19" => "Գիտական հետազոտությունների և փորձարարական մշակումների հետ կապված ծառայություններ այլ բնական և տեխնիկական գիտությունների բնագավառում",
                "72.20" => "Գիտական հետազոտությունների և փորձարարական մշակումների հետ կապված ծառայություններ հասարարական և հումանիտար գիտությունների բնագավառում",
                "73.11" => "Գովազդային գործակալությունների ծառայություններ",
                "73.12" => "Զանգվածային լրատվական միջոցներում ներկայացուցչական ծառայություններ",
                "73.20" => "Շուկայի իրավիճակի հետազոտության և հասարակական կարծիքի ուսումնասիրության ծառայություններ",
                "74.10" => "Դիզայնի բնագավառում մասնագիտացված ծառայություններ",
                "74.20" => "Լուսանկարչության բնագավառում ծառայություններ",
                "74.30" => "Գրավոր և բանավոր թարգմանության ծառայություններ",
                "74.90" => "Այլ մասնագիտական, գիտական և տեխնիկական ծառայություններ, չներառված ուրիշ խմբավորումներում",
                "75.00" => "Կենդանիների բուժման ծառայություններ",
                "77.11" => "Մարդատար ավտոմեքենաների և թեթևաքաշ ավտոտրանսպորտային միջոցների վարձույթի և լիզինգի ծառայություններ",
                "77.12" => "Բեռնատար ավտոմեքենաների վարձույթի և լիզինգի ծառայություններ",
                "77.21" => "Հանգստի, զվարճանքի և սպորտի համար պարագաների վարձույթի և լիզինգի ծառայություններ",
                "77.22" => "Տեսաերիզների և տեսասկավառակների վարձույթի ծառայություններ",
                "77.29" => "Այլ կենցաղային արտադրատեսակների և անձնական օգտագործման պարագաների վարձույթի ծառայություններ",
                "77.31" => "Գյուղատնտեսական մեքենաների ու սարքավորանքի վարձույթի և լիզինգի ծառայություններ",
                "77.32" => "Շինարարական մեքենաների ու քաղաքացիական օբյեկտների շինարարության համար սարքավորանքի վարձույթի և լիզինգի ծառայություններ",
                "77.33" => "Գրասենյակային մեքենաների և սարքավորանքի (ներառյալ հաշվողական տեխնիկան) վարձույթի և լիզինգի ծառայություններ",
                "77.34" => "Ջրային տրանսպորտային միջոցների ու սարքավորանքի վարձույթի և լիզինգի ծառայություններ",
                "77.35" => "Օդային տրանսպորտային միջոցների ու սարքավորանքի վարձույթի և լիզինգի ծառայություններ",
                "77.39" => "Ուրիշ խմբավորումներում չներառված այլ մեքենաների, սարքավորանքի և նյութական միջոցների վարձույթի և լիզինգի ծառայություններ",
                "77.40" => "Մտավոր սեփականության և համանման արտադրանքի (բացի հեղինակային իրավունքով պահպանվող ստեղծագործություններից) օգտագործման իրավունքի համար լիցենզիաների տրամադրման ծառայություններ",
                "78.10" => "Աշխատանքի տեղավորման գործակալությունների ծառայություններ",
                "78.20" => "Ժամանակավոր աշխատանքի տեղավորման գործակալությունների կողմից մատուցվող ծառայություններ",
                "78.30" => "Աշխատանքային ռեսուրսների բնագավառում անձնակազմի ապահովման այլ ծառայություններ
                        Բացառվում է`
                            - ձեռնարկատիրական գործունեության հետ զուգակցված աշխատանքային ռեսուրսների ապահովման ծառայությունները, տես տնտեսական գործունեությունը բնութագրող համապատասխան դասը",
                "79.11" => "Զբոսաշրջային գործակալությունների ծառայություններ",
