                        - զբոսաշրջային օպերատորների և զբոսաշրջային ուղևորությունների կառավարման ծառայությունները",
                "80.10" => "Մասնավոր պահապանական գործակալությունների ծառայություններ",
                "80.20" => "Անվտանգության ապահովման համակարգերի ծառայություններ",
                "80.30" => "Հետաքննությունների անցկացման ծառայություններ",
                "81.10" => "Շենքերի սպասարկման համալիր ծառայություններ",
                "81.21" => "Ընդհանուր նշանակության շենքերի մաքրման և հավաքման ծառայություններ",
                "81.22" => "Շենքերի մաքրման ու հավաքման և արդյունաբերական հավաքման այլ ծառայություններ",
                "81.29" => "Մաքրման և հավաքման այլ ծառայություններ",
                "81.30" => "Բնատեսարանի հատակագծման ծառայություններ",
                "82.11" => "Վարչարարական սպասարկման բնագավառում համալիր ծառայություններ",
                "82.19" => "Լուսապատճենման ծառայություններ, փաստաթղթերի պատրաստման և մասնագիտացված գրասենյակային սպասարկման այլ ծառայություններ",
                "82.20" => "Հեռախոսային կանչերի մշակման կենտրոնների ծառայություններ",
                "82.30" => "Վեհաժողովների, առևտրային ցուցահանդեսների կազմակերպման ծառայություններ",
                "82.91" => "Վճարների գանձման գործակալությունների և վարկային գործառնությունների վերաբերյալ հաշվետվությունների կազմման ծառայություններ",
                "82.92" => "Փաթեթավորման ծառայություններ",
                "82.99" => "Ձեռնարկատիրական գործունեության հետ կապված այլ օժանդակ ծառայություններ, չներառված ուրիշ խմբավորումներում",
                "84.11" => "Պետական կառավարման ընդհանուր բնույթի ծառայություններ",
                "84.12" => "Առողջապահության, կրթության, մշակույթի բնագավառներում վարչական ծառայություններ և այլ սոցիալական ծառայություններ, բացի սոցիալական ապահովագրության բնագավառի ծառայություններից",
                "84.13" => "Առևտրային գործունեության արդյունավետության բարձրացման հետ կապված վարչական ծառայություններ",
                "84.21" => "Արտաքին հարաբերությունների բնագավառում ծառայություններ",
                "84.22" => "Պաշտպանության բնագավառում ծառայություններ",
                "84.23" => "Արդարադատության բնագավառում ծառայություններ",
                "84.24" => "Հասարակական անվտանգության և իրավակարգի ապահովման հետ կապված ծառայություններ",
                "84.25" => "Հրշեջ խմբերի ծառայություններ",
                "84.30" => "Պարտադիր սոցիալական ապահովագրության բնագավառում ծառայություններ",
                "85.10" => "Նախադպրոցական  կրթության բնագավառում ծառայություններ",
                "85.20" => "Տարրական կրթության բնագավառում ծառայություններ",
                "85.31" => "Հիմնական և միջնակարգ ընդհանուր կրթության բնագավառում ծառայություններ",
                "85.32" => "Նախնական մասնագիտական (արհեստագործական) և միջին մասնագիտական կրթության բնագավառում ծառայություններ",
                "85.41" => "Հետմիջնակարգ ոչ բարձրագույն կրթության բնագավառում ծառայություններ",
                "85.42" => "Բարձրագույն կրթության բնագավառում ծառայություններ",
                "85.51" => "Սպորտի և հանգստի կազմակերպման բնագավառում ուսուցման ծառայություններ",
                "85.52" => "Մշակույթի ոլորտում կրթության բնագավառի ծառայություններ",
                "85.53" => "Տրանսպորտային միջոցների համար անձնակազմի պատրաստման դպրոցների ծառայություններ",
                "85.59" => "Կրթության բնագավառում այլ ծառայություններ, չներառված ուրիշ խմբավորումներում",
