                "87.10" => "Բժշկական խնամքի ծառայություններ, կացության ապահովմամբ",
                "87.20" => "Մտավոր թերզարգացած, հոգեկան կամ ֆիզիկական թերություններով, նարկոլոգիական խնդիրներ ունեցող անձանց խնամքի ծառայություններ, կացության ապահովմամբ",
                "87.30" => "Անգործունակների և տարեցների խնամքի ծառայություններ, կացության ապահովմամբ",
