                "93.29" => "Զվարճությունների և հանգստի կազմակերպման բնագավառում այլ ծառայություններ",
                "94.11" => "Անդամության վրա հիմնված առևտրային և ձեռնարկատիրական  կազմակերպությունների կողմից մատուցվող ծառայություններ",
                "94.12" => "Անդամության վրա հիմնված մասնագիտական կազմակերպությունների կողմից մատուցվող ծառայություններ",
