                "94.92" => "Քաղաքական կազմակերպությունների կողմից մատուցվող ծառայություններ",
                "94.99" => "Անդամության վրա հիմնված այլ կազմակերպությունների կողմից մատուցվող ծառայություններ",
                "95.11" => "Համակարգիչների և ծայրամասային սարքավորանքի նորոգման ծառայություններ",
